INSERT INTO `photos_announcement` VALUES (1,'jcnam','2020-03-20 14:44:12.228459','스터디에 처음 오신 분들 필독!','Histudy에 오신 여러분들 환영합니다! \r\n\r\n보고서를 작성하기 전에, 아래의 URL로 가셔서 Histudy의 Guideline를 읽어보시기 바랍니다 :)\r\n\r\n여러분들의 스터디가 잘 진행되길 바랍니다.\r\n\r\nTeam Chickadee 올림\r\n\r\nHistudy Guideline URL\r\nhttps://www.notion.so/Study-Group-Guideline-3081c03ffef44ffa92545ba787a55c31'),(2,'chickadee','2020-03-27 13:11:03.752112','보고서 작성법 변경 안내','<p>여러분 스터디는 잘하고 계시나요? :)<br></p><p>보고서를 작성하는 부분에 새롭게 추가된 부분이 있어 공지드립니다.</p><p><br></p><p>이전에는 스터디 시간을 hh:mm ~ hh:mm 형식으로 입력하였다면,&nbsp;</p><p>새롭게 바뀐 부분은 아래 첨부한 그림처럼 스터디 시작 시간을 hh:mm 형식으로 입력하시고, 스터디한 시간을 분 단위로 입력해 주시면 감사하겠습니다.</p><p><br></p><p>감사합니다.</p><p>모두 스터디 화이팅 하셔서 좋은 결과 얻으시길 바랍니다!</p><p>Team Chickadee</p><p><br></p><p><span style=\"font-size: 24px;\"><b>변경된 부분 캡쳐</b></span></p><p><img src=\"/upload_files/django-summernote/2020-03-27/67efb22a-7297-4729-8d15-e4e9a03f2275.png\" style=\"width: 418px;\"><br></p>'),(3,'chickadee','2020-04-12 09:55:10.420790','보고서 수정기능 추가','<p>여러분 벌써 7주 차에 접어드는데 다들 스터디는 잘하고 계시나요?</p><p>남은 기간도 스터디 화이팅 하셔서 좋은 결과 얻으시길 바랍니다 :)</p><p><br></p><p>저희가 Histudy를 운영하면서 보고서가 수정되었으면 좋겠다는 피드백을 여러 번 받았습니다.</p><p>그래서 보고서의 수정 기능을 추가하였습니다. (사진은 바꿀 수 없습니다.)</p><p>유의하실 점은, 보고서를 등록한 뒤 한 시간 동안만 수정할 수 있으니 유의해 주세요!</p><p><br></p><p>감사합니다.</p><p>Team Chickadee</p>');
/*!40000 ALTER TABLE `photos_announcement` ENABLE KEYS */;
