INSERT INTO `photos_data` VALUES (4,'2020/03/20/orig/2BEBAE38-85DF-461D-A34B-59974C7A5083.jpeg','프린스 알리 ~~','2020-03-20 14:03:34.137033',NULL,NULL,NULL,NULL,'알라딘 친구들',NULL,NULL,60),(5,'2020/03/20/orig/2BEBAE38-85DF-461D-A34B-59974C7A5083_FQTuKQI.jpeg','프린스 알리 ~~','2020-03-20 14:05:55.142485',NULL,NULL,NULL,NULL,'알라딘 친구들',NULL,NULL,60),(36,'2020/03/23/orig/01-20200316-1600-1700_s16RAZP.png','<p>1. 일정 정리<br>스터디 시간은 온라인/오프라인 둘다 월요일 오후 4시로 결정하였습니다. 그리고, 학기 중에 오후 4시에 스터디가 불가능한 경우만 다른 날로 정하였습니다.<br>중간고사와 기말고사 기간에서 서로 예상문제를 내어 시험준비를 같이 하기로 결정하였습니다.</p><p><span style=\"font-family: &quot;Helvetica Neue&quot;;\">2. 스터디 규칙 정하기</span><br><span id=\"docs-internal-guid-ea450615-7fff-5875-09d2-5fbbd540b07a\"></span></p><ol style=\"margin-top:0;margin-bottom:0;\"><li dir=\"ltr\" style=\"list-style-type:decimal;font-size:13.999999999999998pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\"><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size: 14px; font-family: &quot;Helvetica Neue&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">스터디 과목 : 객체지향 설계패턴 (OODP)</span></p></li><li dir=\"ltr\" style=\"list-style-type:decimal;font-size:13.999999999999998pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\"><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size: 14px; font-family: &quot;Helvetica Neue&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">스터디 그룹 모임 장소 : 온라인(Zoom) 2주 + 오프라인(뉴턴 or 오석)</span></p></li><li dir=\"ltr\" style=\"list-style-type:decimal;font-size:13.999999999999998pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\"><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size: 14px; font-family: &quot;Helvetica Neue&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">달성 목표 : 세명 모두 객체지향 설계 패턴 과목에서 A를 받는다!</span></p></li><li dir=\"ltr\" style=\"list-style-type:decimal;font-size:13.999999999999998pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\"><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size: 14px; font-family: &quot;Helvetica Neue&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">만남 주기 : 일주일에 최소 한번(시험기간 제외) + 시험기간 ( tbd )</span></p></li><li dir=\"ltr\" style=\"list-style-type:decimal;font-size:13.999999999999998pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\"><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size: 14px; font-family: &quot;Helvetica Neue&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">스터디 운영 : 미리 공부(필수) + 퀴즈(최소 3~4개 - 분량에 따라서 조절) + 모르는 문제 물어보기 + 공부 정리(문서)</span></p></li><li dir=\"ltr\" style=\"list-style-type:decimal;font-size:13.999999999999998pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\"><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size: 14px; font-family: &quot;Helvetica Neue&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">스터디 진도 : 빠른 사람에게 최대한 맞춘다.</span></p></li><li dir=\"ltr\" style=\"list-style-type:decimal;font-size:13.999999999999998pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\"><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size: 14px; font-family: &quot;Helvetica Neue&quot;; color: rgb(0, 0, 0); background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">지각 제도 : 지각한 사람이 그 다음 모임의 장소 + 모임사진 + 보고서에 대한 책임을 진다.</span></p></li><li dir=\"ltr\" style=\"list-style-type:decimal;font-size:13.999999999999998pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\"><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:13.999999999999998pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><span style=\"font-size: 14px; font-family: &quot;Helvetica Neue&quot;;\">결석 제도 : 하루 전에 필수적으로 알려주기 + 결석한 사람이 그 다음 모임 장소 + 모임 사진 + 보고서에 책임을 진다.</span><span style=\"font-family: &quot;Helvetica Neue&quot;; font-size: 14px;\">\r\n\r\n</span></span></p></li></ol><p><span style=\"font-family: &quot;Helvetica Neue&quot;; font-size: 14px;\">3. 자바 복습<br>서로 헷갈렸던 개념들에 대해서 나누었습니다.</span></p><p>4. 다음주 모임 계획<br>1주차부터 이번주까지의 수업 내용 정리 + 퀴즈</p>','2020-03-23 11:38:23.624638','group24',NULL,218,NULL,'2020-03-16','16:00 ~ 17:00',1,60),(37,'2020/03/23/orig/02-20200323-1600-1700.png','<p>1. 개인 공부 나눔(ch1~5, pattern)</p><p>최지우, 김연수 학우님들은 김기석 교수님 분반이며, 임은채 학우님은 성금영 교수님 분반이므로 서로의 진도가 다릅니다. 그래서 각자 자신의 수업의 진도에 맞춰서 공부한 내용을 나누고, 정리한 내용을 나누는 시간을 가졌습니다. <br>오버로딩의 개념, 접근 제한자, 상속 ,타입변환과 다형성, 추상클래스에 대한 개념과 같이 전체적으로 java에 대한 내용을 복습였습니다.(김기석 교수님 분반) <br>그리고, creational patterns(abstract factory pattern, builder pattern, prototype pattern, singleton pattern)와 structural design patterns(adapter pattern, bridge pattern, composite pattern, decorator pattern, facade pattern, flyweight pattern, proxy pattern)에 대해 공부하였습니다.(성금영 교수님 분반)<br></p><p>2. 퀴즈<br></p><p>서로 공부한 내용에서 퀴즈를 만들기로 하여 서로 나누는 시간을 가졌습니다</p><p>3. 다음주 공부 계획</p><p>인터페이스와 추상 클래스의 차이, structural design pattern 중에 adapter pattern에 대해 명확하게 설명할 수 없어, 다음주에는 이 주제들과 이번주 수업 내용을 준비해 오기로 하였습니다.</p><p><img src=\"/upload_files/django-summernote/2020-03-23/a9b47cd1-cd9b-470c-9c95-d6d021f86288.png\" style=\"width: 1168px;\"><img src=\"/upload_files/django-summernote/2020-03-23/eb191fd9-3186-40ef-8e02-a69be9f5dcc6.png\" style=\"width: 1168px;\"><br></p>','2020-03-23 11:41:04.382077','group24',NULL,218,NULL,'2020-03-23','16:00 ~ 17:00',2,60),(39,'2020/03/23/orig/01-20200319-2000-2030_kQyZw44.png','첫 스터디 모임으로, 통성명을하고 스터디 계획을 세웠습니다.','2020-03-23 11:47:07.168534','group22',NULL,216,NULL,'2020.03.19 데이터 구조 스터디','08:00~08:30',1,60),(40,'2020/03/23/orig/01_20200322_1640_1700.png','<p><span data-sheets-val