. Algorythm Time Complexity의 개념에 대해서 질의응답 시간을 가졌다.</span><br></p>','2020-03-25 02:49:18.305682','group62',NULL,256,NULL,'[2020-03-18] 첫 스터디 보고서','1시간',1,60),(67,'2020/03/25/orig/01-20200315-2200-2330.jpg','<p><span style=\"font-family: Arial; font-size: 13px; white-space: pre-wrap;\">1 운영체제 buffer 관련 개념 복습, operating system 복습(multi &amp; cluster의 차이점)\r\n2 알고리즘 Divide and conqure 에서 Recurrence equation 복습 </span></p><p><span style=\"font-family: Arial; font-size: 13px; white-space: pre-wrap;\"><br></span></p><p><span style=\"font-family: Arial; font-size: 13px; white-space: pre-wrap;\">그 외에 문제풀이에 관한 질문들을 서로 모르는 부분을 풀어보고 함께 답을 맞춰가는 시간을 가졌습니다. <br></span><br></p>','2020-03-25 05:28:36.993891','group38',NULL,232,NULL,'첫번째 스터디','22:00 - 23:30',1,60),(68,'2020/03/25/orig/02-20200324_2200_2330.png','<p>1 운영체제&nbsp;</p><p>Kermel Thread와 User Thread 사이에 있는 LWP 가 무엇인가에 대해 헷갈리는 개념들을 확실히 다잡고 갔습니다.</p><p>Concurrency와 parallelism에 관해 서로 어느 부분이 다르고 어떤 예시가 있을까 생각하며 서로 모르는 부분에 대해 질문하고 답하는 시간을 가졌습니다.</p><p>Open MP에 관해서 n / core라는 부분에 대한 개념이 코드 상에서 어떻게 흘러갈 것인가 또 다른 예제는 어떤 것들이 있을까 고민하고 나누는 시간을 가졌습니다.</p><p><br></p><p>2 알고리즘&nbsp;</p><p>Matrix 강의에 대한 문제풀이와 그 강의에서 나온 코드에 대한 이해를 해보는 시간을 가졌습니다.&nbsp;</p>','2020-03-25 05:32:48.901890','group38',NULL,232,NULL,'두번째 스터디','22:00-23:30',2,60),(69,'2020/03/25/orig/KakaoTalk_20200324_201152559.png','<p>1. semiconductor에 대해서 복습 및 질문 공유를 함.</p><p>2. p-type과 n-type의 특징 및 성질, 원리를 공부함</p><p>3. 통신이론 에대해서 서로 공부 하면서 과제도 같이 하면서 모르는 것에 질문함.</p><p>4. 푸리에 트랜스폼 expansion에 대해서 공부함</p><p>zoom화상회의를 통해서 같이 공부하면서 실시간으로 모르는 것에 대해서 질문 및 공유 함</p>','2020-03-25 06:30:50.296242','group57',9614,251,'2020-03-25 06:28:07.215340','전자회로 공부','18:30 ~ 20:20',1,60),(70,'2020/03/25/orig/D5D36FD8-0666-4B98-8425-E29BDC7D44C1.png','오늘 줌으로 첫 모임을 가졌습니다. \r\n그룹장을 선출했고 각자 무슨 수업을 듣는지 소개하는 시간을 가졌습니다.\r\n또한 앞으로 진행될 모임 시간과 방법에 대해 이야기를 나누었습니다. 당분간은 줌을 통해 모이고 카톡을 통해 수시로 서로 질문이나 배운 것을 나누기로 계획하였습니다.','2020-03-25 12:27:52.011819','group61',5867,255,'2020-03-25 12:27:51.876913','첫 모임(2020.03.25)','21:00-21:30 (2020.03.25)',1,60),(71,'2020/03/25/orig/Group363_26.jpg','<div>오늘은 첫 스터디 모임을 인터넷 화상통화로 진행했다.</div><div>첫 모임인만큼 그룹장을 선별하고 앞으로의 스터디 계획에 대해 의논하고 시트지를 작성했다.</div><div>필요에 따라 일주일에 두번 이상도 모일 수 있지만 열심히 공부하도록 다짐했다.</div>','2020-03-25 12:44:55.175830','group36',9317,230,'2020-03-25 12:37:18.585961','첫 스터디','21:00 ~ 21:40',1,60),(72,'2020/03/25/orig/KakaoTalk_20200315_132057690.jpg','<p>스터디 고정 시간 정함</p><p>스터디 준비 및 방식 정함</p><p>스터디장 정함</p><p>교수님이 저저번 시간에 설명하신 Exercise 3,4에 대해 이야기 함</p>','2020-03-25 13:02:38.523354','group31',NULL,225,NULL,'개빡공 스터디','1시간',1,60),(73,'2020/03/25/orig/01-20200319-2100-2137.JPG','<p><span data-sheets-value=\"{&quot;1&quot;:2,&quot;2&quot;:&quot;1. 그룹 계획 세우기\\n2. 역할 분담, 만남 시간 정하기&quot;}\" data-sheets-userformat=\"{&quot;2&quot;:897,&quot;3&quot;:{&quot;1&quot;:0},&quot;10&quot;:1,&quot;11&quot;:4,&quot;12&quot;:0}\" style=\"font-size: 10pt; font-family: Arial;\">1. 그룹 계획 세우기<br>2. 역할 분담, 만남 시간 정하기</span><br></p>','2020-03-25 13:29:57.680443','group35',NULL,229,NULL,'1차 스터디 보고서','21:00 ~ 21:37',1,60),(74,'2020/03/25/orig/02-20200325-2130-2235.png','<p>&gt;&gt;데이타 구조</p><p>- Algorithm Effciency, StackADT, Classes, Recursion, Strings, Constructor, Stack응용 강의 내용 복습</p><p><br></p>','2020-03-25 13:39:33.129973','group35',NULL,229,NULL,'2차 스터디 보고서','21:30 ~ 22:35',2,60),(75,'2020/03/25/orig/1.JPG','<p>스터디 첫 모임을 가짐</p><p>그룹장을 정하고 앞으로의 스터디 계획을 세움</p><p>이때까지 \'통신 이론\' 수업에 대해 궁금했던 내용들 나누고 공유함</p>','2020-03-25 13:53:07.786339','group39',7160,233,'2020-03-25 13:50:56.056215','첫모임 & 통신이론','22:00~23:00',1,60),(76,'2020/03/25/orig/group10_1.png','<p>오늘은 알고리듬 recurrence equation를 공부했다.</p><p>로그의 성질을 기억하지 못해 recurrence tree 유도 과정을 이해하기 어려웠다.</p><p>알고리듬의 고수가 되기 위해서는 수학 공부가 필요할 것 같다...</p>','2020-03-25 14:02:30.584678','group10',NULL,204,NULL,'알고리듬 공부','21:00 ~ 23:00',1,60),(79,'2020/03/25/orig/01-20200318-2100-2200_LUDVjsB.jpg','<p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;,