: 2;\">&nbsp; &nbsp; - 해당 사람이 다른 스터디원들에게 커피나 간식을 내는 걸로.</p><p style=\"font-variant-ligatures: normal; orphans: 2; widows: 2;\">3. What is an Operating System?</p><p style=\"font-variant-ligatures: normal; orphans: 2; widows: 2;\">&nbsp; &nbsp; - 운영 체제는 하나의 프로그램이다! 하드웨어와 어플리케이션을 매개하는 다양한 서비스를 제공하는 프로그램이라 할 수 있다.&nbsp;</p><p style=\"font-variant-ligatures: normal; orphans: 2; widows: 2;\">4. CPU와 Memory간의 동작 방식, Von Neumann Architecture.</p><p style=\"font-variant-ligatures: normal; orphans: 2; widows: 2;\">&nbsp; &nbsp; - 교재를 보지 않고 함께 이를 그리고 리마인드 해봄</p><p style=\"font-variant-ligatures: normal; orphans: 2; widows: 2;\">5. System calls</p><p style=\"font-variant-ligatures: normal; orphans: 2; widows: 2;\">&nbsp; &nbsp; - Processor의 각 managements에는 다양한 system call instructions 들이 있다. 이에 대해 같이 나누어보았다.</p><p style=\"font-variant-ligatures: normal; orphans: 2; widows: 2;\">6. Chapter 1 과 Chapter 2 요약</p><p style=\"font-variant-ligatures: normal; orphans: 2; widows: 2;\">&nbsp; &nbsp; - 이 두 단원을 우리가 배우며 중점적으로 알아둬야 할 부분은 무엇인지, 어떻게 공부해야 할지 논의해보고 다음 chapter 3. Process를 읽고 스터디를 진행하기로 함.</p>','2020-03-26 06:54:26.828187','group34',7428,228,'2020-03-26 06:44:58.797360','#1 OS chapter 1~ 2 review','14:30~15:30',2,60),(91,'2020/03/26/orig/02-20200326-2000-2040.png','<p>두번째 스터디 모임으로, 데이터 구조 수업내용 중 14. Pointer 와 15. Linked list를 중 모르는 부분들을 함께 질의응답하며 복습했습니다.</p><p>익숙하지 않은 개념인 linked list를 공부하고 과제 내용 중 각자 풀리지 않는 내용의 이해를 도왔습니다.</p>','2020-03-26 11:46:47.438686','group22',NULL,216,NULL,'2020.03.26 데이터 구조 스터디','20:00~20:40',2,60),(93,'2020/03/26/orig/2_nGPsqhB.png','<p>모르는 내용 질의 응답</p><p>함께 예제를 푸는 시간을 가짐</p>','2020-03-26 11:53:13.908628','group39',9541,233,'2020-03-26 11:52:33.470212','통신이론','19:30~20:00',2,60),(94,'2020/03/26/orig/1585224204507.jpg','<p>첫 스터디로, 어떻게 스터디를 해야할지 이야기했음.</p><p>간단한 자기소개와 현재 학업이 어떻게 되어가고 있는지 이야기함.</p><p>OS의 첫번째 부분인 Introduction 부분에 대해서 스터디 했음.</p><p>컴퓨터 구조의 슬라이드를 가지고 cpu와 cache, memory, I/O에 대해서 간단히 리뷰했음.</p><p><br></p>','2020-03-26 13:24:06.598208','group23',NULL,217,NULL,'3월 26일 스터디_1','21:00 ~ 22:00',1,60),(95,'2020/03/26/orig/KakaoTalk_Photo_2020-03-24-22-02-59.png','<p>k-map에 대해서 복습함.</p><p>don\'t care condition terms가 어떤 상황에서 0 또는 1이 적절한지에 대해 토의함.</p><p>(사진을 찍었는데 날라갔습니다ㅠㅠ 저 사진은 3번째 스터디 사진입니다 이번주 코드는 6147)</p>','2020-03-26 13:41:17.463351','group25',6147,219,'2020-03-26 13:36:28.256647','논리설계','21:30 ~ 22:25',4,60),(96,'2020/03/27/orig/01-20200321-1800-1900.PNG','<p>1. 서로 자신에 대해 자기 소개하는 시간을 가짐.</p><p>2. 앞으로 어떤 식으로 공부해 나갈 지에 대해 의논하고 결정함.</p><p>(온라인은 만나야 할 때는 줌으로 만나서 서로 스터디하고, 오프라인 때는 나중에 상상랩 빌려서 스터디하기로 함.)</p><p>3. 스터디그룹장 정하기</p><p>(스터디그룹장으로는 저번 학기 그룹장을 해본 경험이 있는 21900215 김현기 학우님이 하게 되었음)</p>','2020-03-26 15:03:35.611214','group27',7426,221,'2020-03-26 14:59:48.352280','자기 소개와 앞으로의 계획 설정','18:00 ~ 19:00',1,60),(97,'2020/03/27/orig/01-20200318-2030-2130.png','<p><span style=\"font-family: Arial; font-size: 13px; white-space: pre-wrap;\">1. 스터디 그룹 계획 수립 (목표, 계획, 룰)\r\n2. 다음 스터디까지 공부할 분량 수립</span><br></p>','2020-03-27 10:45:35.909820','group4',NULL,198,NULL,'첫모임_Study계획','1시간',1,60),(98,'2020/03/27/orig/02-20200327-2100-2200.png','<p>1. Process의 Parent&amp;Child process 관계를 공부함.</p><p>&nbsp;-&gt; 이와 관련된, fork()/wait()/exe family 함수도 공부.</p><p><br></p><p>2. C언어 복습</p><p>&nbsp;-&gt; C언어에서 포인터와 배열의 관계에 대해서 구체적 코드로 개념을 한 번 더 정립함.</p>','2020-03-27 13:49:14.124776','group4',NULL,198,NULL,'OS_Process & C언어','22:00',2,60),(99,'2020/03/27/orig/1585317541526.png','알고리즘에 관해 질문과 답변을 통해 이해를 높였다. 문제를 풀어보는 시간을 가졌다.\r\nDB쿼리에 대해 집중적으로 공부했다.','2020-03-27 14:02:13.223695','group17',NULL,211,NULL,'전공공부를 하였다','2:00, 8:00',2,300),(101,'2020/03/28/orig/6045E867-E83F-4A9D-9731-0550E6637BF9.jpeg','Java 150줄 프로그래밍을 만들어 서로 공유하고 부족한 부분은 웹서핑을 통해 공부함','2020-03-28 05:37:00.061044','group33',NULL,227,NULL,'study05_0327','20:00',5,300),(103,'2020/03/28/orig/01-20200314-1400-1530.jpg','<p><span data-sheets-value=\"{&quot;1&quot;:2,&quot;2&quot;:&quot;1.Chapter1~1.4 복습 1)What Operating Systems Do, 2) Computer System Organization 3) Computer-System Architec