l&quot;}\" style=\"font-size: 10pt; font-family: Arial;\">4) Computer-System Structure 요약 정리</span><br></p>','2020-03-28 07:16:18.082417','group16',NULL,210,NULL,'OS 스터디 1주차','14:00 ~ 15:30',1,90),(104,'2020/03/28/orig/02-20200321-1400-1450.png','<p><span data-sheets-value=\"{&quot;1&quot;:2,&quot;2&quot;:&quot;Chapter 1.5~1.9, 3.1.1 복습 및 요약 정리&quot;}\" data-sheets-userformat=\"{&quot;2&quot;:897,&quot;3&quot;:{&quot;1&quot;:0},&quot;10&quot;:1,&quot;11&quot;:4,&quot;12&quot;:0}\" style=\"font-size: 10pt; font-family: Arial;\">Chapter 1.5~1.9, 3.1.1 복습 및 요약 정리</span><br></p>','2020-03-28 07:17:05.845490','group16',1287,210,'2020-03-28 07:16:26.717665','OS 스터디 2주차','14:00 ~ 14:50',2,50),(106,'2020/03/28/orig/KakaoTalk_Photo_2020-03-28-19-14-20_hnGpIrk.jpeg','<p>(a\'+c)(b+c\') = a\'b+a\'c\'+cb가 왜 성립하는가</p><p>boolean logic에서도 일반적인 대수에서 성립하는 제1분배법칙이 성립하게 된다.</p><p>제 1분배법칙을 식에 적용한뒤 boolean logic의 성질을 이용해서 식을 정리하면 증명이 가능하다.</p><p>또 제1 분배법칙과 boolean logic의 성질을 통해서 제2분배법칙을 증명할 수 있다.</p><p><br></p><p>추후 스터디 방향에 대한 논의</p><p>챕터가 끝날때마다 있는 charpter text와 exercise test를 각자 풀어본뒤 스터디 시간을 통해 문제에 대한 풀이나 접근방법 등에 대해 토론</p><p>또 수업중 잘 이해가 가지 않았던 개념이나 공식, 성질에 대해 토론</p><p><br></p><p>funtion이 주어졌을때 gate의 개수와 gate input이 갯수를 구하는 방법</p><p><br></p><p>maxterm의 dont care expression에 대한 표기 방식 이해</p><p>maxterm일 경우 dont care expression은 알파벳 대문자 D로 표기하며</p><p>minterm일 경우 dont care expression은 알파벳 소문자 d로 표기한다.</p><p><br></p><p>minimization을 할때 식을 통해서 접근하는 방식보다 k-map을 이용하는 방식이 더 수월하다</p><p>카누맵을 이용할시 식으로 접근할때보다 이것이 최대의 minimization된것인지에 대한 판단이 쉽다.</p><p>또한 함수가 복잡할시에 식 접근보다 더 빠르게 식을 구할수 있는 장점이 있다.</p><p><br></p>','2020-03-28 10:51:48.641000','group30',7950,224,'2020-03-28 10:51:48.634274','boolean logic','18:00',1,60),(107,'2020/03/28/orig/KakaoTalk_20200321_200427579.png','<p>1. Operating system 9th edition 1,2단원 공부 방법 공유</p><p>2. 앞으로의 study일정 계획&nbsp;</p><p>3. pdf요약 정리 공유</p>','2020-03-28 11:07:16.931715','group45',6372,239,'2020-03-28 11:04:27.856605','first study meeting','20:00',1,60),(109,'2020/03/28/orig/2020_03_28_Study.JPG','<p>OS에 대한 큰 컨셉을 잡기 위해 서로 개념을 설명해주는 시간을 가졌습니다.</p><p>OS를 구성하고 있는 kernel,shell은 물론 process와 interrupt의 개념에 대해 공부하고 질문하는 시간을 가졌습니다.</p>','2020-03-28 12:00:20.002663','group62',NULL,256,NULL,'OS 기본 개념','16:10',2,48),(110,'2020/03/28/orig/KakaoTalk_20200328_201346931.png','<p>1. 퀴즈 및 질문 사이트 공유</p><p>2. 강의 자료 공유</p><p>3. 서로 묻고 답하기(PCB란? 좀비 프로세스란? 고아 프로세스란?)</p>','2020-03-28 12:06:54.469052','group45',NULL,239,NULL,'second study meeting','20:00',2,60),(111,'2020/03/28/orig/Study_1st_week.PNG','<p><span style=\"font-family: &quot;Times New Roman&quot;;\">&nbsp;Data Structures 과목 복습 및 질의응답</span></p><p><span style=\"font-family: &quot;Times New Roman&quot;;\">&nbsp;Ppt 1~62p 진행</span></p><p><span style=\"font-family: &quot;Times New Roman&quot;;\">&nbsp;공부 내용: System life cycle, Pointers and dynamic memory allocation, Algorithm</span><span style=\"font-family: &quot;Times New Roman&quot;;\">&nbsp;specification, Recursion</span></p>','2020-03-28 12:29:39.419516','group37',3049,231,'2020-03-28 12:20:07.553443','Data Structures 복습','20:00',1,80),(113,'2020/03/29/orig/KakaoTalk_20200329_170833873.png','<p>운영체제에 대하여</p><p><br></p><p>1. 운영체제 구조</p><p>2. 컴퓨터가 돌아가는 원리 -&gt; 인터럽트에 대하여</p><p>3. 쓰레드는 무엇인지</p><p>4. 프로세스는 무엇인지</p>','2020-03-29 08:18:01.204157','group63',3086,257,'2020-03-29 08:13:39.439814','운영체제','13:00',1,180),(114,'2020/03/30/orig/3_29_2130.png','<p>금일은 arraylist에서 remove_all 함수, concat함수, sublist함수의 구현을 해보고</p><p>그에 대한 알고리즘을 서로에게 설명을 해주는 방식으로 스터디를 했습니다.</p><p>또한, 이번주에 공부한 포인터와 저장공간(stack, heap, data 등등)에 대해서 논의를 하였으며,</p><p>코드에 대한 결과값에 대해 의문이 가는 점들을 서로 공유하면서 이유를 추론해보는 시간을 가졌습니다.</p>','2020-03-29 15:08:51.169715','group14',NULL,208,NULL,'데이터구조 스터디','21:30',2,60),(115,'2020/03/30/orig/KakaoTalk_20200326_201330288.png','<p>3월 18일 수요일 오전 10시, 첫 모임을 가졌다.</p><p>코로나때문에 오프라인에서 만나는 것이 불가능하기 때문에 zoom을 통해 온라인으로 만나게 되었다.<br></p><p>자기소개를 한 후,&nbsp; 먼저 앞으로 모임시간에 대한 조정을 했다. 기존 10시로 정했던 모임시간이 학기중에 힘들수도 있다는 의견이 나와 토의를 통해 오후 8시로 옮기기로 했다.<br></p><p>조장은 고윤서로 뽑혔다.<br></p><p>이후 숙제를 해오지 않을경우에 대한 패널티를 정하기로 했다.<br></p><p>1000원으로 시작한 벌금은 너무 적다는 의견에 따라 점점 상향되어 3000원으로 책정되었다.&nbsp;<br></p><p>벌금은 모아 나중에 맛있는 간식을 스터디 이후 사먹기로 결정했다.<br></p><p>숙제는 매 시간 수업의 진도에 따라 유동적으로 정하기로 하고, 이번주 과제는 논리설계 교과서 1장의 연습문제와 테스트를 풀어오는것으로 정했다.</p><p>다음주에 풀어온 문제들을 함께 맞춰보며 틀린문제에 대해 같이 풀어보기, 자신이 가지고있던 질문하기 등을 하기로 했다.</p><p>첫모임이지만 같은 19학번들이라 빠르게 친해질 수 있어서 좋았고 무엇보다 열정이 보이는 친구들이라 한학기동안 즐거운 스터디모임이 될 것 같다.</p>','2020-03-29 15:18:04.987697','group2',NULL,196,NULL,'0318 모임1','10:00',1,40),(116,'2020/03/30/orig/3.png','<p>전자회로 1단원 복습 및 예제풀이</p>','2020-03-29 16:09:51.995408','group39',8590,233,'2020-03-29 16:07:16.727153','전자회로','23:30',3,90),(117,'2020/03/30/orig/KakaoTalk_20200325_110705210.png','<p>Data Manipulation Language 랑 Data Definition Language 의 의미와 각각의 명령어들 그리고 그에관한 예시들을 함께 QnA 방식으로 스터디를 진행함<br></p>','2020-03-30 03:10:38.550574','group62',NULL,256,NULL,'데이터베이스(DML, DDL)','11:00',3,60),(119,'2020/03/30/orig/KakaoTalk_Photo_2020-03-30-21-51-40.jpeg','<p>1. 오늘 소프트웨어 공학 교과서를 가지고 와서 목차부터 차근차근 훑음. </p><p>2. 소프트웨어 공학 HW1에서 한 것을 나누면서 익숙한 개념과 익숙하지 않음 개념을 나누어봄.&nbsp;</p><p>3. CH1 인 introduction을 읽으며 모르는 영어 표현 등을 서로 알려주고, 소프트웨어 개발에 대한 전반적인 아이디어를 잡음.&nbsp;</p>','2020-03-30 12:56:04.077678','group12',NULL,206,NULL,'내용 훑기 + CH1 입문','14:00-15:30',2,90),(120,'2020/03/30/orig/3rd.png','<p>4주차 수업 내용 복습</p><p>3단원 총 정리</p><p>Thread가&nbsp; CPU 내에서 어떻게 처리 되는지에 대해 토론 ( single processor &amp; multiprocessor &amp;&nbsp; multicore)&nbsp;</p><p>Zombie/ Oprhan 프로세스에 대해 토론</p>','2020-03-30 13:12:59.053655','group16',7539,210,'2020-03-30 13:11:01.354839','OS 스터디 3주차','14:30 - 16:00',3,90),(121,'2020/03/31/orig/study1.PNG','<p>실험시간에 했떤 python code 내용 및 추가 내용을 학습하고 서로 모르는 함수등에 대해서 효율적으로 코드 작성하는 법을 스터디함</p><p>Linux OS, Vi emulator를 이용하여 파일 생성 하는 등의 내용을 스터디함</p>','2020-03-31 05:43:25.373847','group9',6174,203,'2020-03-31 05:37:12.885152','python, linux','2020-3-17 19:30',1,100),(122,'2020/03/31/orig/19-20200331.PNG','<p>3강(Processes) 복습</p><p>- Process에 대한 내용들, Socket, Pipe 등의 내용을 복습하였습니다.</p>','2020-03-31 07:45:40.675505','group19',2870,213,'2020-03-31 07:41:21.257989','네번째 스터디 그룹 모임(3월 31일)','15:30',4,60),(123,'2020/03/31/orig/040B24CC-0625-47D9-880F-D6FFCD6FF2E8.png','<p><b><span style=\"font-size: 18px;\">이번 학기 목표!</span></b><span style=\"font-size: 18px;\">﻿</span></p><p>김신휘 : 도서관에서 공부하기, 매일가기</p><p>홍혜정 : 완벽하게 다루는 언어를 가지고 싶다</p><p>권하은 : 수업 시간 졸지 않기</p><p><br></p><p><br></p><p><span style=\"font-size: 18px;\"><b>스터디 방향 설정</b>﻿</span></p><p>김신휘 : 현재 자신의 수준에 관한 객관화가 필요하다. &nbsp;</p><p>홍혜정 : 같이 공부 하면서 시너지 효과가 필요. 모르는 것 위주로 질문. 서로 진행 상황 공유.</p><p>권하은 : 진척상황, 서로 막히는 것 공유하기.</p><p><br></p><p>최종 : 화 금 저녁 8시에 모여서 각자 과제 혹은 학습 진척 상황을 나누고 아너코드를 위반하지 않는 선에서 서로에게 도움을 요청한다</p>','2020-03-31 11:46:20.135720','group8',NULL,202,NULL,'이번 학기 개인 목표와 스터디 방향 설정','20:00',1,40),(124,'2020/03/31/orig/KakaoTalk_20200331_205026768.png','<p>1. 스터디 계획서 작성하기</p><p>2. Tellegen\'s Theorem의 개념과 그에 따른 교재 속 Example 문제 풀어보기</p><p>3. Kirchihoff\'s current law의 개념과 그에 따른 교재 속 Example 문제 풀어보기</p><p><br></p>','2020-03-31 12:03:12.302088','group40',7248,234,'2020-03-31 11:56:12.004226','1. 첫 중간고사 전 시험범위 개념 공부','20:00',1,50),(125,'2020/03/31/orig/1585656829590.png','Logic design 수업 중에 이해 안됐던 부분 q&a\r\n회로이론 연습 문제 풀이\r\n기전실 수업 중에 이해 안됐던 부분 q&a','2020-03-31 12:58:26.812584','group29',NULL,223,NULL,'3/31','20:00',3,75),(126,'2020/03/31/orig/1585659623780.png','회로이론 문제 풀이','2020-03-31 13:02:54.579840','group29',4795,223,'2020-03-31 12:58:47.894611','3/24','20:00',4,40),(127,'2020/03/31/orig/F86BDAEA-A772-47C0-96C9-EA25888C646E.png','우선 처음 모여서 인사부터 나누고,\r\n앞으로의 스터디 계획을 세워보았다.\r\n그리고 간단하게 모두가 배웠던 Logic design에서 K-map에 대하여 공부하였다.\r\n앞으로 우리 스터디원들의 성장이 기대가 됩니다\r\n화이팅 (๑•̀ㅂ•́)و✧','2020-03-31 13:14:07.813174','group64',NULL,258,NULL,'첫 모임 (๑•᎑•๑)','20:00',1,70),(128,'2020/03/31/orig/3D7FD972-5674-4CFF-B1B3-A98691C34954.png','스택 개념을 공부하였고 예제 문제들을 보면서 스택 개념을 다짐. \r\n불린 식을 k-map으로 나타내는 방법을 공유함.','2020-03-31 13:22:21.683665','group25',NULL,219,NULL,'논설과 데이터구조','21:30 ~ 22:20',5,50),(129,'2020/03/31/orig/group55_study2.jpeg','<p>1주차 월요일 수업내용</p><p>1주차 목요일 수업내용</p><p>2주차 월요일 수업내용</p><p>각자 정리해 온 파트를 설명해주고 질의응답하는 시간을 가졌습니다.</p>','2020-03-31 13:44:18.424527','group55',NULL,249,NULL,'Operating System 1주차 월 - 2주차 월','21:00',2,70),(130,'2020/04/01/orig/5641.png','<p><img src=\"/upload_files/django-summernote/2020-04-01/bd3d3461-1f7d-44b8-b9a2-c22f308e2e6f.jpeg\" style=\"width: 720px;\"><br></p><p>exercise&nbsp;</p><p>6 -&gt; 0110 -&gt;1001 + 1 -&gt; 1010 (-6)</p><p>0001 + 0111 (unsigned) -&gt; 1000 -&gt; overflow(x)</p>','2020-04-01 03:22:07.881327','group60',NULL,254,NULL,'LogicDesign (1~2강)','10:00',1,135),(133,'2020/04/01/orig/44A9F5D8-7E4A-400D-AD99-32F7CDAF4F49.png','첫 모임을 시작했다.\r\n앞으로의 스터디 계획을 정하고,\r\n본인이 수강중인 과목을 나누어 어떤 과목을 함께 공부하면 좋을지 간단하게 의논하였다.\r\nA+을 향하여 달려갑시다 (๑•̀ㅂ•́)و✧','2020-04-01 09:33:16.479138','group3',5389,197,'2020-04-01 09:26:16.355176','첫 모임 (๑•᎑•๑)','17:30',1,60),(136,'2020/04/01/orig/study0401_1y1PJpO.png','<p>스터디장 선출</p><p>스터디 방향성 논의</p>','2020-04-01 11:58:06.342769','group49',8190,243,'2020-04-01 11:55:49.334433','04/01 스터디','20:00',2,55),(137,'2020/04/01/orig/Study_2nd_Week.PNG','<p>&nbsp;Data Structures 과목 복습 및 질의응답, 코드 분석</p><p>&nbsp;PPT 63 ~ 102p 진행<br></p><p>&nbsp;공부 내용: Data abstraction, Performance analysis</p>','2020-04-01 13:05:26.037731','group37',NULL,231,NULL,'Data Structures 복습 및 코드 분석','20:00',2,80),(138,'2020/04/01/orig/2020-04-01_4.png','<p>Zoom 화면공유를 통해 Objects and Methods 강의 PPT를 보며 진행함.<br></p><p>- object와 method에 대한 전반적인 개념을 다시 짚으면서, 헷갈리거나 모르는 부분을 서로 설명해줌.</p><p>- 각 코드의 의미를 분석하고, 같은 결과를 출력하는 다른 코드들을 확인함.</p><p>+ 수업 내용 중 이해가 잘 되지 않았던 부분(object에 데이터를 바꾸어 주는 것, method 내에서 바꾼 데이터를 method 밖에서 적용되지 않는 것 등)에 대한 해답을 같이 찾아봄.</p>','2020-04-01 13:29:07.879514','group46',NULL,240,NULL,'Object 개념과 다양한 Methods 학습','21:00',2,70),(140,'2020/04/01/orig/03-20200401-2130-2245_JRUgtUN.png','<p>1. 운영체제 1-3과 복습 및 중요한 내용 나누기</p><p>2. 운영체제 1-3과 질의응답</p>','2020-04-01 13:59:32.680094','group4',5796,198,'2020-04-01 13:58:35.159176','OS 퀴즈 공부','21:30