:50:29.993054','group22',7691,216,'2020-04-02 11:46:02.117554','2020.04.02 데이터 구조 스터디','20:00',3,45),(155,'2020/04/02/orig/capture.PNG','<p>오늘은 OS 스터디를 했다.</p><p>최근에 올라온 영상강의인 Multithread 영상을 보고 서로 이해 안가는 부분을 묻고 이해하는 방식으로 진행했다.</p><p>모두 온라인상으로 모여서 진행하는데 잘 적응해서 큰 무리 없이 잘 진행되었다.</p><p>잘 모르는 개념들을 바로바로 물어볼 수 있어서 좋았다.</p><p>개인적인 참고 자료들도 공유해서 좋았다.</p>','2020-04-02 13:23:11.800287','group23',NULL,217,NULL,'4월 02일 스터디_2','21:00~22:10',2,70),(156,'2020/04/02/orig/BC1ACBDC-C153-4AD1-81E5-94388E345AB6.png','데이터베이스 과목 스터디를 진행하였습니다. 지난 시간에 배운 E-R 다이어그램에 대해 복습하면서 질문을 주고 받았습니다. 또한 효과적인 데이터베이스 스키마 설계에 대한 의견을 주고 받았습니다.','2020-04-02 13:34:58.804095','group61',9281,255,'2020-04-02 13:31:42.645438','2일차','20:00',2,120),(157,'2020/04/03/orig/0320_1430_1600.jpeg','<p><img src=\"/upload_files/django-summernote/2020-04-03/d96063c3-81c4-4e78-ad57-509c0ba2ca86.jpeg\" style=\"width: 960px;\"><img src=\"/upload_files/django-summernote/2020-04-03/aa8f7fa2-c53a-489e-b0df-a841f1da6d7f.jpeg\" style=\"width: 960px;\"><br></p><p>1. 이번 주 학습 내용인 3단원 Process에 관해 팀원 모두가 각자 스스로 학습해오고, 앞에서 대표 발표자의 리드를 통해 이를 리마인드하는 시간을 가졌습니다.&nbsp;</p><p><br></p><p>예를 들어, Process 에는 text영역, heap 영역, data 영역 등이 있으며, 여기에는 각각 무엇이 할당되는지를 알고, process의 다섯가지 state를 한명씩 맞춰가며 이를 도식화하여 설명할 수 있을 만큼 복습을 철저히 했습니다. 그리하여 단원 마지막 부분인 RPC 까지 학습하고, 서로 궁금했던 부분에 대해 질문하고 답하며 90분간의 알찬 스터디를 마무리했습니다.</p><p><br></p><p><br></p><p><br></p><p>2. IPC부분과 Thread를 언급하면서 향 후 과제의 방향이 이런식으로 나올 것이다라는 것을 추론해보고, 여기에 대한 해결 방안도 함께 고민하는 등 복습 뿐만 아니라 심화적으로 사고를 발전하기도 했습니다.</p><p><br></p><p><br></p><p><br></p><p>3. 이번 모임은 15학번 정선일 학우가 대표로 스터디를 이끌었으며, 다음 주는 17학번 김해린 학우가 4장 Thread 부분에 대해 학습을 이끌어나갈 예정입니다.</p>','2020-04-02 17:47:19.811856','group34',NULL,228,NULL,'#3 OSC chapter 3. Process 학습','14:30',3,90),(158,'2020/04/03/orig/7C0830A3-5897-403F-AE06-FFDE29B1891E.jpeg','분반이 다르고 퀴즈가 달라 POSIX shared memory와 System-v shared memory의 연결점에 대해서 이야기 함.\r\n\r\n\r\n\r\n과제에 대해 깊게 이야기하지 않고 과제의 방향과 잘 이해가 되지 않는 부분에 대해서만 공유함.\r\n-LCS 함수의 리턴값에 대한 이야기','2020-04-03 12:14:11.332052','group8',2538,202,'2020-04-03 12:07:14.144420','전날 본 이론 및 코딩 퀴즈에 대한 토론','20:00',2,70),(159,'2020/04/03/orig/C5F85912-1731-49D4-A214-47A141DB4C2B.png','1.Truth table 예제 중 어려운 문제 풀기\r\n2.Manipulation of algebric expression 헷깔리는 개념 정리 및 예제 문제 풀기\r\n3. Converting a Truth table to algebric 예제 풀이\r\n4. K-map 예제 문제 중 모르는 것 질문\r\n5. Conversion of Forms 개념 요약','2020-04-03 13:38:00.822276','group13',NULL,207,NULL,'[Logic Design] 그룹스터디2','21:00',1,95),(160,'2020/04/04/orig/study.png','<p><img src=\"/upload_files/django-summernote/2020-04-04/06389cd0-660f-45b5-b6d8-dcdc1e932004.jpeg\" style=\"width: 720px;\"><br></p>','2020-04-04 02:46:45.585262','group60',8642,254,'2020-04-04 02:39:43.967622','Java Programming (1~3강)','10:00',2,100),(161,'2020/04/04/orig/2DC21A93-AC35-4419-84EE-9A8FE4DFE9B5.png','데이타 구조 스택 공부','2020-04-04 05:45:50.455580','group33',7089,227,'2020-04-04 05:42:01.809554','study07_0404','00:00',7,210),(162,'2020/04/04/orig/6th_week.png','<p>5주차 내용 복습 : Multiple Thread, Inter-process communication, RPC 등등 에 대해 복습</p><p>교수님의 수업자료와 QnA 세션 복습 + 정리</p><p>fork 코드들 복습</p><p><br></p><p><br></p><p><br></p>','2020-04-04 06:43:27.736905','group16',NULL,210,NULL,'OS 4주차','14:00 - 15:45',4,105),(163,'2020/04/04/orig/KakaoTalk_Photo_2020-04-04-16-58-59.png','<p>PI와 EPI의 개념을 다시 복습함.&nbsp;</p><p>모두가 Glitch를 어려워하여 Glitch에 대해 복습하고 왜 Glitch가 발생하는지에 대해 나눔.</p><p>또한 Glitch-free를 재설계하는 법에 대해 복습함.&nbsp;</p><div class=\"page\" title=\"Page 2\" style=\"font-family: -webkit-standard;\"><div class=\"layoutArea\"><div class=\"column\"><ol start=\"0\" style=\"list-style-type: none;\"><li><p><br></p></li></ol></div></div></div>','2020-04-04 08:04:11.646334','group25',6483,219,'2020-04-04 07:58:32.337730','논리회로','18:30 ~ 17:00',6,30),(164,'2020/04/04/orig/KakaoTalk_Photo_2020-04-04-17-34-01.jpeg','<p>뺄셈기에 대한것을 추후 교수님이나 ta에게 질문</p><p>챕처 1,2에 대한 test문제풀이 및 토론</p><p><br></p><p>combination system delay에 대한 설명.</p><p>게이트를 거칠때 마다 딜레이가 발생한다.</p><p>이런상황때문에 harzad라는 것이 발생 예를 들어, input이 a,b,c일때 b,c값이 바뀔때 b는 게이트1개, c는 게이트2개를 거처 f값이 변하게 된다면, 먼저 바뀐 b값에 의해 정확하지 않은 F값이 딜레이 시간동안 발생하는것이다.</p><p>이 현상은 combination system에 대해 큰 위험을 초래할수 있음.</p><p><br></p><p>문제풀이 정리</p><p>chapter1</p><p>1.b 답이 이상함 -&gt; 답지가 잘못된것.</p><p>3.에서 singed binary라는 것은 two\'s complement를 의미함.</p><p>4. 첫번째 문제의 carry의 (0) 이 아닌 (1)이 되어야 함,</p><p><br></p><p>chapter2</p><p>4.b&nbsp; &nbsp; &nbsp;첫번째 두번째항을 a로 묶어 2input형태로 만들면 가능함.</p><p>5.e&nbsp; &nbsp; &nbsp;분배법칙을 이용해 정리.(minimum을 구함.)</p><p>6.c&nbsp; &nbsp; w\' 와 w를 묶으면 2인풋게이트 형태로 정리가능하다.</p><p>7.b&nbsp; &nbsp; 이문제의 중요한 핵심은 x\'y+yz+xz = x\'y+xz임을 활용하는것!(+이에 대한 증명논의)&nbsp;</p><p><br></p><p>오늘의 가장큰 수확</p><p>a\'b+ac = (a\'+c)(a+b)가 된다는것</p><p>또한 반대로</p><p>(a\'+c)(a+b) = a\'b+ac가 된다는것, 정말 유용하게 거의 모든상황에 적용가능하다는것을 깨달았다.<br></p>','2020-04-04 09:11:04.361237','group30',NULL,224,NULL,'chapter test1,2','16:00',2,100),(165,'2020/04/04/orig/03-20200403-17301830.png','<p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">범위: OS - chapter 2.1 ~ chapter 2.3 (교재 범위)</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">1) 무작위로 2명을 선정하여 나머지 인원들에게 강의 형식으로 발표</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">2) 전체 내용을 다시 한 번 되짚으며 복습 및 관련 내용 상호간 QnA</p>','2020-04-04 11:56:02.484221','group58',5260,252,'2020-04-04 11:53:14.567438','OS chapter 2 review','17:30',3,60),(166,'2020/04/04/orig/KakaoTalk_20200404_200326924.png','<p>- 멀티코어가 존재한 다는 것은 쓰레드가 다중으로 존재한다는 것이다.&nbsp;<br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;멀티 쓰레드를 위해서 멀티 코어가 존재한다.&nbsp;</p><p>- Q. direct communication과 indirect communication 둘 다 blocking이나 nonblocking이 일어날 수 있나요? 네 둘다.&nbsp;</p><p>- Q. shared memory는 physical한 메모리를 공유하는가? 아니면 메모리를 동기화하는 것인가? physical 메모리 공유. 포인터 사용, 커널이 관리</p><p>- Q. indirect communication에도 임시큐가 있나요? 이를 사용하는 이유는 무엇인가요? buffering을 저장 방식으로 생각한다면, 여러가지 메시지를 저장해야 하므로 이를 사용합니다.</p><p>- Thread에 관련된 문제 공유 &amp; 다른 학교 시험 공부 같이 공부.&nbsp;</p><p><br></p>','2020-04-04 12:42:03.803645','group45',NULL,239,NULL,'Ch3 & Ch4','20:00',3,100),(167,'2020/04/04/orig/1BF50114-9376-45D6-A753-2CBC9ADBC937.png','오늘은 알고리듬 15장 dynamic programming에 대해서 공부했다. 15장을 공부하면서 dynamic programming이 알고리듬에서 얼마나 중요한지 깨닫게 되었다.','2020-04-04 13:06:09.357326','group10',9478,204,'2020-04-04 13:01:15.241547','알고리듬 스터디','20:00',2,120),(169,'2020/04/04/orig/grou36_2.jpg','<p><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">오늘은 Java 프로그래밍을 위주로 복습을 했습니다.</span><br style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\"><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">강의 PPT에서 몰랐던 부분이나 이해가 안 됐던 부분을 서로 물어보고 찾아보며 학습을 했습니다.</span><br style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\"><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">이후에는 예제 코딩 문제들을 통해 연습하고, 막히는 부분을 서로 연구하며 풀어봤습니다.</span><br></p>','2020-04-04 14:07:28.816555','group36',6092,230,'2020-04-04 14:05:41.507254','2번째 스터디','21:00 ~ 23:00',2,120),(173,'2020/04/05/orig/KakaoTalk_20200405_132434213_8xdHvMH.png','<p>** 3월 24일 진행한 스터디에 대한 늦은 보고서 제출입니다. 3월 24일 스터디 당시 코드와 함께 사진으로 첨부하였습니다.</p><p>Chapter 1,2과 개념복습 및 exercise 풀이, 모르는 것 질문</p>','2020-04-05 05:07:55.186369','group13',6581,207,'2020-04-05 05:04:42.059784','20.03.24 [Logic Design] 그룹스터디','21:05',2,100),(175,'2020/04/05/orig/FDC6C462-1311-4F13-8223-91251E75F591.png','임베디드프로세서응용실습의 이론을 공부했다.\r\n\r\nNVIC resister와 System Timer resister에 대해 서로 모르는 개념에 대해 질문하고 ppt 슬라이드를 같이 복습했다.','2020-04-05 06:46:07.018474','group6',8053,200,'2020-04-05 06:45:27.058950','4/1 임베디드 스터디','09:30',1,120),(177,'2020/04/05/orig/1586069385638.png','수업 내용 복습 및 과제 풀이 전략 공유(코드 공유x)\r\nOpendrain mode에 대한 이해\r\nDigital in&output에 대한 이해\r\nPortInOut의 사용법\r\nwait 함수의 응용법 등에 대해 같이 공유하고 공부하였다.','2020-04-05 06:51:10.285896','group6',4725,200,'2020-04-05 06:48:41.300414','2020.04.05 임베디드 디지털 인&아웃풋','13:50',2,120),(178,'2020/04/05/orig/KakaoTalk_Image_2020-04-05-15-48-04.jpeg','<p>1. 운영체제 3주차, 4주차 진도를 커버함.&nbsp;</p><p>2. 알고리듬 문제풀의 질의</p><p>다음 스터디 일정 및 일 분배 나눔.&nbsp;</p><p>5/월-유리, 5/목-진우 6/목-하연 초반~6/목 알고 -제현 스터디 준비하기 4월 12일 일요일 2시</p><p><br></p><p>피드백:&nbsp;</p><p>-운체 부분에서는 설명이 너무 빨랐다. </p><p>- 알고리듬에서 준비를 더 해야겠다.&nbsp;</p><p>-비록 온라인이었지만 많은 부분들을 같이 공부하면서 배울수 있어서 좋았습니다<br></p><p><br></p>','2020-04-05 06:52:30.649097','group32',NULL,226,NULL,'2번째 스터디','14:00',2,120),(179,'2020/04/05/orig/Group364_5.jpg','<p>오늘은 논리설계 스터디를 진행했다.</p><p>수업 중 이해가 되지 않았던 내용들을 토대로 서로 이해한 내용을 공유하며 공부를 진행했다.</p><p>또한 지난 수업에서 배웠던 내용을 다시 복습하고 정리하는 시간을 가졌다.&nbsp;</p><p>논리설계 속 게이트를 그리는 방법이나 sop, pos 등 식을 풀어나가는 방식에 대해서도 연구하고, 교재에 있는 예제 내용들을 풀어보았다.</p>','2020-04-05 14:03:53.913429','group36',2086,230,'2020-04-05 13:58:15.793701','3번째 스터디','22:00 ~ 23:00',3,60),(181,'2020/04/06/orig/03_20200330_1600_1700.png','<p>1. 스터디 내용</p><p>임은채 학우님께서는 저번주 과제 설명과 사용되는 개념을 설명하였습니다(성금영 교수님 분반). 최지우 학우님께서는 design pattern 중 하나인 singleton pattern의 개념과 예시를 통해서 설명하고 generic component 를 위한 refactoring, generalizing, inheritance, delegation 의 개념과 예시를 설명하였다(김기석교수님 분반). 김연수 학우님은 ppt 노트 정리를 통해 전체적인 강의 흐름을 이해하려고 하였다. (김기석 교수님 분반)</p><p>2. 다음 스터디 계획&nbsp;</p><p><br></p><p>이번주 수업을 듣고 공부한것들을 가져오기로 했습니다.</p>','2020-04-06 07:53:15.792524','group24',7463,218,'2020-04-06 07:47:51.687633','2020-03-30','16:00',3,60),(182,'2020/04/06/orig/04_20200406_1600_1700.png','<p>1. 개인 공부 나눔</p><p>2주전의 수업 내용과 저번주의 수업 내용에 대한 전체적인 복습을 진행하였습니다.</p><p>1. 2주 전의 수업 내용<br>refactoring의 의미와 어떻게 진행하는지에 대한 설명이 있었다. digitalClock의 구조를 점진적으로 개선해나가는 코드와 uml이 인상적이었다.<br></p><p>2. 저번주의 수업 내용<br>(1) template method design pattern, generalizing, strategy design pattern, abstract coupling, direct coupling에 대한 설명이 있었으며, template method design pattern과 abstract coupling의 차이에 대한 질문이 있었다.&nbsp;<br></p><p>(2) thread를 이용한 concurrent programming에 대한 설명이 있었다. os에서 배운 것과 겹치는 내용이 많았다.</p><p><br></p><p><br></p><p><br></p>','2020-04-06 08:08:03.773207','group24',NULL,218,NULL,'2020-04-06','16:00',4,60),(183,'2020/04/06/orig/group36_4.jpg','<p>오늘은 이번주에 있을 논리설계 퀴즈를 대비하여 복습하는 시간을 가졌다.</p><p>진리표를 이용하여 논리회로를 표현하고, 반대로 논리회로를 보고 진리표와 부울식을 표현하는 문제들을 풀었다.</p><p>부울식을 간단하게 만드는것을 더 연습 하면 큰 도움이 될 것 같다.</p>','2020-04-06 14:23:54.023171','group36',2806,230,'2020-04-06 14:17:33.622572','4번째 스터디','22:00 ~ 23:15',4,75),(184,'2020/04/06/orig/study1.JPG','<p>오늘 수업인 Stack에 대해서 stack implementation using dynamic array에 대한 전반적인 내용과 주요함수에 대해서 알아봄.</p><p>-push()</p><p>-top()</p><p>-pop()</p><p>수업시간에 나온 assignment를 함께 이야기하고 궁금증과 해결방에 대해서 나눔.</p><p>-Q: resize(capacity *2)</p><p>open form to closed form</p><p>T(N) = N + (1 + 2 + 3 + 4 + ... + N)</p><p>==&gt; 이 식을 closed form으로 변환</p>','2020-04-06 14:28:11.165199','group56',6401,250,'2020-04-06 14:18:26.550787','C++ : Stack','22:00',1,70),(185,'2020/04/07/orig/19-20200407-1300-1430.PNG','<p>4강(Threads) 복습</p><p>- Thread, Multicore Programming 등의 내용을 복습하였습니다.</p>','2020-04-07 05:32:06.241839','group19',3287,213,'2020-04-07 05:29:24.316190','다섯 번째 스터디 그룹 모임(4월 7일)','13:00',5,90),(187,'2020/04/07/orig/ssg.png','<p>전자회로 ch 1 amp 증폭기 부분 스터디 리뷰를 했습니다.</p>','2020-04-07 05:47:18.585383','group11',6425,205,'2020-04-07 05:39:44.731855','전자회로 1 스터디','13:00',1,90),(188,'2020/04/07/orig/KakaoTalk_20200407_162444432.png','<p>잘 이해가 가지 않는 다이오드에 대해서 공부하고 약 1시간은 통신이론에서 푸리에 analysis와 X(f)에서 주파수 domain의 식이 계산되는 과정에서</p><p>모르는 것을 같이 공부하였고 앞으로 배울 am, fm 을 살짝 겉보기로 공부하였습니다.</p>','2020-04-07 07:27:26.619475','group57',2630,251,'2020-04-07 07:20:22.713849','전자회로 및 통신이론 공부','15:00',2,120),(189,'2020/04/07/orig/EEBA8686-2DB0-44C4-B057-CF5A2A78A582.jpeg','이번 주에는 직접 데이터베이스를 설계해 본 예시를 토대로 스터디를 진행하였습니다. 테이블 내부는 어떻게 구성하고 테이블끼리 어떻게 연관지어야 하는지 공부해 보았습니다.','2020-04-07 09:25:30.077413','group61',3495,255,'2020-04-07 09:19:19.738092','3일차','17:30',3,80),(190,'2020/04/07/orig/KakaoTalk_20200407_183008296.png','<p>1. 중간고사 문제 중 어려웠던 문제 풀이</p><p>2. KCL과 KVL을 사용하여 회로문제 분석 및 풀이</p><p>3. OP-AMP CIRCUITS분석 및 교재 속 Example 풀이</p>','2020-04-07 10:26:15.703040','group40',8107,234,'2020-04-07 10:20:13.954293','2. 중간고사 풀이 및 4단원 복습','18:00',2,60),(191,'2020/04/07/orig/group55_study3.jpeg','<p st