0',3,60),(198,'2020/04/07/orig/04-20200407-2200-2300_oFQLIJS.png','<p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">1 운영체제</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">퀴즈 관련 문제 message 저장를 저장하고 관리하는 함수에 대해 system V와 POSIX함수에 대한 정리</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">그리고 서로 그 함수를 어떻게 이해하고 문제에 적용했었는지 부족한 부분들 보충하고 완벽하게 이해하지 못한 개념들을 숙지하는 시간을 가졌습니다.</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">pthread를 통해 어떻게 정보를 주고 받는지에 대해서도 같이 구글링을 하면서 자세하게 알아보았습니다.</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\"><br></p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">2 알고리즘&nbsp;</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">Dynamic programming 과 Greedy 알고리즘에 대해 어떤 차이점이 있는지&nbsp;</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">강의 예제 문제를 보면서 설명하는 시간을 가졌고, 어느 문제에서 greedy 알고리즘을 써야하는지 복습하였습니다.</p>','2020-04-07 14:13:26.899093','group38',2870,232,'2020-04-07 14:13:26.889431','네번째 스터디','22:00',4,60),(199,'2020/04/08/orig/D40410A8-432F-46DC-BBD0-07B20E81A7A9.png','<p>운영체제의 쓰레드 개념에 대해 공부</p><p><br></p><p>Fflush() 함수에 대한 고찰</p><p><br></p><p>Permission denied 에러는 어떤 상황에서 발생하는가?</p><p><br></p><p>각자 진로에 관한 고민과 논의</p><p>- 혜정: 은행에서 ict업무를 보면서 금융 데이터 분석을 해보고 싶다. 에러 리포트 분석가도 도전 계획</p><p>- 신휘: 전산 경영 전공을 살려 융합적인 업무를 해보고 싶다</p><p>- 하은: 게임 관련 회사 취업이나 창업을 해보고 싶다</p><p><br></p>','2020-04-07 15:03:38.031902','group8',6572,202,'2020-04-07 14:58:23.166469','운영체제 스터디와 진로 계획 쉐어링','20:00',3,240),(200,'2020/04/08/orig/KakaoTalk_Photo_2020-04-08-00-25-31.png','<p>처음 스터디 모임을 가졌고, 어떤 방향으로 스터디를 이어가야 할 지에 대해 논의했습니다.</p><p>매주 모임은 화요일 오후 8~9시에 약 한 시간 이상 갖기로 했고, 스터디 내용은 일주일간 데이타구조 강의에서 배운 내용을 복습하고, 각자 수업에서 이해가 잘 안 간 부분에 대한 질문을 준비하여 서로 토의하며 이해를 돕는 과정을 주로 하기로 했습니다.</p><p>오늘은 첫 시간인만큼 Meet를 통해 서로 소개하고 linked list와 stack의 부분 중 특정 함수(memcpy)와 메모리에 대해서 공부했습니다.</p>','2020-04-07 15:31:40.248487','group53',NULL,247,NULL,'첫 모임 - 데이타구조 Stack 복습','20:00',1,75),(201,'2020/04/08/orig/BA9F97EB-0ECB-403C-BBC6-BC26A9FB8058.png','recursion에서 stack의 이용을 파악하고 교수님이 수업중에 요구한 수준의 recursion 수준에 달성함','2020-04-07 15:54:01.665137','group21',4690,215,'2020-04-07 15:47:52.633533','4월 8일','23:30',3,90),(202,'2020/04/08/orig/KakaoTalk_Photo_2020-04-08-12-58-27.png','<p><img src=\"/upload_files/django-summernote/2020-04-08/c5e3ef66-1c6a-45f8-ac2c-94cf805403a1.jpeg\" style=\"width: 720px;\"><img src=\"/upload_files/django-summernote/2020-04-08/c5af414a-11a5-4ca4-bbc7-6d6c0437adc6.png\" style=\"width: 1356px;\"><br></p>','2020-04-08 03:59:50.984780','group60',4376,254,'2020-04-08 03:49:58.969535','로직디자인 3,4강','10:00',3,159),(203,'2020/04/08/orig/D2A6981B-38B9-4F25-9062-C9C1746B60AE.png','두번째 모임^!^\r\n각자 해야할 공부를 하기로 했다.\r\n가볍게 서로 수강중인 수업에 관하여 질의응답을 하고, 공부를 시작했다.\r\n카메라를 켜놓고 하기에 딴짓하지 않기 !\r\n이찬효 - 오픈소스소프트웨어실습 이전에 하던 프로젝트 설계를 마저 진행함.\r\n고혜리 - 오픈소스소프트웨어실습 교과서를 보며 공부.\r\n김성영 -  자바프로그래밍 지난 수업시간 내용 복습\r\n\r\n다들 앞으로도 꾸준히 열심히 공부해요 ! (*˙˘˙)♡','2020-04-08 09:37:25.434516','group3',3495,197,'2020-04-08 09:28:24.356268','두번째 스터디 ( ´ ▽ ` )ﾉ','17:30',2,60),(204,'2020/04/08/orig/1.png','<p>스터디 방향에 대해서 이야기 했다.&nbsp;</p><p>월: 디비 수: os 토: 알고를 하기로 했다.&nbsp;</p><p>시간: 20:00 - 22:00</p><p>할일: 교과서미리읽고 예제문제 풀어오기.</p><p>시험1주전 스터디모임 x</p><p>그리고 과제에 대해 논의 했다.</p>','2020-04-08 11:16:04.604521','group5',9628,199,'2020-04-08 11:12:59.480123','스터디 첫 모임','20:00',2,40),(205,'2020/04/08/orig/3.png','<p><b><span style=\"font-size: 18px;\">OS hw3 feedback</span></b></p><p><br></p><p>산나: 과제형식대로 출력하는 방법을 해보다가 fflush(stdout)이라는 함수를 배웠다.</p><p><br></p><p>수현: 구조체를 사용했다가 core dump가 생겨 그 문제를 해결하기가 어려워, 그냥 char버퍼를 선언해주고 거기에 값을 할당해주고 받아오는 형식으로 해결함.</p><p><br></p><p>완서: 강의에서 배운 것을 과제수행을 함으로써 어떻게 사용하는지를 직접 해 볼 수 있어서 좋았다. (ex. thread 사용)</p><p><br></p><p>나리: msgrcv()를 사용할때, 안에 어떤 argument가 들어가야하는지 꼼꼼히 봐야겠다.</p>','2020-04-08 11:41:45.915684','group5',2813,199,'2020-04-08 11:36:40.570784','DAY3','20:00',3,40),(206,'2020/04/08/orig/0CC6B7F5-4C21-4C32-81F7-5025EFBD6F54.png','알고리즘 퀴즈봤던 문제 리뷰하기\r\nsorting 알고리즘 질문\r\n그리디 알고리즘 모르는 문제 같이 풀어보기','2020-04-08 11:57:19.017763','group49',7291,243,'2020-04-08 11:53:36.497670','알고리즘','20:00',3,60),(208,'2020/04/08/orig/KakaoTalk_Photo_2020-04-08-22-18-14.png','<p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">3월 25일 수요일 오후 8시 시간에 맞춰 모두가 zoom을 통해 모였습니다.</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">우선 논리설계 교재 1장의 뒷부분에 있는 Exercises 중에서 \'*\' 표시 되어있는 문제와 test 문제들을 전부 풀어왔는지 확인했습니다.</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">이후 각자 푼 문제들 중에서 모르거나 애매한 부분들을 서로 물어봤습니다.</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">우선 11번의 조건들을 이해하지 못해 그 조건들에 대한 질문이 있었습니다. 그 조건은 교수님이 올려주신 PPT의 자료 중에서 어느 부분에 있다고 다른 학생이 알려주었습니다.</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">다음 문제는 test 문제의 1번의 b번 이었습니다. 이때 셋이 확인 해본 결과 모두가 같은 답이 나왔지만 답지에는 다른 답이 나온 것으로 확인되었습니다. 그래서 좀 더 의논해 보았고 답지에서 hexadecimal로 바꾸지 않아 답이 다랐다는 결과가 나왔습니다.</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">이후 데이터 구조에서 배우는 c++에 대해서도 서로 질문했습니다. 서로의 코드에서 일어나는 에러들의 원인을 같이 알아보고 문제들을 하나하나 해결해 나갔습니다.</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">다음주에 있을 스터디를 위해 우리는 논리 설계 2장의 문제들을 풀어오기로 하며 스터디를 마쳤습니다.</p>','2020-04-08 13:35:36.348312','group2',8641,196,'2020-04-08 13:34:44.608031','0325 모임2','20:00',4,40),(209,'2020/04/08/orig/Group3604_08.jpg','<p>오늘은 곧 있을 논리설계 퀴즈를 대비해 다시 한번 점검하고 복습하는 시간을 가졌다.</p><p>추가로 오늘 들었던 수업에 관해서도 복습하고 이전 스터디에서 다 끝내지 못했던 부분을 이어서 공부했다.</p><p>연습 예제들을 풀던 중 이해가 가지 않는 부분들은 책이나 인터넷에서 더 찾아가며 모든 예제를 다 풀 수 있었다.</p>','2020-04-08 13:58:05.525295','group36',9047,230,'2020-04-08 13:53:56.121439','5번째 스터디','21:00',5,90),(210,'2020/04/08/orig/KakaoTalk_20200408_201432844.jpg','<p>4월 1일 수요일 8시 정각에 스터디를 시작하였습니다.</p><p><br></p><p>저번 스터디모임때, 논리설계 교재 2장의 exercises 20번문제까지 풀어오는 것을 숙제로 정했었습니다.</p><p><br></p><p>이 문제들 중에서 어려웠거나 헷갈렸던 문제에 대해 질문하는 시간을 가졌습니다.</p><p><br></p><p>2번문제에서 문제가 요구하는 바가 무엇인지,</p><p><br></p><p>3번문제의 P2a가 무엇인지를 질문하는 등 다양한 질의응답이 이루어졌습니다.</p><p><br></p><p>이후, 저희는 헷갈리는 개념에 대해서 정확하게 알고가는 시간을 가지게 되었습니다.</p><p><br></p><p>그 중에서도 특히, minterm과 maxterm에서 0과 1이 서로 다르게 쓰인다는 점을 정확하게 알게되었습니다.</p><p><br></p><p>예를 들어, a\'이 minterm에서는 0을 나타내지만, maxterm에서는 1을 나타낸다는 사실을 알게되었습니다.</p><p><br></p><p>이후 저희는 헷갈렸던 개념들을 문제에 적용해보고, 서로 그 문제를 맞게 풀었는지 확인해보았습니다.</p><p><br></p><p>2장 exercises문제들을 모두 풀어오는 것을 숙제로 정하면서 스터디를 마무리했습니다.</p>','2020-04-08 14:33:00.360534','group2',1573,196,'2020-04-08 14:30:51.551687','0401 모임3','20:00',5,120),(211,'2020/04/09/orig/0409_group34.JPG','<p><img src=\"/upload_files/django-summernote/2020-04-09/9eade519-741b-4150-a271-7ccf67ffb057.jpg\" style=\"width: 1341px;\"></p><p><br></p><p>1. 본문에 대한 내용:</p><p>지난 주에서 멀티 스레드에 관한 개념을 배웠다. 스레드란 싱글 컨트롤 플로우로, 이 스레드를 여러개 갖는 멀티스레드에서는 어떤 특징을 가지고, 어떤 장점과 단점이 있는지를 해린학우가 대표로 정리한 노트를 토대로 리마인드하는 시간을 가졌다. 한편, 이번 주 강의로 올라온 signal과 pipe에 관한 커널 프로그램 예시를 살펴보면서, signal1~4까지의 예제에서 보이는 signal 함수, 그리고 거기에 들어가는 인자에 따라 ctrl+c 가 어떻게 작동하는 지를 살펴보았고, 또 지난 시간에 배운 fork함수랑 연관하여 parent process에서와 child process에서 pipe를 각각 어떻게 다루고 처리하는지를 배웠다.&nbsp;</p><p><br></p><p>2. 홈워크에 대한 내용:</p><p>이번 홈워크를 수행하기 위해 함께 첨부된 강의들에 대해 논의해보고, 이 과제가 지향하는 바가 무엇인지를 곰곰히 생각해보았다. 그러다 교수님의 설명 영상에 답을 찾을 수 있을 것 같다고 생각하고, 강의를 꼼꼼히 보며 서로 배울 수 있도록 하자고 다짐하기도 했다.&nbsp;</p>','2020-04-09 07:04:59.112685','group34',3097,228,'2020-04-09 06:56:23.954131','#4 chapter 4. Thread / Talked about how to approach to the Programming Assignment1','14:30',4,90),(213,'2020/04/09/orig/04-2020-04-09_2000-2030_016s0fZ.png','<p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">네번째 스터디 모임으로, Linked list의 개념에 대해서 복습하는 시간을 가졌습니다.&nbsp;&nbsp;</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">오늘 수업 내용인 tree와 binary tree에 잠깐 나누고,</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">Linked list에서 추가로 고려가능한&nbsp; member function중 remove_a_node 의 풀이에 대해 나눴습니다.&nbsp;</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">입력한 name에 대해서 node를 삭제하고 링크를 조정해주는 과정의 조건을 살펴보면서 linked list의 이해도를 높였습니다.</p>','2020-04-09 11:39:13.137528','group22',7821,216,'2020-04-09 11:37:35.381352','2020.04.09 데이터 구조 스터디','20:00',4,30),(214,'2020/04/09/orig/1586432784043.png','주중에 모르는 것들 카톡으로 공유\r\n회로이론 이해 안가는 내용 q&a\r\n회로이론 문제 풀이','2020-04-09 11:48:14.391355','group29',3205,223,'2020-04-09 11:45:19.201892','4/9','20:00',5,50),(215,'2020/04/09/orig/Screenshot2.png','<p>오늘 저번 스터디 시간에 확실히 해결하지 못한 propagation delay와 hazard의 concept에 대해 다시 한번 스터디 시간을 가졌다.&nbsp; 서로 정리와 공부해온 내용을 가지고 공유했다. 서로 공부해온 정보를 바탕으로 concept 정리를 다시 했으며, 정리된 concept을 토대로 교수님께서 제공해주신 exercises 문제들을 풀어보았다. 모두가 이해가 되었고 exercises 문제들도 성공적으로 풀 수 있었다.</p>','2020-04-09 13:51:03.267735','group48',9208,265,'2020-04-09 13:47:16.416563','Propagation Delay & Hazard 스터디','21:00',2,100),(216,'2020/04/09/orig/DSStudy0409.jpg','<p>Problem set05과 Class assignment06을 함께 토의해보고 problem set05에 대한 궁금증과 해결방법에 대해 알려주고 배우는 시간이었다.</p><p>특히 Problem set05는 스택에 관련된 주요 내용들이 포함되어 있기 때문에 stack에 대한 전체적인 내용에 대해서도 알 수 있었다.</p><p>그리고 vector와 template를 사용하여 stack을 구현하고 개념과 원리에 대해서 배우는 시간이었다.</p><p>Class assignment06에서는 queue에 관한 내용을 전반적으로 다루고 있기 때문에 enqueue와 dequeue의 개념과 원리에 대해서 알고 배우는 시간이었다.</p>','2020-04-09 13:54:27.063115','group56',5128,250,'2020-04-09 13:50:16.627457','DS stack관련 과제논의','19:00',2,150),(218,'2020/04/09/orig/DSStudy2_0409_83klgLz.PNG','<p>오늘 수업시간에 배운 Queue에 대한 전반적인 원리와 내용에 대해서 배우고 알아가는 시간이었다.</p><p>특별히 Class Assignment로 나온 문제를 해결하면 Enqueue와 Dequeue에대한 개념을 알고 이해하는 시간이었다.</p>','2020-04-09 14:03:27.175211','group56',9152,250,'2020-04-09 14:00:35.771277','DS Class Assignment 6','20:51',3,60),(219,'2020/04/09/orig/ss.png','<p>오늘은 OS의 과제에 대해서 이해가지 않는 부분에 대해서 이야기 했다.</p><p><br></p><p>우분투 가상머신을 설치하고 공유폴더를 설정하는게 잘 되지 않아서 힘들었다.</p><p><br></p><p>잘 좀 해결되었으면 좋겠다만 잘 되지 않아서 헬프데스크를 찾아가야 할 것 같다.</p>','2020-04-09 14:33:23.255272','group23',1365,217,'2020-04-09 14:28:37.744116','4월 9일 스터디','21:00~23:30',3,150),(221,'2020/04/10/orig/1586503209644_y3DfVnr.png','운영체제에서 배운 pipe를 같이 복습하고\r\nsocket과 pipe의 차이, many to one thread 등의 이해되지 않는 부분들을 같이 해결했다.\r\n\r\n교수님 예제코드에서 이해가 되지 않는 부분들을 같이 짚어보며 학습했다.ex) 0x0 parameter.','2020-04-10 07:29:17.857283','group62',9724,256,'2020-04-10 07:27:22.649736','운영체제 복습, 예제코드 이해','15:00',5,75),(225,'2020/04/10/orig/20200410-1900-2030_D911VS0.PNG','<p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: norma