ays, Dynamically Allocated Arrays, Structures, Representation of Multidimensional Arrays, Ordered Lists, Strings</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Abstract Data Type, Declaring and Using a class Data Type, Separate Specification and Implementation Files, C++ class Constructors, Object Oriented Programming, exmaples</p>','2020-04-11 13:27:42.153762','group37',NULL,231,NULL,'Data Structures 복습','21:20',3,56),(240,'2020/04/12/orig/KakaoTalk_20200409_193518694.png','<p>1. 운영체제 1장 2장 서로 문제 내주기</p><p>2. 운영체제 4단원 서로 모르는 부분 공유</p><p><br></p><p>ps. 과거에 한 모임을 지금 올렸습니다.</p>','2020-04-12 06:39:13.697177','group63',6137,257,'2020-04-12 06:37:04.168417','운영체제 복습','18:00',2,180),(241,'2020/04/12/orig/4B502565-80DE-44AC-8565-AD4290051A80-4312-000003B981A9EF8E.JPG','<p>오늘은 전반적으로 데이타구조를 공부하기 위한 계획을 짰고, 다 포항에 있기 때문에</p><p>중간 고사 전까지 만나서 모르는 부분에 대해서 공부하기로 하였다.</p><p><br></p><p>To do list (Study)</p><p><br></p><p>1. 예제 훑어보기, 예제 읽기&nbsp;</p><p>2. 문제를 5문제씩(강의 초반부터 pointer부분까지 문제를 만든다)</p><p>3. 날짜 알리미(과제나 다른 공지가 떴을 때 미리 한 사람이 알려줄 수 있도록)</p><p><br></p><p>Pointer 까지 문제 만들어보기</p><p>과제로 안주신 예제(18번째 강의 linked list 응용 파트)</p><p><br></p><p>목요일 오후 8시, 일요일 4시</p><p>일요일에 할꺼는 목요일에 미리 정하도록 한다.</p><p><br></p><p>**저희가 살짝 미숙해서 처음에 미팅 할때 코드를 캡쳐안해서, 코드 캡쳐를 따로 하기 위해 다시 방을 만들었습니다..!</p>','2020-04-12 08:26:27.222828','group1',6134,195,'2020-04-12 08:21:52.400453','데이타구조 공부 계획','16:00',1,60),(242,'2020/04/12/orig/KakaoTalk_Photo_2020-04-12-21-12-14-3.png','<p><img src=\"/upload_files/django-summernote/2020-04-12/ca42f891-014a-4d7d-b50b-6eb4b7e2dbb6.jpeg\" style=\"width: 720px;\"><img src=\"/upload_files/django-summernote/2020-04-12/4370a968-ecf7-4f00-b691-28365787afd0.jpeg\" style=\"width: 720px;\"><br></p>','2020-04-12 12:15:33.139796','group60',9831,254,'2020-04-12 12:07:20.294726','Java Programming (6강), (3강)','8:10',5,60),(243,'2020/04/12/orig/KakaoTalk_20200412_214017418.jpg','<p>가장 어렵고 중요한 과목으로 꼽는 데이타구조를 주로 삼고 논리설계나 자바 또한 Q&amp;A형식으로 질문을 받아 스터디를 진행했습니다.&nbsp;</p><p>stack 과 queue, postfix, 그리고&nbsp; prefix에 대해서 서로 좀 더 알아가는 시간이었고, 처음 가지는 모임이라 많은 것을 알지는 못했지만, 서로 부족한 점을 채워가며 나날이 발전해가는 스터디가 되겠습니다.&nbsp;</p><p>일주일에 한 번씩은 꼭 모이도록 하겠습니다.</p>','2020-04-12 12:40:54.599379','group44',6439,238,'2020-04-12 12:40:54.575617','많은 과목을 아우르는 스터디','19:00',1,120),(244,'2020/04/12/orig/04.png','<p>오늘은 4/13일에 있을 AA퀴즈 공부를 함께하였다.</p><p>zoom을 21:00부터 켜놓고, 다같이 공부하다가, 모르는 것이 생긴 사람이 팀원들에게 질문하는 형식으로 하였다.</p><p>나리가 huffmancode를 어떻게 구해야하는지를 물어봐서 완서가 tree를 그린다음에 왼쪽은 0, 오른쪽은1로 해서 그 코드를 찾아나가면 된다고 알려주었다.</p><p>수현이가&nbsp;MATRIX-CHAIN MULTIPLICATION에서 optimal solution찾기를 하기위하여 table을 채우는 과정에서 헷갈리고 이해하기 힘든 부분들을 팀원들에게 물었고,</p><p>산나가 그 부분에 대하여 자세하게 step by step으로 설명해주어 이해를 하고 넘어갈 수 있었다.</p><p>팀원들과 함께 퀴즈공부를 하고 서로의 어려움을 나눴던 유익한 시간들이였다!</p>','2020-04-12 13:35:18.014594','group5',3542,199,'2020-04-12 13:29:48.538508','DAY4','21:00',4,90),(245,'2020/04/12/orig/2020_04_12.png','<p>오늘은 데이터구조 수업시간에 배웠던 infix와 prefix에 대해서 공부를 했습니다.</p><p>특히, infix, prefix에서 쓰인 enum에 대한 것을 헷갈려하는 인원이 있어서 그 점에 대해서 공부를 했습니다.</p><p>또, 수업시간에 배웠던 Maze에 대한 프로그램에 대해서도 다시한번 Review를 해봤습니다.</p>','2020-04-12 13:50:32.593493','group14',NULL,208,NULL,'4/12 Group 14 스터디입니다','22 : 00',3,50),(246,'2020/04/12/orig/AE2329D5-9E1A-4950-9ACD-FF712353678C.png','Lab 4 A1의 privacy leak를 함께 공부하며 privacy leak의 의미와 해결방법을 공부함.\r\nLab 5 에서 풀었던 코드를 단계별로 선별해 서로의 코드를 공유하고 비교하며 서로의 새로운 알고리즘을 공부함.\r\n자바에서 array를 사용하는 방법과 PPT에 나오는 예제를 복습함.\r\nselection sort와 comparator에 대해 공부하고 string [] args의 의미와 사용법에 대해 알아가는 시간을 가짐.','2020-04-12 14:06:07.893034','group46',5027,240,'2020-04-12 14:00:14.268820','Lab 5 코드리뷰& array 복습','22:00',3,60),(247,'2020/04/12/orig/study2.png','<p>기초전자회로실험 과정에서 나오는 테브넌, 노턴 등가회로에 대해 스터디 하였습니다.</p><p>기존에 테브넌 방법이 아닌 테스트 전원 법, source transform의 방법으로 테브넌 등가회로, 노턴 등가회로를 만드는 방법을 찾아보고 공부했습니다.</p>','2020-04-12 14:52:11.741040','group9',8315,203,'2020-04-12 14:50:16.208705','테브넌, 노턴 등가 회로','2020-3-31 19:30',2,100),(248,'2020/04/13/orig/study.png','<p>Algorithm Analysis Quiz 대비</p><p style=\"margin-bottom: 1rem; user-s