yle=\"font-weight: 700;\"></span><br></p><p class=\"p1\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 17px; line-height: normal; font-family: &quot;Helvetica Neue&quot;;\"><span style=\"font-weight: 700;\">은채(디자인 패턴)<span class=\"Apple-converted-space\">&nbsp;</span></span></p><p class=\"p2\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;;\">Mediator design pattern</p><p class=\"p3\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 17px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; min-height: 21px;\"><span style=\"font-weight: 700;\"></span><br></p><p class=\"p1\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 17px; line-height: normal; font-family: &quot;Helvetica Neue&quot;;\"><span style=\"font-weight: 700;\">연수(자바 문법_abstract coupling)</span></p><p class=\"p2\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;;\">Abstract coupling<span class=\"Apple-converted-space\">&nbsp;</span></p><p class=\"p2\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;;\"><span class=\"Apple-converted-space\"><br></span></p><p class=\"p2\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;;\">에 대하여 서로 스터디 한 내용을 나누었다.</p><p class=\"p2\" style=\"margin-bottom: 0px; font-variant-numeric