00.png','<p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">범위: OS - Programming Assignment 관련 리뷰</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">1) PA1을 완료한 후에, 진행하면서 생겼던 피드백 서로 나누기</p><p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\"></p></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\">2) PA1 관련 개념 정리</p>','2020-04-14 12:52:24.817212','group58',8740,252,'2020-04-14 12:50:07.933579','OS PA review','20:00',5,60),(258,'2020/04/14/orig/1586869108013.png','보고서 내용\r\n>>데이타 구조 중간고사 범위 내용 중에서, 각자 문제를 만들어 와서 공유하고 함께 풀었다.\r\n\r\n>>다룬 내용\r\n- stack을 활용하여 palindrome 구현\r\n- infix를 prefix, postfix로 바꾸기\r\n- Big-0 notation 표현\r\n-recursive function','2020-04-14 13:02:51.404730','group35',8936,229,'2020-04-14 12:59:13.548925','4차 스터디 보고서','20:00',4,120),(259,'2020/04/14/orig/75A785BB-B5EB-43DF-A8DC-0880654E038D.png','Adder subtractor fast adder에 대해서 복습했다.','2020-04-14 13:59:50.219404','group25',9462,219,'2020-04-14 13:52:25.827504','논리설계','21:30 ~ 22:55',7,85),(263,'2020/04/14/orig/1586873986717.png','논리설계 boolean algebra 에 관하여 공부하고, 그에 해당하는 예제들을 풀고 모르는 부분들 서로 고민하고 나눴습니당!','2020-04-14 14:22:41.743264','group64',NULL,258,NULL,'논리설계 4과','21:00',2,80),(264,'2020/04/14/orig/1586865956573.png','기전실, LD, 회로이론 수업 중에 이해가 안됐던 부분 서로 알려줌.\r\n시험 문제 유형 예상해보기.\r\n주중에 카톡으로 질문 답변.','2020-04-14 14:55:09.277211','group29',NULL,223,NULL,'4/14','20:00',6,70),(265,'2020/04/15/orig/CB6EA029-58C2-4294-B841-4D32E74E08B4.png','1. Ideal op-amp model 해석하고 관련 example 문제 풀이\r\n2. Inverting op-amp와 Non inverting op-amp 회로 분석\r\n3. Superposition을 활용한 V0의 값을 구할 때의 회로 분석','2020-04-14 15:37:26.064577','group40',6750,234,'2020-04-14 15:37:24.805909','6~7주차 수업 복습 및 개념 잡기','18:00',3,60),(266,'2020/04/15/orig/KakaoTalk_20200408_204038567.png','<p>이번주에는 논리설계 교과서 속 2단원과 3단원의 exercise를 풀어와 함께 맞춰보고 이해되지 않는 문제들을 물어보는 시간을 가졌다.</p><p>김예안 학우님이 숙제를 다 해오지 못해 3000원을 내기로 했다.</p><p>2단원은 회로를 그려야 하는 문제들의 연속이었기 때문에 친구들이 너무 복잡한 회로들은 풀다가 중간중간 포기한 문제들이 많았다.</p><p>수업에서 배운대로 수식을 간단하게 고쳐서 그릴려고 해도 2-input으로 그리라는 문제들은 너무 복잡해지는 것들이 많았다.</p><p>and게이트와 or게이트, not게이트는 쉽게 그릴 수 있었지만 nand나 nor게이트로만 그리는것들은 아직도 햇깔리는 것들이 있었기 때문에 그 게이트들에 대해 집중적으로 공부하는 시간을 가졌다.</p><p>3단원은 2단원에 비해 문제들이 평이했는데, k-map을 그리는 문제들은 확실히 회로를 그리는 문제들에 비해 간편했던 것 같다.</p><p>하지만 변수가 5개인 k-map을 구하는 문제는 늘 생각하던 1차원이 아닌 2차원으로 생각해야되나보니 문제를 푸는데 어려움을 겪었던 친구들이 많았다.</p><p>특히 2차원으로 묶을 때 각 변수들의 차이가 1bit인지 확인하는 과정에 논쟁이 생겨 교수님의 ppt를 보며 다시 확인했다.</p><p><br></p><p>스터디가 끝난 후, 문제를 각자 풀어와 서로 햇깔리는 것만 물어보는 것은 너무 비효율적이라는 의견이 나왔다.</p><p>그래서 이제는 단순히 문제를 풀어오는것에서 그치지 않고, 총 풀어야 하는 문제들을 나누어 완벽하게 설명해올 수 있도록 하는것으로 바꾸기로 했다.</p><p>예를들어 내가 3번, 6번, 9번을 설명하기로 하면 그 문제만큼은 완벽하게 설명할 수 있도록 준비를 해와야하는 것이다.&nbsp;</p><p>그래서 스터디 시간에 자신이 맡은 문제를 설명하면 그 문제를 더욱 잘 이해할 수 있게 될 것이었다.</p><p>그렇게 새로운 방침을 정한 후, 스터디를 마감했다.</p><p>다들 온라인으로 스터디모임을 해야하다보니 상대적으로 집중도 잘 안되고, 숙제도 하기 싫을 수도 있을수도 있지만 열심히 참여해주고,</p><p>무엇보다 서로 어려운 문제에 대해 질문하고, 답을 해주는 과정을 통해 조금씩 성장하는 것 같아 뿌듯했다.&nbsp;</p><p><br></p>','2020-04-15 07:21:42.270207','group2',NULL,196,NULL,'0408 모임4','8:00',6,60),(267,'2020/04/15/orig/0CD8B223-7D33-4AE8-9023-63365519FC05.png','시험공부\r\n다음주가 시험이어서 각자 시험을 준비했다.\r\noss랩을 풀고 보고서를 작성하기도 하고,\r\n자바 과제를 하기도 하고, 통계학 시험공부를 하기도 했다.\r\n\r\n스터디의 좋은 점: 바로 앞에서 사람들이 공부를 하고 있으니 나도 집중해서 공부하게 된다.\r\n모르는 것이 생겼을 때 바로 물어볼 사람이 있어서 좋다 \r\n\r\n시험기간 화이팅 (๑•̀ㅂ•́)و✧','2020-04-15 09:40:22.235079','group3',1079,197,'2020-04-15 09:30:51.761827','세번째 스터디 ( ˘ω˘ )','17:30',3,62),(268,'2020/04/15/orig/KakaoTalk_Photo_2020-04-15-19-54-51.png','<p><img src=\"/upload_files/django-summernote/2020-04-15/daabe3cd-5851-452f-8b23-7294d989d20a.jpeg\" style=\"width: 720px;\"><img src=\"/upload_files/django-summernote/2020-04-15/5f05770f-af59-48ff-ac0b-99a32a4e6a6a.png\" style=\"width: 1356px;\"><br></p>','2020-04-15 10:56:13.931737','group60',1820,254,'2020-04-15 10:50:32.952591','로직디자인 5,6강','18:00',6,110),(269,'2020/04/15/orig/IMG_2841.jpg','<p>4/15 기준으로 장류미, 최윤서 학우는 데이타 구조 중간고사를 위하여 시험 범위에 대해 공부하였다. </p><p>주로 공부한 내용은 데이타 구조에서의 Linked List와 Tree(Lemma1, Lemma2) 그리고 infix를 postfix로 구현하는 stack의 응용에 대해 공부하였다.&nbsp;</p><p><br></p>','2020-04-15 12:06:34.460004','group1',5069,195,'2020-04-15 11:58:19.357397','데이타구조 스터디','16:00',2,450),(270,'2020/04/15/orig/A1094150-6B4A-4CC2-B246-8D7B2F413997.png','Knapsack problem의 2가지 종류인 0-1knapsack problem과 fractional knapsack problem의 개념과 차이점, 푸는 방법에 대해 공부를 해보았다.\r\nDP로 해결하는 방법, 그리디로 해결하는 방법에 대해 의견을 나눴다.\r\n시험기간 주차인 8주차 스터디는 없는 것으로 하고, 알고리즘 시험 전인 9주차에 전범위 연습문제 중에서 어려운 부분을 골라 풀어볼 예정이다.','2020-04-15 12:27:54.736686','group49',2710,243,'2020-04-15 12:22:33.081690','알고리즘','20:00',4,80),(271,'2020/04/15/orig/KakaoTalk_20200415_220747886.png','<p>월요일에 진행한 스마트 시스템 실습 AM modulation 관련 실습내용에 관한 내용 복습을 하였다.</p>','2020-04-15 13:09:56.311679','group11',5261,205,'2020-04-15 13:00:58.013001','스마트 시스템 실습 내용 복습','20:00',2,120),(273,'2020/04/15/orig/101D925B-4802-4C35-9904-86CDE41E7BD6.png','Zoom 화면 공유를 통해 7주차 강의(Inheritance) 내용을 복습하며 진행.\r\nPPT를 함께 보며 상속을 사용한 코드 예제를 분석함.\r\noverriding과 overloading의 개념을 복습하며 비교하여 차이점을 확실히 이해하는 시간을 가짐.\r\ninstanceof 오퍼레이터의 쓰임을 확인하기 위해 궁금한 부분의 코드를 변경해가며 하나하나 차이를 확인함.','2020-04-15 13:26:35.335449','group46',5260,240,'2020-04-15 13:20:38.624456','Inheritance 복습','20:55',4,70),(274,'2020/04/15/orig/D7CE319A-C79E-4077-BFD0-AFAD48E76E30.png','Data structure queue 복습 및 예습','2020-04-15 14:24:47.335860','group33',9051,227,'2020-04-06 14:22:29.970382','study08_0415','20:00',8,210),(275,'2020/04/16/orig/IMG_1457.jpg','구조체 포인터를 이용한 stack에 대한 이해룰 높이고 아스키 코드를 이용한 연산자 계산에 대해 대해 토론했다','2020-04-15 15:11:16.787160','group21',9352,215,'2020-04-15 15:02:55.177150','함수에 구조체를 같이 쓰는법 등','22:00 ~ 24:00',4,120),(276,'2020/04/16/orig/dsStudy041420.PNG','<p>Problem set 06번에 대한 서로의 개념정리와 stack에 대한 심도있는 내용을 이야기하였다.</p><p>또한 함수안의 동적할당 유무의 경우에 대해서 나누었다.</p><p>마지막으로 visual studio를 사용하기 시작하면서 기본적인 사용법에 대해서 나누었다.</p>','2020-04-15 16:31:51.015113','group56',7259,250,'2020-04-15 16:28:57.459054','DS: Study 2','20:30',4,60),(278,'2020/04/16/orig/IMG_2845.jpg','<p style=\"margin-bottom: 1rem; caret-color: rgb(33, 37, 41); color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">장류미, 최윤서 학우는 오늘 오후 12시를 시작으로 데이타 구조 시험범위에 포함된 tree와 heap에 대해 공부하였다.</p><p style=\"margin-bottom: 1rem; caret-color: rgb(33, 37, 41); color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">tree(tree의 정의, binary tree,연산들)에 대해 공부하였고 , heap의 정의, 개념 등에 대해서 배우는 시간을 가졌다.</p><p style=\"margin-bottom: 1rem; caret-color: rgb(33, 37, 41); color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">또한, 다음주 목요일에 치뤄질 시험에 대비하여 다음주 목요일까지의 대략적인 스터디 플랜을 짰다.&nbsp;</p>','2020-04-16 08:01:11.969626','group1',2481,195,'2020-04-16 07:58:09.893331','데이타구조 스터디(heap, tree)','12:00',3,300),(279,'2020/04/16/orig/05_2020-04-16_2000-2030.png','<p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">다섯번째 스터디 모임으로, Menu 형식으로 동작을 확인하는 프로그램에 대해 복습했습니다.</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">Binary tree 알고리즘과 그 응용에 대해 복습하고 중간고사에 대한 이야기를 나누었습니다.</p>','2020-04-16 11:25:22.593264','group22',9467,216,'2020-04-16 11:20:09.772747','2020.04.16 데이터 구조 스터디','20:00',5,20),(280,'2020/04/16/orig/KakaoTalk_Photo_2020-04-16-21-39-09.png','<p><img src=\"/upload_files/django-summernote/2020-04-16/763eb0fe-29a4-472a-877d-3283a7ecf1fc.jpeg\" style=\"width: 720px;\"><img src=\"/upload_files/django-summernote/2020-04-16/89474800-3242-48ff-a6e0-f1089bfbe727.jpeg\" style=\"width: 810px;\"><br></p>','2020-04-16 12:41:10.106443','group60',9403,254,'2020-04-16 12:33:54.670603','로직디자인 (7,8강)','19:00',7,155),(281,'2020/04/17/orig/03-20200405-2200-2300.jpg','<p>1. 퀴즈 준비 </p><p>&nbsp; &nbsp; 1. recursion tree 계산 방법</p><p>&nbsp; &nbsp; 2. DP algorithms 정리하기&nbsp;</p><p>&nbsp; &nbsp; 3. hw2 문제 보고 방법 이야기하기</p>','2020-04-17 05:27:25.008738','group18',NULL,212,NULL,'03. 알고리즘 스터디','22:00',3,60),(282,'2020/04/17/orig/04-20200416-1430-1530.jpeg','<p>1. chapter 16 greedy algorithm부분 모르는 거 이야기하기</p><p>2. chapter 6. knapsack algorithm 부분 모르는 거 이야기하기</p>','2020-04-17 05:30:41.627615','group18',3146,212,'2020-04-17 05:27:27.319631','04. 알고리즘 스터디','14:30',4,60),(283,'2020/04/17/orig/KakaoTalk_Photo_2020-04-17-21-51-22.png','<p>저희는 오늘 운영체제에 관련한 공부를 하였습니다.</p><p>특히 thread에 대한 공부를 하였는데, thread가 많을 수록 어떤 효율이 있을까에 대해 고민해보았습니다.</p><p>그리고 thread를 써야하는 이유에 대하여 공부해보았습니다.</p><p><br></p>','2020-04-17 12:52:12.201916','group8',7923,202,'2020-04-17 12:47:23.257265','thread공부','20:00',4,110),(284,'2020/04/17/orig/19-20200417-1600-1700.PNG','<p>6강(Process Synchronization) 복습</p><p>- The critical-section problem, Peterson\'s solution 등의 내용을 복습하였습니다.</p>','2020-04-17 13:56:14.666426','group19',NULL,213,NULL,'일곱번째 스터디 그룹 모임(4월 17일)','16:00',9,60),(285,'2020/04/17/orig/ASD1.png','<p>small signal equivalent model 과 앰플리 파이어 의 모델을 비교하면서 비슷한 점이 많다는 것을 알았다. 그리고 로드라인과 vdd, id 의 그래프에서</p><p><br></p><p>이 디자인이 추출되는 것을 공부하면서 아직 이해가 되지 않아서 구글링을 통해 도움을 얻었다. 그리고 C-MOS 는 N-MOS와 P-MOS 가 결합된 것으로</p><p><br></p><p>회로의 설계를 보면서 상당히 복잡하다는 것을 알았다</p>','2020-04-17 14:04:50.467919','group57',NULL,251,NULL,'앰플리파이어, C-MOS 공부','20:00',3,120),(286,'2020/04/18/orig/KakaoTalk_Photo_2020-04-18-11-51-48-1.png','<p><img src=\"/upload_files/django-summernote/2020-04-18/00092b32-635e-407a-b85c-fad7863df8b7.jpeg\" style=\"width: 720px;\"><img src=\"/upload_files/django-summernote/2020-04-18/7335679d-224c-4f6b-9a7e-d897d194fcad.jpeg\" style=\"width: 720px;\"><br></p>','2020-04-18 02:52:58.511238','group60',5670,254,'2020-04-18 02:49:55.653846','Java Programming (7, 8강), (4강)','10:00',8,110),(287,'2020/04/18/orig/Screen_Shot_2020-04-18_at_2.53.54_PM.png','<p>Multithreading 개념 설명&nbsp;</p><p>과제 2 에 대한 QnA.&nbsp;</p><p><br></p>','2020-04-18 05:55:51.127558','group16',1430,210,'2020-04-18 05:52:36.922090','OS 6주차','14:00 ~ 14:54',6,41),(288,'2020/04/18/orig/sss.png','<p>1. 운영체제 6장 리뷰</p><p>2. 알고리듬 huffman 리뷰</p><p><br></p>','2020-04-18 12:06:39.468553','group32',NULL,226,NULL,'4번째 스터디','11:00',4,120),(289,'2020/04/18/orig/KakaoTalk_20200418_201209023.png','<p>Putty 설치하는 방법</p><p>Peace server 들어가는 방법</p><p>1.&nbsp;<span style=\"background-color: transparent; color: inherit; font-size: inherit; font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\">git remote update 하는 방법</span><br></p><p><span style=\"background-color: transparent; color: inherit; font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: inherit; white-space: pre-wrap;\">2. </span><span style=\"font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\">git clone하는 방법</span></p><p><span style=\"background-color: transparent; color: inherit; font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: inherit; white-space: pre-wrap;\">3. branch 가져오는 방법</span></p><p><font face=\"Menlo, Monaco, Consolas, Courier New, monospace\"><span style=\"white-space: pre-wrap;\">*오류 해결</span></font></p><p><font face=\"Menlo, Monaco, Consolas, Courier New, monospace\"><span style=\"white-space: pre-wrap;\">git checkout -t 할 때 origin을 해야 합니다. </span></font></p><div><font face=\"Menlo, Monaco, Consolas, Courier New, monospace\"><span style=\"white-space: pre-wrap;\"><br></span></font></div>','2020-04-18 12:20:37.478934','group45',NULL,239,NULL,'Git 공부','20:00',5,80),(290,'2020/04/18/orig/sa.png','<p>1. 알고리듬 knapsack에 대한 리뷰</p>','2020-04-18 12:23:00.731809','group32',NULL,226,NULL,'5번째 스터디','20:30',5,100),(291,'2020/04/18/orig/KakaoTalk_20200411_200934439.png','<p>1. LKM module 구현</p><p>2. cred 구현</p><p>3. linux and kernel</p><p>4. 그 외 전공관련 하고 싶은 말..</p><p><br></p>','2020-04-18 12:23:21.091489','group45',3968,239,'2020-04-18 12:22:49.951510','LKM 과 수업 정리(200411)','20:00',6,70),(292,'2020/04/18/orig/KakaoTalk_20200418_214040877.png','<p>Problem 4-3(박병윤)</p><p><br></p><p>Exercise 4.5-2(정유신) , 15.2-1(장민영), 15.4-1(이지훈)</p><p><br></p><p><br></p><p><br></p><p>다음 문제들을 한 주 동안 풀어와서 배당된 문제 풀이 진행하였습니다</p>','2020-04-18 12:42:42.942381','group51',5084,245,'2020-04-18 12:36:18.005414','알고리즘 문제풀이(4, 15단원)','20:00',2,90),(293,'2020/04/19/orig/0419_OSstudy.png','<p><img src=\"/upload_files/django-summernote/2020-04-19/7355b474-9b01-47d8-b8d8-2610d4f2f9e7.png\" style=\"width: 621px;\"></p><p><br></p><p>1. 먼저 근황을 간단하게 나눈후, 이번 주 금요일에 release된 과제 2번에 대한 overview를 진행했습니다.&nbsp;</p><p>아무래도 영어로 설명하시다 보니, 우리말로 정확하게 짚고 넘어가야 할 부분이 있겠다 싶어, 필기한 내용을 바탕으로 이 instruction이 요구하는 바가 뭔지, 어떤 것을 구현하기 위해선 어떻게 접근 해야 할지를 차근 차근 살펴보고, 또 서로가 가진 궁금증을 나누었습니다.&nbsp;</p><p><br></p><p>2. 4월 14일에 release된 온라인 강의 중 posix thread library 에 대해 교수님이 예제를 직접 돌려보는 영상들이 있었는데, 이와 관련 된 pthread 코드들을 직접 실행해보고, 교수님 결과와 비교해보며 thread간에 concurrently 하게 task를 진행 할 수 있다는 것, mutex lock과 conditional variable을 통해 이 concurrency에 어떻게 영향을 줄 수 있는 지를 알아보는 시간을 가졌습니다. 이 부분이 이번 스터디에서 크게 도움이 되었던 것 같습니다.&nbsp;</p><p><br></p><p>3. 다음 주 스터디에 관해 논의를 해보았습니다.&nbsp;</p><p>원래 주 스터디로 진행하기로 한 운영체제 과목의 중간 고사가 14주차로 미뤄지며 당장 시험대비를 하지 않아도 되어 다음 주는 9주차에 진행될 Database system 과목 중간고사를 대비하는 시간을 가지기로 합의하였습니다.</p>','2020-04-19 07:57:59.047738','group34',6859,228,'2020-04-19 07:48:51.112635','#4.5. OS HW2 overview and reviewed Multithreading concepts by using source examples','15:00',5,90),(294,'2020/04/19/orig/IMG_2860.jpg','<p>오늘 모든 멤버들이 모여 서로가 만든 문제들을 나누고 풀어보았다. 범위는 heap을 제외한 나머지 단원들에 대한 문제들을 만들어서 풀어보았고, 서로 모르는 부분들에 대해 질문하고 답하였다.</p><p>내일 만나기 전 heap에 대한 개념을 숙지하고 모르는 부분들을 나누기로 하였다.</p>','2020-04-19 09:27:10.041869','group1',5943,195,'2020-04-19 09:23:39.051076','데이타구조 스터디','15:00',4,240),(295,'2020/04/19/orig/KakaoTalk_Photo_2020-04-19-21-48-25-1.png','<p><img src=\"/upload_files/django-summernote/2020-04-19/a01441fd-831f-4ded-b2a7-325997ae34c8.jpeg\" style=\"width: 720px;\"><img src=\"/upload_files/django-summernote/2020-04-19/d9cc439e-a1b3-4fab-9b54-b077a4bfbcab.jpeg\" style=\"width: 720px;\"><br></p>','2020-04-19 12:50:15.054863','group60',2103,254,'2020-04-19 12:46:13.647404','로직디자인 9,10강','7:00',9,170),(296,'2020/04/20/orig/02-20200419-2100-2230.PNG','<p>OSSL 중간고사 범위 공부 (C 프로그래밍 복습, Linux Command 정리, Git 사용법)</p><p>데이타구조 Linked List 수업 예습 및 복습, 개념 정리</p>','2020-04-19 16:38:48.223505','group27',1290,221,'2020-04-19 16:36:09.657341','20200419-2100-2230','19:00',2,90),(297,'2020/04/20/orig/05-20200419-2000-2115.png','<p>운영체제</p><p class=\"p2\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 17px; line-height: normal; font-family: &quot;Helvetica Neue&quot;;\"><b>Synchronization problem</b></p><p class=\"p3\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;;\">= register = counter 에서 공유된 데이타를 접근하기 때문에 한쪽 프로세서에서 접근하고 있을 때는 막아주어야 한다.</p><p class=\"p3\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;;\">막아주지 않았을 경우에는 프로그램 내에서 에러가 발생하는 것이 아니라 데이타 접근 방법에서 에러가 발생 했기에 어느 부분에서 잘못된 것인지 알기가 어려움으로 이것을 방지해야 한다. 여기서 생기는 에러가 race condition이다.</p><p class=\"p1\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 17px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; min-height: 21px;\"><b></b><br></p><p class=\"p2\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 17px; line-height: normal; font-family: &quot;Helvetica Neue&quot;;\"><b>Peterson solution</b></p><p class=\"p3\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;;\">= 위에 나온 race condition 의 해결방법으로 코드들이 주어졌는데 교수님이 주신 코드 분석을 하고 이부분에서 인풋을 넣으면 어떤 아웃풋이 나올지 생각해보았다.</p><p class=\"p4\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; min-height: 14px;\"><br></p><p class=\"p4\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; min-height: 14px;\"><br></p><p class=\"p3\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;;\"><b><span style=\"font-size: 18px;\">Thread pool</span><span class=\"Apple-converted-space\" style=\"font-size: 18px;\">&nbsp;</span></b></p><p class=\"p3\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;;\">= 개념과 코드 분석을 해보는 시간을 가졌다. 남아있는 thread 들의 처리는 어떻게 되는지 질문하고 코드를 충분히 이해하려고 했다.<span class=\"Apple-converted-space\">&nbsp;</span></p><p class=\"p4\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; min-height: 14px;\"><br></p><p class=\"p4\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; min-height: 14px;\"><br></p><p class=\"p3\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;;\"><b><span class=\"Apple-converted-space\" style=\"font-size: 18px;\">&nbsp;</span><span style=\"font-size: 18px;\">CPU 스케듈링 정리</span></b></p><p class=\"p3\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;;\">=&gt;<span class=\"Apple-converted-space\">&nbsp;Shortest Job First scheduling에서 average waiting time에 관해 복습을 했다.</span></p><p class=\"p4\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; min-height: 14px;\">계산방법에서 어느 것을 가장 먼저 해야하는지 등등</p><p class=\"p4\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; min-height: 14px;\">-&gt; Round Robin 스케듈링에서도 평균 기다리는 시간을 최적화하는 것을 어떻게 코드로 만들수 있는지 생각해보기도 했다.</p><p class=\"p4\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; min-height: 14px;\"><br></p><p class=\"p3\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;;\"><span class=\"Apple-converted-space\">&nbsp;</span></p><p class=\"p4\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; min-height: 14px;\"><br></p>','2020-04-20 06:52:22.460313','group38',NULL,232,NULL,'다서번째 스터디','20:00',5,75),(298,'2020/04/20/orig/KakaoTalk_Photo_2020-04-20-16-04-39.jpeg','<p>오늘은 알고리듬 knapsack에 대해서 공부했다.&nbsp;</p><p>최근에 DP, greedy, knapsack 이렇게 최적화를 하는 알고리듬을 여러개 배우니까 머리가 과부화된 것 같다.</p><p>아마 곧 과제가 이거에 관한 코딩 과제가 나올텐데, 과제를 하면서 내용을 체득해야겠다.</p>','2020-04-20 07:07:37.496994','group10',3681,204,'2020-04-20 07:02:48.169143','알고리듬 공부','14:00',3,120),(299,'2020/04/20/orig/KakaoTalk_Photo_2020-04-20-16-27-23.jpeg','<p>CH2: sofware process 에 특히 어떠한 특징들이 있는지, 어떻게 진행이 되는지에 대해서 함께 교과서를 읽고 논의하는 시간을 가졌다.</p><p>우리가 평소에 진행했던 소프트웨어 프로젝트에 대한 경험들을 나누면서 각각 어떤 소프트웨어 프로세스가 흘러갔는지, 나누고 어떤 소프트웨어 특징을 지니고 있었는지 나누도록 했다.&nbsp;</p>','2020-04-20 07:29:59.187388','group12',6129,206,'2020-04-20 07:24:33.815765','CH2-3','14:15-16:30',3,135),(300,'2020/04/20/orig/KakaoTalk_Photo_20200420_1753_23674.jpg','<p>알고리즘의 \"knapsack problem\" 에서 binary, graph로 풀 수 있었는데, 두 가지 방법에 대해서 서로 설명해주면서 해당 알고리즘을 잘 이해하도록 노력했다.&nbsp;</p><p>교과서와 네이버 블로그 등을 참조하여 코드와 함께 공부하고 peer teaching 덕분에 확실하게 이해가 되었다.&nbsp;</p><p><br></p><p>Database System에서는 DB의 꽃인 join operation에 대해서 배웠다.&nbsp;</p><p>inner join, outer join 등 Join을 이용한 다양한 table 변형을 실습해보면서 둘둘씩 짝지어서 peer teaching을 진행하였다.&nbsp;</p><p>후에 나올 과제를 대비해서 최대한 application을 할려고 노력하였다</p>','2020-04-20 08:59:49.008103','group62',9238,256,'2020-04-20 08:59:48.874723','알고리즘  \"knapsack problem\", DB \"join\"','11:30',6,60),(301,'2020/04/20/orig/KakaoTalk_20200420_200833363.png','<p>Digital modulation에 관한 실습 내용을 복습하고 같이 학습했습니다.&nbsp;</p>','2020-04-20 11:09:04.559814','group11',8103,205,'2020-04-20 11:04:31.516831','스마트 시스템 실습 개념 복습','19:00',3,60),(302,'2020/04/21/orig/94D83AFC-D423-4242-A3F7-76E731927883.png','지난주 복습했던 stack과 더불어 queue 부분을 수업 시간에 진도 나간 부분에 한해 공부했습니다. 또한 function pointer의 원리에 대해 직접 찾아가며 논의했습니다.','2020-04-21 11:29:23.487309','group53',NULL,247,NULL,'데이터구조 queue','19:00',3,75),(303,'2020/04/21/orig/1234.png','<p>운영체제 퀴즈와 vecadd를 multi thread 로 개선하는 과정에 대해 공부하며 코딩 중간고사도 비슷한 문제가 나올 것으로 예상.</p><p>은행, 카카오 등 전산을 통해 들어갈 수 있는 회사와 지망하는 직무에 대한 이야기를 함.</p><p>LCS의 개념에 대해 다시 알아봄.</p><p><br></p>','2020-04-21 12:20:29.416283','group8',1532,202,'2020-04-21 12:15:38.057760','중간고사, 진로, LCS','20:00',5,80),(304,'2020/04/21/orig/1587472387633.png','회로이론 시험 공부\r\n어려웠던 문제, 개념 같이 풀면서 시험 대비\r\n수시로 카톡 통해서 q&a','2020-04-21 12:35:46.664710','group29',3219,223,'2020-04-21 12:32:04.103937','4/21','20:00',7,93),(305,'2020/04/21/orig/1587474298049.png','singly-linked-list(reverse) 강의 복습\r\nQ&A','2020-04-21 13:14:56.507604','group28',5714,222,'2020-04-21 13:05:07.486738','데이터구조 mid-term study','21:00',4,60),(306,'2020/04/21/orig/75A51DA6-1427-44CC-ABA4-BD336DE91D74.png','회로도를 보고 NAND  게이트를 가지고 어떻게 회로를 설계해야하는지에 대해 토의함','2020-04-21 13:16:10.703048','group25',7420,219,'2020-04-21 13:10:26.099390','논리설계','21:30',8,40),(307,'2020/04/21/orig/KakaoTalk_20200421_204421571.png','<p>1. Thevenin\' theorem을 사용하여 V0값 구하는 회로분석</p><p>2. dependent source가 부착된 회로를 보고 Voc 와 Isc를 구하여 Rth값 구하는 회로분석</p><p>3. RL을 찾아서 최대 Power값 구하는 회로 분석</p>','2020-04-21 14:09:46.872560','group40',NULL,234,NULL,'중간고사2 전 CH5 개념정리 및 회로 분석','20:00',4,60),(308,'2020/04/22/orig/group36_6.jpg','<p>오늘은 데이터 구조에서 배운 여러 알고리즘을 복습을 하고 연습 문제를 풀어보는 시간을 가졌습니다.</p><p>추가로 논리설계에서 사용하는 TinkerCAD 의 이해도를 돕기 위해 PPT 내용을 복습하며 다양한 회로를 직접 설계하며 모르는 부분을 서로 물어보고 인터넷에서 찾아보며 공부 했습니다.</p>','2020-04-21 15:08:35.567535','group36',5132,230,'2020-04-21 15:03:21.037915','6번째 스터디','22:00 ~ 24:00',6,120),(309,'2020/04/22/orig/KakaoTalk_Photo_2020-04-22-11-40-56-1.png','<p><img src=\"/upload_files/django-summernote/2020-04-22/45c1810e-e974-4949-a1cc-474ddc99b161.jpeg\" style=\"width: 720px;\"><img src=\"/upload_files/django-summernote/2020-04-22/872da716-07ea-41e5-8694-67ad290e69d2.jpeg\" style=\"width: 720px;\"><img src=\"/upload_files/django-summernote/2020-04-22/34c0eb7b-9b78-4160-8933-fd54369b17b3.jpeg\" style=\"width: 720px;\"><img src=\"/upload_files/django-summernote/2020-04-22/10eec120-0b3e-42b2-9ebe-466f49c9d1f3.jpeg\" style=\"width: 720px;\"><img src=\"/upload_files/django-summernote/2020-04-22/e3074da9-03d3-47ac-be52-f27d3a7f4425.jpeg\" style=\"width: 540px;\"><img src=\"/upload_files/django-summernote/2020-04-22/c2296720-4195-4a2c-8520-5b7554dd4605.jpeg\" style=\"width: 540px;\"><br></p>','2020-04-22 02:46:46.674869','group60',1987,254,'2020-04-22 02:38:45.367252','Java Programming (9, 10강), (5강)','10:00',10,101),(310,'2020/04/22/orig/04FF809C-38C7-4E20-AE35-8DDA53153847.png','시험기간이다 !\r\n각자 필요한 시험 공부를 했다.\r\n다들 만점 받아요 화이팅 ٩(ˊᗜˋ*)و','2020-04-22 09:37:47.252478','group3',6193,197,'2020-04-22 09:33:30.192587','네번째 스터디 ( •̀ᄇ• ́)ﻭ✧','17:30',4,63),(312,'2020/04/22/orig/ssss.png','<p>운영체제 중간고사를 위한 셋업을 함꼐 진행함.</p>','2020-04-22 12:17:21.172199','group32',3620,226,'2020-04-22 12:09:34.157896','6번째 스터디','21:00',6,60),(313,'2020/04/22/orig/09-20200422-2000-2230.png','<p>java programming 문제풀기</p><p><br></p><p>수업에서 배운 내용을 바탕으로 그와 관련된 예제들을 풀어보았습니다.</p><p><br></p><p>중간에 막히는 부분이 있으면 다시 찾아보고 질문하는 식으로 진행하였습니다.</p>','2020-04-22 13:39:04.883094','group33',4892,227,'2020-04-22 13:31:39.964443','study09_0422','20:00',9,150),(314,'2020/04/23/orig/05-20200423-2100-2400.png','<p>1. multi- Thread 개념 정리</p><p>2. Pthread 코드로 MultiThread 구현 방법</p><p>3. TLS(thread-local storage) 개념 및 구현 방법&nbsp;</p><p>4. Deallocation - C언어</p>','2020-04-22 15:14:47.595285','group4',NULL,198,NULL,'OS_multithread 스터디','21:00',5,180),(315,'2020/04/23/orig/1587571629267.png','singly linked list의 개념을 먼저 배우고 어떤 함수로 구성되어있는지 분석하고 탐구하며 singly linked list가 어떤 데이타구조인지 공부하였다','2020-04-22 16:11:10.789023','group21',5819,215,'2020-04-22 16:06:32.011985','singly linked list','22:30',5,155),(316,'2020/04/23/orig/KakaoTalk_20200423_003806093.png','<p>8시 정각에 스터디를 시작했다.</p><p>3장의 exercises와 4장 exercises와 chapter test의 각자 지정받은 문제들을 돌아가면서 서로에게 설명해주었다.</p><p>특히 애매한 문제들은 셋이 각각 풀어보고 답을 맞추어보았다.</p><p>덕분에 조금 애매한 것들을 해결할 수 있었다.</p><p>다음 주는 8주차인만큼 셋이 다 같이 수강하고 있는 논리 설계와 데이터 구조에 관련된 질문들을 서로 물어보기로 했다.</p>','2020-04-23 04:26:28.958528','group2',6943,196,'2020-04-23 04:23:44.069868','0415 모임5','20:00',7,40),(317,'2020/04/23/orig/KakaoTalk_20200423_173539366.png','<p>다음주에 있을 DB 시험을 대비하여 쿼리에 대한 질문이나 기본 개념에 대한 설명들을 주고 받음</p>','2020-04-23 08:38:38.479646','group62',9731,256,'2020-04-23 08:37:09.921190','DB 시험을 대비한 질의응답','16:00',7,57),(318,'2020/04/23/orig/study3.PNG','<p>RC circuit에 필요한 수학 지식 및 RC 회로의 동작원리, rising time등에 대해 스터디함</p>','2020-04-23 11:34:49.151940','group9',9867,203,'2020-04-23 11:32:14.153520','RC circuit','2020-4-14 19:30',3,120),(319,'2020/04/23/orig/study4.PNG','<p>논리 게이트를 사용하는 방법 및 VOL,VOH,VIH,VIL 의 개념이 TTL CMOS에서 어떤 차이를 보이는지 그리고 Noise margin이 무엇인지 스터디 하였음</p>','2020-04-23 11:36:56.793283','group9',9214,203,'2020-04-23 11:34:52.098387','논리 게이트를 이용한 LED 불 켜기','2020-4-23 19:00',4,80),(320,'2020/04/23/orig/day_study.png','<p><img src=\"/upload_files/django-summernote/2020-04-23/7482a3f6-4c6e-4a75-abab-9625200532c0.jpeg\" style=\"width: 720px;\"><img src=\"/upload_files/django-summernote/2020-04-23/1e4d0f46-3fe0-4b19-809a-31c2b273f933.jpeg\" style=\"width: 720px;\"><br></p>','2020-04-23 12:21:36.574768','group60',3056,254,'2020-04-23 12:16:42.878055','Java Programming (11, 12강), (6강)','7:00',11,112),(321,'2020/04/24/orig/1587735853111.png','논리설계 8강 conversion of forms 와 9강 analysis of combinational system 의 예제들을 풀어보았습니당! 각자 문제들을 풀어보고, 모르는 개념과 문제들을 서로 토론하면서 나눴습니다!','2020-04-24 13:47:15.544798','group64',8953,258,'2020-04-24 13:42:22.053521','논리설계 8,9강!!','21:00',3,105),(322,'2020/04/24/orig/Screenshots0424.png','<p>오늘 배운 encoder와 decoder의 concept에 대해 스터디 시간을 가졌습니다.</p><p>또한, 교수님께서 제공해주신 exercises문제들을 같이 풀어보았습니다.</p><p>모두 exercises문제들을 풀 수 있었습니다.&nbsp;</p><p>또한, encoder와 decoder가 Mux와 DeMux에 어떠한 연관성이 있는지에 대해 간략히 소개하는 시간을 가졌습니다.</p>','2020-04-24 14:40:07.198572','group48',8937,265,'2020-04-24 14:30:26.825567','Encoder & Decoder 스터디','22:30',4,60),(323,'2020/04/25/orig/study_2020-04-25.png','<p><img src=\"/upload_files/django-summernote/2020-04-25/8a93daea-7de8-4b54-8fb1-105efa062522.jpeg\" style=\"width: 1080px;\"><img src=\"/upload_files/django-summernote/2020-04-25/9fb20aa4-9c79-411a-82e3-5395155df93c.jpeg\" style=\"width: 1080px;\"><img src=\"/upload_files/django-summernote/2020-04-25/1d5b5872-8611-419c-a1e9-c6720ed04be4.png\" style=\"width: 1308px;\"><br></p>','2020-04-25 03:19:18.056346','group60',9867,254,'2020-04-25 03:15:07.227712','Java Programming (13, 14강), (7강)','10:00',12,137),(324,'2020/04/25/orig/KakaoTalk_20200425_200316841.png','<p>1. 어느 시점에서 어느 부분을 활용할 수 있을것인가?</p><p>2. 코드를 완벽하게 이해하지는 않아도 자신이 활용하려는 범위 내에서 이해해야 한다.&nbsp;</p>','2020-04-25 11:21:16.619958','group45',NULL,239,NULL,'signal과 pipe','20:00',7,30),(325,'2020/04/25/orig/logic_design_study_1.png','<ol class=\"ol1\" style=\"font-size: medium;\"><li class=\"li1\" style=\"margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;;\"><span class=\"s1\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;.Apple SD Gothic NeoI&quot;;\">자기소개</span></li><li class=\"li1\" style=\"margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Helvetica Neue&quot;;\">Ch2_2 Logic circuit <span class=\"s1\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;.Apple SD Gothic NeoI&quot;;\">에서</span> AND-OR <span class=\"s1\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;.Apple SD Gothic NeoI&quot;;\">을</span> <span class=\"s1\" style=\"font-variant-numeric: normal; font-variant-