236,NULL,'서로 몰랐던 개념 보충해주기','19:05',1,60),(326,'2020/04/26/orig/20200426.png','<p><img src=\"/upload_files/django-summernote/2020-04-26/c32184ac-ca29-452d-a49f-e7c689ac883a.jpeg\" style=\"width: 720px;\"><br></p>','2020-04-26 10:46:03.229944','group60',5638,254,'2020-04-26 10:43:23.388831','자바 프로그래밍 (15강)','19:09',13,35),(327,'2020/04/26/orig/study.png','<p>오늘은 모여서 짧게 OS 홈웍2에 대해서 살펴보았다,</p><p>홈웍 디스크립션을 보고 잘 이해안되는 부분을 서로 이야기하며 이해를 높였다.</p><p>다들 잘 마무리할 수 있었으면 좋겠다.</p>','2020-04-26 13:04:00.113959','group23',9845,217,'2020-04-26 12:58:35.424945','4월26일 스터디','21:30-22:00',4,30),(328,'2020/04/26/orig/03-20200426-2100-2220.PNG','<p>자바 시험 범위 중에 헷갈리는 내용들 다시 동영상 강의 들으면서 개념 정리하기</p><p>자바 단원별 키워드랑 문법 정리하기</p><p>OSSL 시험 범위 프린트물 공부하기</p>','2020-04-26 13:30:39.635536','group27',7385,221,'2020-04-26 13:28:43.661192','20200426-21:00-22:10','21:00',3,70),(329,'2020/04/26/orig/F13EF111-556B-4540-909D-287554B51197.jpeg','데이타구조 linkedlist 코드 작성','2020-04-26 14:53:38.637124','group33',3850,227,'2020-04-26 14:49:17.309464','study10_0426','20:30',10,210),(330,'2020/04/26/orig/4.png','<p>통신이론 예제 풀기</p><p>모르는 내용 공유 &amp; 답변</p>','2020-04-26 14:58:24.762266','group39',1709,233,'2020-04-26 14:55:14.946562','통신이론','22:00',4,120),(331,'2020/04/27/orig/0426.png','<p>데이터 구조시간에 배운 Linkedlist ver3 와 ver4에 대해서 복습을 했고,</p><p>질문사항을 서로 공유하며 의문점을 해소해나가는 시간을 가졌습니다!</p>','2020-04-27 02:38:19.012989','group14',NULL,208,NULL,'4월 26일 Group 14 스터디입니다','23:00',4,60),(332,'2020/04/27/orig/KakaoTalk_20200427_225405186.png','<p>전자회로 퀴즈 범위 공부했습니다.</p>','2020-04-27 13:59:32.153144','group11',1208,205,'2020-04-27 13:51:28.228305','전자회로1','21:00',4,120),(333,'2020/04/28/orig/040411.png','<p>이번 과제였던 infix, prefix, postfix에 대한 디버깅에 대해서 알아보았다.</p><p>visual studio를 사용해서 디버깅을 하는 방법에 대해서 논의해 보았다.</p>','2020-04-28 01:04:14.318425','group56',6481,250,'2020-04-28 01:00:26.463161','데이터스트럭처 과제','11:00',5,60),(334,'2020/04/28/orig/042620.png','<p>이번 과제인 pset7에 나오는 몇몇 함수들과 내용에 대해서 논의해 보았다.</p><p>보고서를 작성하는 방법과 #include &lt;stack.h&gt;를 사용했을 때와 직접 구현한 stack 함수의 차이에 대해서 이야기 하였다.</p>','2020-04-28 01:08:35.016041','group56',1426,250,'2020-04-28 01:05:59.941938','데이타구조 pset7논의','1300',6,30),(335,'2020/04/28/orig/20200427.png','<p><img src=\"/upload_files/django-summernote/2020-04-28/99c3676b-de9b-41b9-9a24-69a762a20114.png\" style=\"width: 1341px;\"></p><p><br></p><p>1. 먼저 스터디 전에 OS 홍신 교수님께서 과제 연장자들에게 제공한 HW2 접근법에 대한 간단한 overview 이후, 다음 날 있을 데이터베이스 교과목 복습을 위주로 스터디를 진행함.</p><p><br></p><p>2. 스터디 전에 각자 DB 시험 범위에서 파트를 나누어 각 파트별 문제를 만들어오기로 약속하였고, 이번 스터디는 zoom을 켜놓고 진행하는 DB 시험을 상정, 제한 시간 내 줌을 키고 각자가 준비한 문제를 푼 뒤 풀이를 비교하고 같이 논의 하도록 함.</p><p><br></p><p>3. 각자 보완해야 할 점이 무엇인지 이 시간을 통해 좀 더 확실히 알고, 또 준비한 문제를 통해 시험이 어떻게 나올 수 있을지 예상해 볼 수 있었다. 90분 동안 전 범위를 폭넓게 다루면서 시험준비에 만전을 기하였다.&nbsp;</p>','2020-04-28 02:45:07.579202','group34',3056,228,'2020-04-28 02:38:12.108697','#5 OS HW2 Review of instructor\'s guideline, and preparation of DB midterm on Tuesday, 28, 04.','23:30',6,90),(336,'2020/04/28/orig/KakaoTalk_20200426_211646280.png','<p>데이터구조는 잠깐 훑는 식으로 넘어가고, 논리설계는 모두 다 같은 분반을 들어서, 논리설계 중심으로 이번 스터디를 진행했습니다.</p><p>서로 잘 이해가 되지 않았던 multiplexer 부분 쪽에서 문제를 3문제씩 만들어와서 서로에게 풀이와 개념을 알려주는 방식으로 했더니 많은 도움이 되었던 것 같습니다.</p><p>우리 스터디 화이팅&nbsp; &nbsp;^ㅇ^</p>','2020-04-28 06:28:17.507943','group44',NULL,238,NULL,'행복한 스터디 ㅎㅎ','20:00',2,61),(337,'2020/04/28/orig/7C3BDAEB-5444-4EC7-AA29-5D6C572855DB.jpeg','1. 10강 Design process of combinational systems 개념 복습\r\n2.11강 adder subtractor 개념 복습\r\n3. 12강 2-bit adder ,comparator 개념복습\r\n4. 13강  encoder decoder 개념 복습\r\n5. Mux demux ,3 state gates. 개념 복습','2020-04-28 07:51:22.589309','group13',3540,207,'2020-04-28 07:49:01.534460','[Logiv Design] 그룹스터디 5','14:33',5,115),(339,'2020/04/28/orig/9124C7ED-825A-458F-8236-B3FE0DA19F0B.png','시험이 남아있어 각공했다 (๑•̀ㅂ•́)و✧\r\n마지막 중간고사까지 화이팅 !-!','2020-04-28 11:28:49.350354','group3',8135,197,'2020-04-28 11:25:54.461277','다섯번째 스터디!','19:00',5,85),(340,'2020/04/28/orig/KakaoTalk_20200428_213911083.png','<p>1. 중간고사 문제 중 어려웠던 문제 풀이 (Norton Theorem을 이용한 V0 값 구하기)</p><p>2. capacitor에 저장된 energy 값 구하기 위한 회로분석</p><p>3. inductor에 저장된 energy값 구하기 위한 회로분석</p>','2020-04-28 13:29:11.120803','group40',9764,234,'2020-04-28 13:23:26.112660','2번째 중간고사 풀이 및 6단원 개념 질문','21:00',5,60),(341,'2020/04/29/orig/19-20200428-1600-1700.PNG','<p>6강(Process Synchronization) 복습</p><p>- Mutual Exclusion, Bounded Waiting 등의 내용을 복습하였습니다.</p>','2020-04-28 15:12:11.999026','group19',6584,213,'2020-04-28 15:09:18.503471','여덟번째 스터디 그룹 모임(4월 28일)','16:00',10,60),(342,'2020/04/29/orig/0429_study.png','<p><img src=\"/upload_files/django-summernote/2020-04-29/440f3971-e61b-4836-9374-2688d13210e0.jpeg\" style=\"width: 720px;\"><img src=\"/upload_files/django-summernote/2020-04-29/ca271031-5e16-4836-b05e-a4fa97c11bc5.jpeg\" style=\"width: 720px;\"><img src=\"/upload_files/django-summernote/2020-04-29/caad8367-8e75-4294-bf5c-e8b1f86f10a4.jpeg\" style=\"width: 720px;\"><img src=\"/upload_files/django-summernote/2020-04-29/58fddb50-be90-4f18-b47f-7e98e73279e2.jpeg\" style=\"width: 720px;\"><img src=\"/upload_files/django-summernote/2020-04-29/17b2aeaf-b78f-4961-8a8a-37209059adac.jpeg\" style=\"width: 720px;\"><br></p>','2020-04-29 03:17:24.105189','group60',7859,254,'2020-04-29 03:12:31.013996','로직디자인 11,12강','10:30',14,104),(343,'2020/04/29/orig/ECF7F656-0FC2-48A6-83F4-DCFBE4897E3D.png','임베디등 UART 통신에 대해 복습하고 블루투스 사용법에 대해 공부했다','2020-04-29 06:40:35.066850','group6',2967,200,'2020-04-29 06:36:11.926656','임베디드','14:30',3,120),(344,'2020/04/29/orig/25F17646-907B-4BEE-BF73-2A3997B8F167.png','알고리즘 교과서 문제풀이!\r\n각자 어려웠던 문제를 가져와서 문제 풀이를 진행하였습니다.\r\n그리디 알고리즘에 대한 문제!\r\nDp를 이용한 최적의 솔루션 선택하기\r\nMax extract heap 문제 풀이를 진행하였다.','2020-04-29 12:22:51.072064','group49',7415,243,'2020-04-29 12:19:10.530540','알고리즘','20:00',5,100),(345,'2020/04/30/orig/2020-04-29_1.png','<p>&lt;스터디 진행&gt;</p><ol><li>수업자료 PPT를 보며, 1) 각 개념이 의미하는 바와 2) 코드에서 어떻게 적용되는지 서로 설명해줌.</li><li>셋 다 모르는 부분은 같이 고민하고 구글링하며 찾아나감.(아직 해결하지 못한 부분은 각자 공부하면서 보충하거나 교수님과 티에이에게 여쭤보고 해결할 것)</li></ol><p>&lt;주된 내용&gt;</p><ul><li>예외처리하는 방법 중 하나는 try catch를 사용하는 것이다. try에 해당하는 block에는 일어날 가능성이 있는 에러 상황을 포함하며, catch에 해당하는 block에는 예외가 발생했을 때(혹은 try에서 에러 조건을 충족했을 때) 실행될 명령들을 포함한다.</li><li>Exception이라는 하나의 object가 있다.&nbsp; object를 생성할 때 throw new Exception(String argument); 이렇게 입력한다. 또한 Exception object 내에는 getMessage()라는 메소드가 내장되어 있어 string을 다시 반환해올 때 간편하게 사용 가능하다.</li><li>이전에 미리 정의되어 있는 Exception class 도 있지만, 개발자가 직접 정의할 수도 있다. 그러나 직접 정의할 때는 몇 가지 규칙을 지켜야 한다. Exception을 상속해야 한다거나 최소 두 constructor를 정의해야 한다 등의 규칙이 있다.</li><li>throw와 throws가 있다.</li><li>예외가 발생하든 하지 않든 무언가를 실행하게 하는 finally{ } 도 있다.</li></ul>','2020-04-29 16:15:51.487234','group46',9603,240,'2020-04-29 16:15:51.388529','Java에서 예외를 다루는 방법에 대한 전반적인 내용 복습','21:00',5,80),(346,'2020/04/30/orig/Group3604_30.jpg','<p>오늘은 자바 프로그래밍에 대해 공부하는 시간을 가졌다.</p><p>현재 진도를 나간 객체지향 프로그래밍에 대해 다시 복습하고, 어떻게 프로그램을 짤 수있는지에 대해서도 공부했다.</p><p>또한, 그 외에 코딩할 때 주의해야할 디테일에 대해서도 논의하는 시간을 가졌다.&nbsp;</p>','2020-04-30 07:07:31.828053','group36',5126,230,'2020-04-30 07:03:24.650163','7번째 스터디','14:00 ~ 16:00',7,120),(347,'2020/04/30/orig/1.png','<p>4단원 , 5단원 ,6단원 복습</p>','2020-04-30 09:50:07.364128','group63',NULL,257,NULL,'운영체제 퀴즈 준비','18:30',3,180),(348,'2020/04/30/orig/2020-04-30_8.34.45.png','<p><img src=\"/upload_files/django-summernote/2020-04-30/d18863c2-731e-4307-a1d9-4ebf88fbe419.jpeg\" style=\"width: 720px;\"><img src=\"/upload_files/django-summernote/2020-04-30/508f4aa3-0d73-4ed8-b6fb-a57939e43f33.jpeg\" style=\"width: 720px;\"><img src=\"/upload_files/django-summernote/2020-04-30/c24116b7-a9a1-4438-bd0c-76c7b725f730.jpeg\" style=\"width: 720px;\"><br></p>','2020-04-30 11:37:18.559200','group60',2983,254,'2020-04-30 11:32:12.357418','로직디자인 (13,14강)','19:00',15,90),(349,'2020/04/30/orig/1588249632725.png','기초전자공학실험과 Logic Design 막히는 부분 q&a와 시험 대비 공부\r\n주중에 카톡으로 q&a','2020-04-30 12:32:34.806927','group29',NULL,223,NULL,'4/30','20:00',8,70),(350,'2020/05/01/orig/1588265941767.png','singly linked list의 각 function을 구현하는 방법에 대해 복습하고, Logic Design 과목의 K-Map에 대해 함께 공부함.','2020-04-30 16:59:56.222239','group21',8241,215,'2020-04-30 16:57:45.182380','singly linked list and logic design','22:00',6,240),(351,'2020/05/01/orig/F9B51066-09E8-4AC2-8305-271EDCDC1E94.png','다음주에 있는 알고리듬 중간고사를 대비해 처음부터 한번씩 훑으면서 헷갈리는 부분은 서로 질문하고 대답해주면서 공부하였다','2020-05-01 06:19:12.373757','group10',7491,204,'2020-05-01 06:11:28.551737','알고리듬 중간고사 공부','13:00-15:00',4,120),(352,'2020/05/01/orig/KakaoTalk_20200501_163751883.png','<p>퀴즈에서 op amp의 문제를 풀었었는데 생각보다 혼란스러워서 이번 스터디 때 다시한번 그 문제에 대해서 고민해보는 시간을 가졌다.</p><p>앰프 내에서 - + 위치가 바뀔경우에 대해서 같이 고민해보았고 6단원에서&nbsp; Base Collector&nbsp; Emitter가 추가 되어있는 양극성 접합 트랜지스터도 공부하면서 시험 공부대비를 하였다.</p>','2020-05-01 07:45:38.868199','group57',4259,251,'2020-05-01 07:42:31.802748','6단원 양극성접합 트랜지스터 (BJT)와 2단원 OP amp 에 대해서 공부함.','16:00',4,120),(353,'2020/05/01/orig/IMG_2940.jpg','<p>데이타 구조 중간고사를 친 후에 따로 만나지 않아서, 이번주월요일에 배운 binary search tree에 대해 공부하고, 배웠던 내용들을 잊지 않기 위한 공부를 하였습니다.&nbsp;</p>','2020-05-01 12:09:15.838615','group1',5841,195,'2020-05-01 12:05:38.581252','데이타구조 스터디','14:00',5,420),(354,'2020/05/01/orig/06-20200425-20302130.jpg','<p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">범위: OS - Programming Assignment 2 관련 리뷰</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">1) PA2을 완료한 후에, 진행하면서 생겼던 피드백 서로 나누기</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\"></p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\"></p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\"></p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">2) PA2 관련 개념 정리</p>','2020-05-01 14:23:14.298363','group58',NULL,252,NULL,'OS PA2 review','20:30',6,60),(355,'2020/05/01/orig/07-20200425-20302130.png','<p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">범위: OS - 온라인 교재 6. Direct Execution 범위</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">1) 무작위로 2명을 선정하여 나머지 인원들에게 강의 형식으로 발표</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\"></p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\"></p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\"></p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">2) 전체 내용을 다시 한 번 되짚으며 복습 및 관련 내용 상호간 QnA</p>','2020-05-01 14:24:41.220365','group58',8250,252,'2020-05-01 14:23:24.911498','OS Online lecture chap 6 review','20:30',7,60),(356,'2020/05/01/orig/1588344087425.png','DB 중간고사 리뷰 및 곧 있을 알고리즘 시험 대비 관련 논의','2020-05-01 14:43:25.879289','group17',9162,211,'2020-05-01 14:40:06.480463','시험에 지친자들과 시험공부','22:30',3,67),(357,'2020/05/02/orig/B3A8F7DF-C70D-4E83-9E70-B78B50547086.png','1.problem 4-3 f(이지훈)\r\n\r\n\r\n\r\n\r\n\r\n2.15.4-2,3(정유신)\r\n\r\n\r\n\r\n\r\n\r\n3.16-2(박병윤, 장민영)','2020-05-01 15:26:29.325909','group51',5973,245,'2020-05-01 15:19:36.696475','문제풀이','23:00',3,85),(359,'2020/05/02/orig/KakaoTalk_Photo_2020-05-02-02-11-04.jpeg','<p>오늘은 ARM 프로레서의 history와 arm holdings의 대표 프로세서인 Cortex series에 대해서 공부를 하였다.</p><p>Armv7의 ISA를 가지는 Cortex - A, Cortex - R, Cortex- M 각각의 특징과 차이점들에 대해서 공부를 하였고</p><p>Arm instruction set, Thumb instruction set, Thumb2 instruction set에 대해서도 공부를 하였다.</p><p>기존의 Arm 프로세서는 32비트 명령어인 arm 명령어와 16비트 명령어인 thumb 명령어를 지원하고 있지만,</p><p>cortex-m에서는 확장된 thumb 명령어만 지원하고 있다.(cortex-m3, m4는 arm 명령어를 지원하지 않고 있다.)</p><p>일반적으로 arm 명령어는 thumb 명령어를 사용하는 것과 비교하여 성능 면에서 장점을 지니고, thumb 명령어는 arm 명령어에 비하여 코드 밀도 면에서 장점을 지닌다.</p>','2020-05-01 17:11:18.341050','group20',NULL,214,NULL,'임베디드프로세서응용','21:30',2,60),(360,'2020/05/02/orig/study_picture.png','<p><img src=\"/upload_files/django-summernote/2020-05-02/f3a578cd-8e61-4b49-97ed-9812b5114e3a.png\" style=\"width: 494px;\"><img src=\"/upload_files/django-summernote/2020-05-02/79d811ca-91e7-4503-bdeb-e310d94d37ba.png\" style=\"width: 1356px;\"><br></p>','2020-05-02 04:25:52.033212','group60',NULL,254,NULL,'로직디자인 연습문제 풀이','10:30',16,120),(361,'2020/05/02/orig/KakaoTalk_Photo_2020-05-02-16-31-11.png','<p><span style=\"font-family: &quot;Helvetica Neue&quot;;\">주제 : CPU scheduling</span></p><p><span style=\"font-family: &quot;Helvetica Neue&quot;;\">이상적인 CPU scheduling이 필요한 이유와 dispatcherd의 정의</span></p><p><span style=\"font-family: &quot;Helvetica Neue&quot;;\">scheduling의 여러가지 기준</span></p><p><span style=\"font-family: &quot;Helvetica Neue&quot;;\">&nbsp; &nbsp; 1. CPU utilization</span></p><p><span style=\"font-family: &quot;Helvetica Neue&quot;;\">&nbsp; &nbsp; 2. Throughput</span></p><p><span style=\"font-family: &quot;Helvetica Neue&quot;;\">&nbsp; &nbsp; 3. Turnaround</span></p><p><span style=\"font-family: &quot;Helvetica Neue&quot;;\">&nbsp; &nbsp; 4. Responce time</span></p><p><span style=\"font-family: &quot;Helvetica Neue&quot;;\">&nbsp; &nbsp; 5. Waiting Time</span></p><p><span style=\"font-family: &quot;Helvetica Neue&quot;;\">Scheduling의 기준에 따른 여러 방법들</span></p><p><span style=\"font-family: &quot;Helvetica Neue&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;</span><span id=\"docs-internal-guid-812c1473-7fff-9457-513e-f84b382ad045\"><span style=\"font-size: 11pt; font-family: &quot;Helvetica Neue&quot;; font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; vertical-align: baseline; white-space: pre-wrap;\">1. First Come First Served</span></span></p><p><span style=\"font-family: &quot;Helvetica Neue&quot;;\">&nbsp; &nbsp; 2.&nbsp;</span><span id=\"docs-internal-guid-812c1473-7fff-9457-513e-f84b382ad045\"><span style=\"font-size: 11pt; font-family: Arial; font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; vertical-align: baseline; white-space: pre-wrap;\"><span id=\"docs-internal-guid-7557c85c-7fff-f202-8b70-e3d4687a49aa\" style=\"white-space: normal;\"><span style=\"font-size: 11pt; font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; vertical-align: baseline; white-space: pre-wrap; font-family: &quot;Helvetica Neue&quot;;\">Shortest Job First</span></span></span></span></p><p><span style=\"font-family: &quot;Helvetica Neue&quot;;\">&nbsp; &nbsp; 3.&nbsp;</span><span id=\"docs-internal-guid-812c1473-7fff-9457-513e-f84b382ad045\"><span style=\"font-size: 11pt; font-family: Arial; font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; vertical-align: baseline; white-space: pre-wrap;\"><span id=\"docs-internal-guid-7557c85c-7fff-f202-8b70-e3d4687a49aa\" style=\"white-space: normal;\"><span style=\"font-size: 11pt; font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; vertical-align: baseline; white-space: pre-wrap;\"><span id=\"docs-internal-guid-6462401c-7fff-1045-290c-b6e167f25278\" style=\"white-space: normal;\"><span style=\"font-size: 11pt; color: rgb(34, 36, 38); font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; vertical-align: baseline; white-space: pre-wrap; font-family: &quot;Helvetica Neue&quot;;\">Round Robin</span></span><br></span></span><br></span></span><br></p>','2020-05-02 07:40:45.438300','group16',NULL,210,NULL,'OS 8주차','15:50',7,45),(362,'2020/05/02/orig/KakaoTalk_Photo_2020-05-02-21-22-28.jpeg','<p>MUX에서 샤논의 원리를 통해 변수1개를 줄일 수 있다. 변수가 4개일떄 3-to-8 Mux를 통해 함수를 구현하는 방법</p><p><br></p><p>D-Latch 2개를 통해서 D FF이 만들어 지는 과정&nbsp;</p><p>FF은 clock이 변화 할때, 즉 rasing 이거나 falling 상태일때 값이 적용되어 바뀌게 되는데 이것이 가능한 이유는 Latch로 FF을 구성할때 clock을 한곳에는 그대로 한곳에서 프라임 값을 집어 넣는 방식으로 구현하기때문에 clock이 변화하면 각각의 Latch가 순차적으로 활성화 되기 때문에 가능하다.</p><p><br></p><p>chapter test 5 마지막 문제.</p><p>남은 변수 한개를 함수가 모아지는 OR gate에 직접 연결해서 조작하는 식의 아이디어가 필요했음. 더욱 연습이 필요할듯 하다.</p>','2020-05-02 12:28:55.535063','group30',2980,224,'2020-05-02 12:19:05.821111','chapter 5 리뷰 및 복습','20:30',4,30),(363,'2020/05/03/orig/1588432962543.png','곧 있을 알고리즘 중간고사에 대해서 출제 방향과 어떤 부분을 중점으로 바라보고 대비하면 좋을지에 대한 방향성에 대해서 논했습니다.','2020-05-02 15:24:00.894678','group17',2658,211,'2020-05-02 15:21:57.096911','분노에 가득찬 삼인, 알고를 논하다','23:10',4,59),(364,'2020/05/03/orig/04-20200502-2100-2210.PNG','<p>논리설계 k-map 내용 정리하고 개념을 복습했으며, adder comparator 영상을 복습하고 개념을 정리했음.</p><p>다음주에 있을 논리설계 중간고사를 대비해서 지난 수업 피피티를 전체적으로 복습함.</p>','2020-05-02 17:28:56.727486','group27',9730,221,'2020-05-02 17:26:56.131175','20200503-21:00-22:10','21:00',4,70),(365,'2020/05/03/orig/BD253CBE-148E-41B1-A8D7-1DC9F8BFBBFA.png','mid-term project 구상,\r\n데이터 수집, 분섭 방법 탐구,\r\nNormalization Theory에 맞게 테이블 정규화하기,\r\n각 테이블마다 relationship을 어떻게 연결해야 할지 공부하였습니다.','2020-05-03 08:56:01.410415','group61',7681,255,'2020-05-03 08:49:27.962570','4일차','15:00',4,180),(366,'2020/05/03/orig/ss.png','<p>-알고리듬 8주차 목, 9주차 월 수업을 리뷰</p><p>-운영체제 9주차 월요일 수업 리뷰</p><p><br></p>','2020-05-03 11:04:51.035937','group32',8965,226,'2020-05-03 10:59:45.880354','7번째 스터디','20:00',7,120),(367,'2020/05/03/orig/1588512421217.png','11강 adder/subtractors 12강 n-bit adder/subtractors, comparators 의 예제들을 같이 풀어보았습니당 문제가 너무 어려워서 쉽진 않았지만,, 같이 의논해가면서 예제들을 차근차근 풀어나갔습니당^.^!!  다들 시험 준비 잘해서 잘 치길 바래요(*°▽°*)','2020-05-03 13:30:43.885183','group64',3604,258,'2020-05-03 13:24:00.002258','논리설계 11,12강','21:00',4,90),(368,'2020/05/03/orig/study0503.png','<p>https://docs.google.com/document/d/1BqYjAHcPMawDO3i22CpFn_1dr2ckAEuj91IVZd3i6uw/edit</p><p><a href=\"https://docs.google.com/document/d/1gEOeWOZ6qakBtxr5Y2_SUR-Nw3OwxcyqgfEf-sTy8kA/edit\" target=\"_blank\">https://docs.google.com/document/d/1gEOeWOZ6qakBtxr5Y2_SUR-Nw3OwxcyqgfEf-sTy8kA/edit</a></p><p>https://docs.google.com/document/d/1BD6qKu2q2NU-Ycv8b-wgfe0g3SSCLuoKFHH80Vhiqak/edit</p><p>https://docs.google.com/document/d/12apwHVU6K-VSaOeiQWS4uQqaqlO6nv5gavxzAfMHq4Q/edit</p><p>https://docs.google.com/document/d/1tly59SA5vd-mAy-IALcBMDHC1vRD9bMFULxjgm7LWT4/edit</p><p>https://docs.google.com/document/d/114FKaYgGImrygKyZqfXLnk63iIMcdHKoAjJfp-8vlAU/edit</p>','2020-05-03 13:59:52.720247','group60',6342,254,'2020-05-03 13:56:48.809572','로직디자인 exercise 최종 정리','8:30',17,149),(369,'2020/05/04/orig/4.jpeg','<p><span style=\"font-weight: 700;\">Ch3. Agile Software Development</span></p><p><span style=\"font-weight: 700;\">- 챕터3 교과서 정독</span></p><p><span style=\"font-weight: 700;\">- 애자일을 사용하여 프로젝트를 해본 경험 나누기</span></p><p><span style=\"font-weight: 700;\">- 애자일 프로젝트에 적합한 공유</span></p>','2020-05-04 07:11:56.059722','group12',4586,206,'2020-05-04 07:02:19.263948','소프트웨어 공학 Ch3 복습','15:00',4,60),(371,'2020/05/05/orig/KakaoTalk_Photo_2020-05-05-20-06-15.jpeg','<p>5월 7일에 있을 Operating system 퀴즈2를 대비하여</p><p>각자 10문제씩 예상 문제를 만들어오고,</p><p>풀어보는 시간을 가졌습니다.</p>','2020-05-05 11:06:40.243394','group55',8657,249,'2020-05-05 11:02:10.537314','Operating System Quiz 2 대비','19:00',5,60),(372,'2020/05/05/orig/KakaoTalk_Photo_2020-05-05-20-47-41.jpeg','<p>algebra공식 유도하기.</p><p><br></p><p>f(a,b,c,d,e)=m(0,1,2,3,4,5,6,7,23,24,25)</p><p>f(a,b,c,d,e)=m(0,1,2,7,23,24,25,26,28,29,30,31)</p><p>3-to-8 decoder, twe NAND로 나타내기.</p><p>a,b로 크게 나누는 것을 NAND를 쓰는것이 아니라 디코더 하나를 더써서 구현하면 주어진 문제 조건인 Two NAND를 맞출수 있음.</p><p><br></p><p><br></p><p><br></p><p><br></p>','2020-05-05 11:50:44.439459','group30',1694,224,'2020-05-05 11:46:55.010289','중간고사 문제풀이 및 복습','20:00',5,60),(373,'2020/05/05/orig/7920.PNG','<p>논리설계 13강 encoder decoder과 14강 mux demux에 대한 예제 문제들을 풀이 해 보았습니다!</p><p>다들 중간고사 화이팅^.^</p>','2020-05-05 12:59:34.593434','group64',7920,258,'2020-05-05 12:55:24.320612','논리설계  13 강 14강','21:00',5,60),(374,'2020/05/05/orig/KakaoTalk_20200505_232151498.png','<p><b>지금까지 공부했던 내용 정리</b></p><p>- Recursion Tree</p><p>- Heap Sort</p><p>- Branch and Bounds</p><p>- Knapsack</p>','2020-05-05 14:26:23.452096','group51',5483,245,'2020-05-05 14:19:26.173276','중간고사 내용 정리','22:00',4,80),(375,'2020/05/06/orig/06-20200505-1400-1630.png','<p>지난 퀴즈문제 오답 풀이</p><p>운영체제 4장 Thread 공부</p><p><br></p>','2020-05-05 17:53:46.011825','group4',9560,198,'2020-05-05 17:50:27.084975','운영체제 공부','14:00',6,90),(376,'2020/05/06/orig/07-20200506-0000-0200.png','<p>1. CPU Scheduling</p><p>&nbsp; &nbsp; 1) scheduling Algorithm</p><p>&nbsp; &nbsp; 2) Multi-processor scheduling</p><p>&nbsp; &nbsp; 3) thread scheduling</p><p>&nbsp; &nbsp; 4) Real-time CPU scheduling</p><p>2. Process Synchronization</p><p>&nbsp; &nbsp; 1) critical section problem</p><p>&nbsp; &nbsp; 2) H/W support for synchronization</p><p>&nbsp; &nbsp; 3) Mutex and Semaphore<br></p>','2020-05-05 17:58:26.353010','group4',8645,198,'2020-05-05 17:54:33.533337','OS 5, 6장 정리','00:00',7,120),(377,'2020/05/06/orig/1588733979568.png','IR receiver 라이브러리를 찾는 방법과 분석하는 방방법에 대해 이야기를 나누었다','2020-05-06 03:00:12.962711','group6',7253,200,'2020-05-06 02:57:57.130091','임베디드 IR receiver','11:00',4,60),(378,'2020/05/06/orig/study.png','<p><img src=\"/upload_files/django-summernote/2020-05-06/e71208f7-dc7c-4ef2-97f0-835e9ea6d4ab.png\" style=\"width: 1341px;\"><img src=\"/upload_files/django-summernote/2020-05-06/3b992e95-7917-41e8-be86-0699e328c71e.png\" style=\"width: 1341px;\"><img src=\"/upload_files/django-summernote/2020-05-06/67a45552-95bc-4ad9-a6a2-79129f74db85.png\" style=\"width: 1341px;\"><br></p>','2020-05-06 03:01:30.637068','group60',6549,254,'2020-05-06 02:58:20.424162','시험 공부','10:00',18,120),(379,'2020/05/06/orig/08-20200506-1300-1400.JPG','<p>1. knapsack problem - 계산 법과 종류</p><p>2. Graph - 개념정리</p><p>3. BFS VS DFS 정리 ( 최단 경로&nbsp; = BFS이다)</p><p>4. 1장~6장까지 총 정리</p>','2020-05-06 05:35:03.807823','group4',9126,198,'2020-05-06 05:33:24.794738','Algorithm Analysis 공부','13:00',8,60),(380,'2020/05/06/orig/KakaoTalk_20200429_200252880.png','<p><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">4월 29일 수요일 8시 정각에 스터디를 시작했다.</span></p><p><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">챕터 5의 exercises부분과 test부분의 번호를 나눠, 각자 맡은 번호의 문제를 풀어오기로 했다.</span></p><p><font color=\"#212529\" face=\"-apple-system, BlinkMacSystemFont, Segoe UI, Roboto, Helvetica Neue, Arial, Noto Sans, sans-serif, Apple Color Emoji, Segoe UI Emoji, Segoe UI Symbol, Noto Color Emoji\"><span style=\"font-size: 16px;\">스터디 진행은 각자가 맡은 번호의 문제를 풀이하는 방식으로 진행했다.</span></font></p><p><font color=\"#212529\" face=\"-apple-system, BlinkMacSystemFont, Segoe UI, Roboto, Helvetica Neue, Arial, Noto Sans, sans-serif, Apple Color Emoji, Segoe UI Emoji, Segoe UI Symbol, Noto Color Emoji\"><span style=\"font-size: 16px;\">만약 자신이 맡은 문제 중 해결하지 못한 문제가 있다면, 그 문제를 3명이서&nbsp;</span></font><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">힘을 합쳐 다시 풀어보는 방식으로 스터디를 진행했다.</span></p><p>이렇게 문제 풀이를 하나씩 해결해 나가면서 5과에서 문제가 나오는 패턴을 알 수 있었고,</p><p>서로의 좋은 풀이방법을 알아갈 수 있는 뜻깊은 시간이었다.</p><p>하지만 각자 맡은 문제만 풀어오다보니 풀이과정 뿐만 아니라 </p><p>문제를 설명하는 시간도 추가적으로 걸렸기 때문에, 시간적으로 비효율적이라는 의견이 나왔다.</p><p>이를 해결하기 위해 모두가 모든 문제를 숙지해오고, 자신이 맡은 부분은 풀이까지 정리해오기로 결정했다.</p><p>의견을 수렴해가면서 더 효율적인 스터디가 되어가는 것 같아 뿌듯했다.</p><p><br></p><p>다음 스터디는 시험 하루 전날이기 때문에,</p><p>1과부터 5과를 3파트로 나누어 간단히 요약해 설명해주는 방식으로 스터디를 진행할 예정이다.</p>','2020-05-06 07:12:19.103903','group2',6139,196,'2020-05-06 07:12:13.273765','0429 모임6','20:00',8,120),(382,'2020/05/06/orig/Screenshot.png','<p>이번주 화요일날 치른 첫번째 midterm에 대해 review을 갖는 시간을 가졌다. Adder와 Subtractor의 심화문제가 많이 출제되어 Adder와 Subtractor의 개념을 다시한번 더 복습하고 함께 문제를 풀었다.</p><p>서로 다른 circuit design이 나와 모두 자신의 풀이를 설명했다. 또한, 아직 시험에서 다루지 않은 Encoder &amp; Decoder 그리고 Mux와 DeMux에 대해 review하는 시간도 가졌다.&nbsp;</p>','2020-05-06 08:48:28.764756','group48',7283,265,'2020-05-06 08:41:30.614223','Logic Design Midterm1 Review','16:30',5,75),(383,'2020/05/06/orig/EAB841AD-7ACF-40C8-90EF-A50670F852E0.png','곧 각자 시험이 있어 시험공부하였음','2020-05-06 09:41:20.563359','group3',1504,197,'2020-05-06 09:32:41.418560','6번째 스터디','17:30',6,65),(384,'2020/05/06/orig/65B6120F-4DB7-45C4-8BA5-73C5CA61E504.png','알고리즘 중간고사를 앞두고 중간고사 시험범위까지의 개념들을 정리해보았다.\r\nKnapsack problem, DP, time complexity등 시험에 나올만한 개념과 문제들을\r\n정리해보고, 어려웠던 개념에 대해 스터디원들끼리 이야기 하는 시간을 가졌다. \r\n수업시간에 헷갈렸던 문제를 같이 풀어보고, 각자 어떤 부분이 부족했는지를 알 수 있었다.\r\n교과서에서 소개된 예시를 통해 부족한 개념을 보충하고 이해하는 시간이였다.','2020-05-06 11:44:25.445035','group49',7518,243,'2020-05-06 11:41:04.840263','알고리즘','19:00',6,90),(385,'2020/05/06/orig/D72EE897-8F73-4567-AD1C-552AF41B8CD0.png','파일 I/O의 원리 공부 및 예제 분석\r\nSTREAM의 개념 이해\r\n직렬화와 역직렬화의 개념 이해','2020-05-06 13:10:21.137001','group46',5361,240,'2020-05-06 13:06:37.469709','파일I/O stream','21:00',6,70),(386,'2020/05/06/orig/19-20200506-1900-2000.PNG','<p>6강(ProcessSynchronization) 복습</p><p>- Mutex와 Semaphore의 내용을 복습하였습니다.</p>','2020-05-06 13:49:41.870279','group19',9678,213,'2020-05-06 13:47:53.562811','아홉번째 스터디 그룹 모임(5월 6일)','19:00',11,60),(387,'2020/05/07/orig/20200506_group34.png','<p><img src=\"/upload_files/django-summernote/2020-05-07/fb60f237-0fa3-4058-baf6-a2cdef488202.png\" style=\"width: 621px;\"></p><p><br></p><p><br></p><p>1. 내일 있을 알고리즘 과목 중간고사에 맞추어 사전에 각자 시험 범위를 나누어 분담을 한다음, 준비한 범위에 맞춰 review 및 예제 문제풀어보기 시간을 가졌습니다.&nbsp;</p>','2020-05-06 15:43:03.608684','group34',8157,228,'2020-05-06 15:38:33.192735','#6 study for Algorithm Miterm exam','2300',7,90),(388,'2020/05/07/orig/05.05.20.PNG','<p>singly linked list와 doubly linked list에 대한 궁금한 내용에 대해서 이야기 하였다.</p><p>그리고 assignment 질문에 대해서 그 의미에 대해서 이야기하고 각자의 의견을 나누었다.</p><p>특히, stack을 사용했을 때와 inplace를 사용했을 때 같은 time complexity를 가지고 있지만 실제로 작동을 해보면 다른 이유에 대해서 이야기 하였다.&nbsp;</p><p>그리고 stack overflow에 대한 의견도 나누었다.</p>','2020-05-06 16:34:09.535867','group56',NULL,250,NULL,'DS 스터디','2000',7,2100),(389,'2020/05/07/orig/2.png','<p>중간 고사를 대비하여 각 단원에 공식을 응용해서 기출 대표문제들을 풀어보는 시간들을 가졌다. 모르는 것들은 서로 알려주며</p><p>모두 모르는 것들은 다음에 기회가 된다면 TA님께 질문을 하기로 했다. 그리고 Drain current 에 따른 공식들이 n mos 와 p mos 에서 각각 다른 위치로 적용되는게 헷갈렸는데</p><p>다른 스터디원들이 잘 알려주어서 서로 도움이 되는 시간이 되었다.</p>','2020-05-07 11:22:37.823731','group57',2547,251,'2020-05-07 11:20:09.972297','중간 고사 전 마지막 연습문제 풀이 및 Q&A','18:20',5,120),(390,'2020/05/07/orig/1588851292049.png','기전실 latch, flip flop 이론과 실험 내용 q&a\r\n회로이론 7강 헷갈리는 부분 질문답변\r\nLogic Design 시험 예상 문제 이야기 나눔','2020-05-07 11:38:38.683758','group29',9246,223,'2020-05-07 11:31:56.401197','5/7','20:00',9,40),(391,'2020/05/07/orig/2020-05-07.png','<p><img src=\"/upload_files/django-summernote/2020-05-07/d50b79c1-6129-415b-a97e-8538c0a3393c.jpeg\" style=\"width: 720px;\"><img src=\"/upload_files/django-summernote/2020-05-07/58eba4ef-1309-4622-91d8-c9ea147da622.jpeg\" style=\"width: 720px;\"><br></p>','2020-05-07 12:37:07.258312','group60',2901,254,'2020-05-07 12:33:44.295786','로직디자인 시험 준비','20:30',19,60),(392,'2020/05/07/orig/group36_8.jpg','<p>오늘은 Java programming 에서 배웠던 exception handling, Streams, File I/O 에 대해서 복습하는 시간을 가졌습니다.&nbsp;<br>예제 문제를 통해서 개념을 다시 한 번 이해를 했고 서로 몰랐던 부분은 알려주며 복습을 했습니다.</p><p>추가적으로, 개인적으로 듣는 수업 (오픈소스소프트웨어 실습) 에서 몰랐던 부분을 복습하며 공부했습니다.&nbsp;</p>','2020-05-07 12:59:16.040300','group36',4031,230,'2020-05-07 12:53:47.881035','8번째 모임','20:00 ~ 21:50',8,110),(393,'2020/05/08/orig/Screenshot0508.png','<p>오늘 치른 Logic Design Midterm2시험을 다시 한번 복습하는 시간을 가졌습니다. 오늘은 Logic Design의 모든 topic이 시험에 출제되었습니다.</p><p>그 중에서도 가장 난이도가 있었던 Encoder &amp; Decoder 그리고 Mux &amp; DeMux 컨셉을 다시 한번 복습하고 시험 문제를 리뷰하는 시간을 가졌습니다.</p>','2020-05-08 11:13:47.098927','group48',3861,265,'2020-05-08 11:07:30.298838','Midterm2 리뷰','19:00',6,60),(394,'2020/05/09/orig/789745FD-D936-4762-B707-1A277DC89A5D.jpeg','mysql 워크벤치에서 시스템을 통해 ER다이어그램을 그려보았습니다. 각 relation의 연결관계에 있어서 pk나 fk와 같은 key의 역할이 중요한 것을 배웠습니다. 또한 key를 설정할 때 고려해야할 정규화이론과 entity set을 어떻게 설정할 지에 대해 생각해 보았습니다.','2020-05-09 07:01:49.333736','group61',7803,255,'2020-05-09 06:55:42.958908','5일차','13:00',5,180),(395,'2020/05/09/orig/KakaoTalk_Photo_2020-05-09-15-46-07.png','<p>CPU Scheduling 2번째 Video Lecture</p><p><br></p><p>1. Priority Scheduling과 Multilevel Queue Scheduling의 정의</p><p>2.&nbsp;<span style=\"font-family: Arial; font-size: 11pt; white-space: pre-wrap;\">Multilevel Priority Queue에 대해</span></p><p>&nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;<span style=\"font-family: Arial; font-size: 11pt; white-space: pre-wrap;\">Multilevel Feedback Queue</span></p><p><span style=\"font-family: Arial; font-size: 11pt; white-space: pre-wrap;\">3. </span><span id=\"docs-internal-guid-dd4f8121-7fff-00f1-be3f-72415fe3a350\"><span style=\"font-size: 11pt; font-family: Arial; font-variant-ligatures: normal; font-variant-east-asian: nor