t-size: 11pt;\"><br></span><br></span></span></span></span></span></span></span></span></p><p><span id=\"docs-internal-guid-dd4f8121-7fff-00f1-be3f-72415fe3a350\"><span style=\"font-size: 11pt; font-family: Arial; font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; vertical-align: baseline; white-space: pre-wrap;\"><span id=\"docs-internal-guid-c79c31da-7fff-41ed-37ca-83677c87b293\" style=\"white-space: normal;\"><span style=\"font-size: 11pt; color: rgb(34, 36, 38); font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; vertical-align: baseline; white-space: pre-wrap;\"><span id=\"docs-internal-guid-d0f2f6c0-7fff-6aee-d66b-a595dc696a07\" style=\"caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); white-space: normal;\"><span style=\"font-size: 11pt; color: rgb(34, 36, 38); background-color: transparent; font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span></span><br></span></span><br></span></span><span style=\"font-family: Arial; font-size: 11pt; white-space: pre-wrap;\"><br></span><span style=\"font-family: Arial; font-size: 11pt; white-space: pre-wrap;\"><br></span></p>','2020-05-09 07:07:35.165225','group16',NULL,210,NULL,'OS 10주차','14:30',8,45),(396,'2020/05/09/orig/KakaoTalk_20200509_162030637.png','<p>스마트 시스템 실습 과목이 월요일에 중간고사가 있어서</p><p>pdf를 보면서 쭉 훑어보면서 모르는 것들을 서로 알려주면서 스터디하였습니다.</p>','2020-05-09 07:22:06.733841','group11',2843,205,'2020-05-09 07:19:24.104623','스마트시스템실습 중간고사 준비','14:00',5,120),(397,'2020/05/10/orig/KakaoTalk_20200510_202742135.png','<p>데이터구조에 대해서 스터디를 진행했습니다.&nbsp;</p><p>먼저, max heap 에 insert, delete 연산의 알고리즘에 대해서 알게 되었고,</p><p>요즘 진행하는 binary search tree 에대해서 모든 알고리즘과 구현방식을 서로에게 설명하며 개념을 더욱 충실히 할 수 있는 기회가 되었습니다.&nbsp;</p><p>화기애애한 분위기 속에서 서로에게 도움이 되고자 하는 마음이 느껴져 스터디가 기다려집니다~</p>','2020-05-10 11:31:49.325827','group44',NULL,238,NULL,'재밌는 스터디~','19:00',3,80),(398,'2020/05/10/orig/5.png','<p>전자회로 이전 내용 복습</p><p>문제풀이</p>','2020-05-10 11:49:36.596621','group39',7920,233,'2020-05-10 11:44:25.980124','전자회로','20:00',5,60),(399,'2020/05/10/orig/06-20200507-2000-2130.png','<p>1 알고리즘 중간고사 리뷰</p><p>= 전반적으로 자신이 어떤 문제에 대해서 어려웠는지 이야기 하고 서로 피드백하고</p><p>문제 개념을 다시 파악하는 시간을 가졌습니다.</p><p>recursion tree master theorem에 대해서 어떤 방식으로 풀었는지, 그리고 그 방식을 증명하는 과정</p><p>그리고 LCS관련 해서 방향을 어떻게 나타내는 것이 올바른 방법인지</p><p>knapsack관련 bound계산법 등등 관련해서 문제풀이하는 시간을 가졌습니다.</p><p><br></p><p>2 운영체제 퀴즈 리뷰</p><p>= 운영체제에서 퀴즈가 다 다른 문제들이 나왔어서 그 문제들의 답이 무엇인지 pdf파일을 보면서 같이 찾아보고</p><p>제일 어려운 6장 process synchronization부분에 대해서 한번 더 복습하는 시간을 가졌습니다.</p>','2020-05-10 12:21:33.289663','group38',NULL,232,NULL,'여섯번째 스터디','20:00',6,75),(400,'2020/05/10/orig/07-20200510-2000-2100.png','<p><br></p><p>1 알고리즘<br></p><p>BFS color관련 개념부분</p><p>while에서 gray로 되고 나서 white들을 어떻게 다 gray로 찾고 나서 </p><p>balck으로 변환되는 부분에 flow에 대해 다시 복습</p><p>교수님이 설명해 주신 코드 다시 우리의 것으로 이해해서 설명해보고</p><p>그 코드 관련해서 응용할 수 있는 것이 무엇인지 생각해보는 시간을 가졌고,</p><p>list에 대해서도 다시 복습을 하는 시간을 가졌습니다.</p><p><br></p><p>DFS관련해서는 데이타 구조에서 배운 개념들이 많이 겹치고 이부분에서도 컬러부분이 새롭게 추가된 부분이라&nbsp;</p><p>팀원들 다같이 이해한 것을 나누고 공유했습니다.</p><p>king of edges에 대해서 이해가 가지 않는 tree edge, back edge이 어떻게 다른지 설명해보고 서로 이해한 부분을 말해보았습니다.</p><p><br></p><p>2 운영체제</p><p>Semaphore에 관해서 atomicity를 어떻게 유지할 수 있는지 그 개념들에 대해 이야기를 나눴고</p><p>semaphore에서 spinlock을 없애는 거에 대해 혼란이 있었는데</p><p>spinlock부분을 critical section이 아니라 entry section에서 막는 것이기 때문에 spinlock의 범위가 되게 짧다.</p><p><br></p>','2020-05-10 12:42:18.341233','group38',NULL,232,NULL,'일곱번째 스터디','20:00',7,60),(401,'2020/05/10/orig/KakaoTalk_20200510_222200345.png','<p class=\"MsoListParagraph\" style=\"margin-left:38.0pt;mso-para-margin-left:0gd;\r\ntext-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN-US\">SJF</span>를 실행하기 위해서는 모든 <span lang=\"EN-US\">CPU</span>를 기다려야 하는가<span lang=\"EN-US\">? </span>원래 <span lang=\"EN-US\">CPU\r\n</span>스케줄링을 할 때 모든 <span lang=\"EN-US\">CPU</span>의 실행 시간을 알고 시작하는 것인가<span lang=\"EN-US\">? <o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:38.0pt;mso-para-margin-left:0gd;\r\ntext-indent:-18.0pt;mso-list:l1 level1 lfo2\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\nmso-bidi-font-family:Wingdings\">ð<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; </span></span><!--[endif]-->그렇다<span lang=\"EN-US\">. </span>예측이 필요<span lang=\"EN-US\">. <o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:38.0pt;mso-para-margin-left:0gd;\r\ntext-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN-US\">Turnaround Time </span>이 존재하는 이유<span lang=\"EN-US\">?<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoListParagraph\" style=\"margin-left:38.0pt;mso-para-margin-left:0gd;\r\ntext-indent:-18.0pt;mso-list:l1 level1 lfo2\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\nmso-bidi-font-family:Wingdings\">ð<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; </span></span><!--[endif]-->스케줄링이\r\n잘 되었는지 아닌지를 결정하는 기준 중 하나가 사용자가 가시적으로 보기 위해서 필요할 듯<span lang=\"EN-US\">,</span></p><p class=\"MsoListParagraph\" style=\"margin-left:38.0pt;mso-para-margin-left:0gd;\r\ntext-indent:-18.0pt;mso-list:l0 level1 lfo1;tab-stops:356.7pt\"><span lang=\"EN-US\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN-US\">U</span>가 <span lang=\"EN-US\">1</span>보다\r\n작은 이유 <span lang=\"EN-US\">?<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraph\" style=\"margin-left:38.0pt;mso-para-margin-left:0gd;\r\ntab-stops:356.7pt\"><span lang=\"EN-US\">U</span>가 <span lang=\"EN-US\">1</span>보다 크면 <span lang=\"EN-US\">CPU</span>활용도를 많아짐<span lang=\"EN-US\">. 10</span>초동안 <span lang=\"EN-US\">CPU</span>가\r\n계산할<span lang=\"EN-US\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraph\" style=\"margin-left:38.0pt;mso-para-margin-left:0gd;\r\ntext-indent:-18.0pt;mso-list:l1 level1 lfo2;tab-stops:356.7pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\nmso-bidi-font-family:Wingdings\">ð<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; </span></span><!--[endif]--><span lang=\"EN-US\">rm</span>에서 중요한 건 실행 시간과 주기 중에서 주기만큼 지나면 똑같은 프로세스가 다시 시작되어야 한다는 것이다<span lang=\"EN-US\">. </span>주기가<span lang=\"EN-US\"> deadline</span>이 된다<span lang=\"EN-US\">.\r\n-&gt; 5</span>초뒤에 똑같은 게 시작이 되어야 하므로<span lang=\"EN-US\">. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraph\">다음 주기가 되기 전까지 실행하지 못하면<span lang=\"EN-US\"> fail. </span>가장 기초적인 방법이다<span lang=\"EN-US\">. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraph\" style=\"margin-left:38.0pt;mso-para-margin-left:0gd;\r\ntext-indent:-18.0pt;mso-list:l1 level1 lfo2\"><span lang=\"EN-US\"><span lang=\"EN-US\">-&gt; </span>가장 기본적인 스케쥴링이 되지 않으면 모든 우선순위가 밀리게\r\n된다는 것<span lang=\"EN-US\">.</span>&nbsp;</span></p><p class=\"MsoListParagraph\" style=\"margin-left:38.0pt;mso-para-margin-left:0gd;\r\ntext-indent:-18.0pt;mso-list:l1 level1 lfo2\"><span lang=\"EN-US\"><o:p><br></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:38.0pt;mso-para-margin-left:0gd;\r\ntext-indent:-18.0pt;mso-list:l1 level1 lfo2\"><span lang=\"EN-US\"><o:p>4.&nbsp;</o:p></span><span lang=\"EN-US\" style=\"font-size: 11pt; line-height: 107%; font-family: &quot;맑은 고딕&quot;;\">Turnaround\r\ntime : </span><span style=\"font-size: 11pt; line-height: 107%; font-family: &quot;맑은 고딕&quot;;\">반환시간으로<span lang=\"EN-US\">, </span>하나의 프로세스가 시작되는 순간<span lang=\"EN-US\">(<span style=\"color:red\">ready\r\nQ</span></span><span style=\"color:red\">에 등록된 시간<span lang=\"EN-US\">? job Q</span>에\r\n등록된 시간<span lang=\"EN-US\">? jobQ</span>는 메모리에 올라가는 것<span lang=\"EN-US\">. </span>하드디스크에\r\n있는 파일을 <span lang=\"EN-US\">readyQ</span>에 올라가는 것<span lang=\"EN-US\">. readyQ</span>는 <span lang=\"EN-US\">dispatcher</span>가 <span lang=\"EN-US\">ready</span>상태에 있는 것을 <span lang=\"EN-US\">running</span>으로 올려주는 것<span lang=\"EN-US\">. </span></span><span lang=\"EN-US\">)</span></span></p><p class=\"MsoListParagraph\" style=\"margin-left:38.0pt;mso-para-margin-left:0gd;\r\ntext-indent:-18.0pt;mso-list:l1 level1 lfo2\"><span style=\"font-size: 11pt; line-height: 107%; font-family: &quot;맑은 고딕&quot;;\"><span lang=\"EN-US\">&nbsp;5. 양희재 교수님 2018 중간고사 문제 풀이</span></span></p>','2020-05-10 13:24:37.992819','group45',2380,239,'2020-05-10 13:21:08.724569','CPU scheduling','21:00',8,90),(402,'2020/05/10/orig/05-20200510-2140-2240.PNG','<p>데이타 구조 doubled linked list 복습</p><p>데이타 구조 singled linked list 복습</p>','2020-05-10 13:46:28.531235','group27',4601,221,'2020-05-10 13:44:59.818416','20200426-21:40-22:40','21:40',5,60),(403,'2020/05/11/orig/05_20200420_1600_1700.png','<p>어떤 디자인 패턴이 적용된 시스템 예시와 framework에 대한 스터디를 진행하였습니다.&nbsp;</p><p>1. 해당 시스템에 디자인 패턴이 적용안된 초기 버전에서 하나씩 디자인패턴을 추가하는 예시를 공부하며, 디자인 패턴 적용방법과 결과에 대해 공부하였습니다.</p><p>2. framework 중 collections, input/output, GUI framework에 대해 공부했습니다.</p><p><br></p><p><img src=\"/upload_files/django-summernote/2020-05-11/c5f9bc4f-5baf-48d1-8c76-7f46b9453cdb.png\" style=\"width: 1281px;\"><img src=\"/upload_files/django-summernote/2020-05-11/47af458c-1783-436c-9cf4-fefcf6c2d09b.png\" style=\"width: 1281px;\"><br></p>','2020-05-11 07:25:04.481840','group24',NULL,218,NULL,'2020-04-20','16:00',6,60),(404,'2020/05/11/orig/20200511_1600_1700.png','<p>오늘은 모든 팀원들이 시험이 끝난 후 모인 첫번째 스터디 였습니다.</p><p>그래서 각자 시험리뷰를 진행하였습니다.&nbsp;</p><p>교수님들의 시험 스타일이 어땠는지, 앞으로 어떤 식으로 스터디를 진행하면 좋을 것인지에 대한 의견을 나누고 정리하였습니다.</p><p>시험을 보다가 헷갈렸던 개념, 모르는 개념에 대해 서로 나누고 공부하는 시간을 가졌습니다.</p>','2020-05-11 07:31:44.111761','group24',8269,218,'2020-05-11 07:25:38.422154','2020-05-11','16:00',7,60),(405,'2020/05/11/orig/1589208725064.png','데이터 구조 : 중간고사 정리 및 다시 풀며 복습\r\n중간고사를 기점으로 공부 스타일을 바꾸기로 토의\r\n인터넷상에서 DS예시 문제들을 함께 풀며 토의하기로 결정','2020-05-11 14:53:42.985970','group35',9163,229,'2020-05-11 14:47:00.515064','5차 스터디 보고서','21:30',5,75),(406,'2020/05/12/orig/05-20200418-2000-2100.jpg','<p>1. recursion tree 복습</p><p>2. 0-1 knapsack problem 복습</p>','2020-05-12 09:19:45.452390','group18',8352,212,'2020-05-12 09:17:48.736444','05. 알고리즘 스터디','20:00',5,60),(407,'2020/05/12/orig/06-20200425-2000-2100.jpg','<p>1. 1-0 knapsack problem (Branch and Bound 질의응답)</p><p>2. Branch and Bound tree 계산해보기</p>','2020-05-12 09:24:43.433975','group18',7056,212,'2020-05-12 09:20:35.479305','06. 알고리즘 스터디','20:00',6,60),(408,'2020/05/12/orig/07-20200505-2200-2330.png','<p>1. 알고리즘 퀴즈 문제 풀어보기</p><p>2. 전체 내용 질의응답</p><p>3. recursion tree 계산하기</p>','2020-05-12 09:26:37.251899','group18',5918,212,'2020-05-12 09:24:45.362279','07. 알고리즘 스터디 (preparing midterm)','22:00',7,90),(409,'2020/05/12/orig/1589283412844.png','회로이론 연습문제 풀기','2020-05-12 11:40:34.594812','group29',1046,223,'2020-05-12 11:36:24.562183','5/12','20:00',10,40),(410,'2