vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">이름을 미리 정해두고 알아서 용도에 맞게 사용</span></p></li></ul>','2020-05-13 02:39:27.263359','group60',7354,254,'2020-05-13 02:35:43.729280','Java Programming (16, 17강), (8강), logic design 15강','10:00',20,97),(413,'2020/05/13/orig/1589346510637.png','>>데이타 구조 Binary Search Tree\r\n- 구글링해서 찾은 예제 4문제를 같이 풀어보았다.\r\n- BST의 정의\r\n- BST key값이 주어졌을 때 insert 연습\r\n- BST delete 연습\r\n\r\n>>스터디 내용 구체화\r\n- 데이터 구조(4명)는 일주일에 1번씩, 수요일 오후1시에\r\n- 데이터 구조는 돌아가면서 문제를 찾아 월요일 밤까지 카톡방에 올리고\r\n- 문제를 찾아온 사람이 미리 풀어와서 스터디 시간에 설명\r\n- 다른 사람들은 스터디 시간 or  그 전에 문제 풀기\r\n- 회로이론(2명), 논리설계(2명), 자바 프로그래밍(2명)은 자유롭게 진행','2020-05-13 05:09:33.273366','group35',NULL,229,NULL,'6차 스터디보고서','13:00',6,45),(415,'2020/05/13/orig/67CBDE60-CC6D-4E9F-B9A3-057AF5CEFC0F_ewkr60t.png','Java 객체,메소드 복습\r\nJava presentation 준비\r\nLinux 환경적응','2020-05-13 09:39:19.416578','group3',2487,197,'2020-05-13 09:39:19.404478','7번째 스터디','17:30',8,65),(416,'2020/05/13/orig/BC601C54-4151-457F-AD6B-CB164145308C.png','지난주에 본 알고리즘 중간고사 문제를 리뷰하며, 각자가 생각하고 풀었던 방향에 대해 서로 의견을 나눴다.\r\nK-napsack problem을 푸는 알고리즘인 Branch and Bound, DP, Greedy에 대해 코드 구현 방식에 대해 생각을 나눴으며, efficiency를 보장하는 알고리즘에 대해 공부하였다.','2020-05-13 11:13:22.914779','group49',3498,243,'2020-05-13 11:10:25.926138','알고리즘!','19:00',7,70),(418,'2020/05/13/orig/Group3605_13.jpg','<p>오늘은 Java programming에서 배운 객체지향 프로그래밍(OOP)에 대해 복습하는 시간을 가졌습니다.</p><p>예제 문제를 통해 어떤 식으로 코드에 OOP를 적용할 수 있는지 배우고, 서로의 코드에 리뷰를 해주기도 했습니다.</p>','2020-05-13 13:02:59.748706','group36',6842,230,'2020-05-13 12:58:02.108240','9번째 모임','21:00',9,60),(419,'2020/05/13/orig/5E119FEA-B6C1-4100-8FCC-ECA7B7A81D6E.png','- Recursion PPT exercise 1,2 직접 코드를 실행해보며 이해하는 시간을 가짐\r\n- 바이너리 서치에 대한 이해\r\n- 머지솔트에 대한 이해\r\n- 11주차 강의 전체적인 내용 복습','2020-05-13 13:22:49.285678','group46',NULL,240,NULL,'Recursion 복습','21:00',7,70),(420,'2020/05/13/orig/KakaoTalk_20200513_230142088.png','<p>오늘은 두 명의 멤버만 참여했고,</p><p>다가오는 금요일에 있을 \'Logic Design\' 수업의 시험 준비를 했다.</p>','2020-05-13 14:04:27.301175','group5',3562,199,'2020-05-13 13:55:40.513554','DAY5','22:00',5,33),(421,'2020/05/13/orig/1.png','<p>금일 스터디는 저번주 금요일에 치른 중간 시험을 다시 복습하고 왜 틀렸는지 어떻게 풀어야 옳은지 다시 복습했다.</p><p>그리고 앞으로 더 구체적으로 배울 demodulation의 과정 중 vco가 구체적으로 이해가 되지 않아서 자료를 찾아보고 정확히 이해하는 시간을 가졌다.</p>','2020-05-13 14:05:24.641425','group57',9683,251,'2020-05-13 14:03:32.852648','중간 시험 리뷰 및 틀린문제 질문 + vco의 구체적인 이해','21:00',6,120),(422,'2020/05/14/orig/study5.jpg','<p>테브닌, 노턴 등가회로</p><p>RC회로</p><p>Python, linux 코드&nbsp;</p>','2020-05-14 05:15:46.380248','group9',4950,203,'2020-05-14 05:14:23.592991','기초전자공학실험 중간고사 전 스터디','2020-5-12 14:00',5,150),(423,'2020/05/14/orig/2020-05-13.png','<p>&nbsp;<span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">오늘은 논리설계 스터디를 진행하였습니다.&nbsp;</span></p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\"><br></p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">항상 모두가 참여하는 스터디이지만, 새로운 개념을 공부하니 더더욱 새로웠고, 배워가는 점이 많았습니다.</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\"><br></p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">금일은 모듈 18,19,20을 진행하였고, 서로 어려워하는 점을 나누고, 알려주는 시간을 가졌습니다.</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\"><br></p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">다음 스터디는 데이터구조에 대해서 진행할 예정이며, graph에 대해서 진행하도록 하겠습니다.</p>','2020-05-14 06:32:19.897929','group44',8715,238,'2020-05-14 06:31:17.256031','우리우리 스터디~','19:30',5,70),(424,'2020/05/14/orig/KakaoTalk_20200514_211649871.jpg','<p>multi process와 multi thread에 대해 배운 후 sync와 관련해서 배우고 있는데,sync 하는 방법과 그 예시 코드들이 이해가 잘 안가서 서로 설명해주고 답하는 시간을 가졌습니다.</p>','2020-05-14 12:37:34.743252','group62',4763,256,'2020-05-14 12:36:14.169416','OS sync 개념 설명 및 질의응답','16:00',8,58),(425,'2020/05/14/orig/A35087A0-B044-403A-8146-52ED37489C91.png','입력 신호를 detect하기 위해서 state diagram과 state table을 구하는 방법을 복습함. 자신의 노하우를 공유했음.','2020-05-14 14:43:05.640423','group25',4981,219,'2020-05-14 14:38:09.129578','논설','21:30',9,180),(426,'2020/05/15/orig/6.png','<p>통신이론 중간고사 범위 함께 복습</p><p>모르는 내용 질의 응답</p><p>예제 함께 풀기</p>','2020-05-14 17:38:57.693624','group39',9251,233,'2020-05-14 17:36:26.827392','통신이론','23:00',6,180),(427,'2020/05/16/orig/20200516_144354.jpg','<p>동기화(Synchronization)<br></p><p>1. 동기화 정의 및 배경</p><p>2. Critical Section(임계구역)</p><p>3. 피터슨</p><p>4. Lock(Spin Lock, Sleep Lock)</p><p>5. Busy waiting -&gt; Mutex, Semaphore</p>','2020-05-16 05:47:14.766376','group16',8102,210,'2020-05-16 05:41:55.330612','OS 스터디 11주차','14:00~14:45',9,45),(428,'2020/05/16/orig/KakaoTalk_20200516_214415141.png','<p class=\"MsoNormal\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n107%\">1. Synchronization – Software<o:p></o:p></span></b></p><p class=\"MsoNormal\"><span lang=\"EN-US\">- Mutual exclusion<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">- Progress<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">- Bounded waiting<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">- </span>위의<span lang=\"EN-US\"> 3</span>가지 조건을\r\n만족해야함<span lang=\"EN-US\">!<o:p></o:p></span></p><p class=\"MsoNormal\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n107%\">2. Synchronization – Hardware<o:p></o:p></span></b></p><p class=\"MsoNormal\"><span lang=\"EN-US\">- </span>단일처리기 환경에서는 단순하게 공유변수<span lang=\"EN-US\">(lock)</span>가 변경되는 동안에 인터럽트 발생 자체를 막음으로써 해결할 수 있다<span lang=\"EN-US\">.\r\n</span>그러나 다중처리기 환경에서는 <span lang=\"EN-US\">CPU </span>이용률을 매우 떨어뜨리기 때문에 적용하기 어렵다<span lang=\"EN-US\">.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">- </span>그렇기 때문에<span lang=\"EN-US\">, Atomic</span>한\r\n하드웨어 명령어들을 제공함으로써 이를 해결한다<span lang=\"EN-US\">. Ex. test-and-set, compare-and-swap<o:p></o:p></span></p><p class=\"MsoNormal\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n107%\">3. Peterson’s Solution<o:p></o:p></span></b></p><p class=\"MsoNormal\"><span lang=\"EN-US\">- 2</span>개의 공유 데이터를 통해 해결<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">- turn : </span>임계구역으로 진입할 프로세스의 순번을 나타냄<span lang=\"EN-US\"> (</span>예를들어<span lang=\"EN-US\">, turn = i </span>이면 프로세스<span lang=\"EN-US\"> Pi</span>가 임계구역에서 실행<span lang=\"EN-US\">)<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">- flag : </span>특정한 프로세스가 임계구역으로 들어갈 준비가 되었다는\r\n것을 나타냄<span lang=\"EN-US\"> (</span>예를들어<span lang=\"EN-US\">, flag[i] = true </span>이면<span lang=\"EN-US\">&nbsp; </span>프로세스<span lang=\"EN-US\">\r\nPi</span>는 임계구역에 진입할 준비가 되었다는것<span lang=\"EN-US\">)<o:p></o:p></span></p><p class=\"MsoNormal\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n107%\">4. Test and set Instruction<o:p></o:p></span></b></p><p class=\"MsoNormal\"><span lang=\"EN-US\">- CS</span>를 누가 사용하고 있으면<span lang=\"EN-US\"> :\r\ntrue, </span>아니면 <span lang=\"EN-US\">: false</span>를 반환하는게 핵심<span lang=\"EN-US\">.\r\nTread</span>가 사용하는 <span lang=\"EN-US\">H/W</span>의 연산 속도가 차이나는 경우 <span lang=\"EN-US\">starvation</span>이 발생할 수 있다<span lang=\"EN-US\">.<o:p></o:p></span></p><p class=\"MsoNormal\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n107%\">5. Compare and swap Instruction<o:p></o:p></span></b></p><p class=\"MsoNormal\"><span lang=\"EN-US\">- </span>비슷한 방식으로 작동하는 듯 <span lang=\"EN-US\">While(compare_and_swap(&amp;lock,\r\n0, 1) != 0) ;</span>에서 <span lang=\"EN-US\">CS</span>를 사용하고 있으면 <span lang=\"EN-US\">busy\r\nwaiting, </span>아니면 <span lang=\"EN-US\">lock</span>을 <span lang=\"EN-US\">true</span>로\r\n바꾸고 <span lang=\"EN-US\">CS</span>로 간다<span lang=\"EN-US\">.<o:p></o:p></span></p><p class=\"MsoNormal\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n107%\">6. Mutex Locks<o:p></o:p></span></b></p><p class=\"MsoNormal\"><span lang=\"EN-US\">- available </span>변수를 통해<span lang=\"EN-US\">\r\nLock</span>의 가용 여부 확인<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">- <a href=\"https://hongku.tistory.com/18\">https://hongku.tistory.com/18</a><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n107%\">7. Semaphore<o:p></o:p></span></b></p><p class=\"MsoNormal\"><span lang=\"EN-US\">- Counting Semaphore<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">- Binary Semaphore<o:p></o:p></span></p><p class=\"MsoNormal\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n107%\">8. Semaphore</span></b><b><span style=\"font-size:12.0pt;line-height:107%\">의\r\n특징</span></b> <span lang=\"EN-US\">: </span>이전까지의 소프트웨어 기반의 <span lang=\"EN-US\">CS solution</span>은\r\n<span lang=\"EN-US\">busy waiting </span>문제를 가지고 있다<span lang=\"EN-US\">. </span>이는 <span lang=\"EN-US\">CPU</span>를 낭비하는 것<span lang=\"EN-US\">.<o:p></o:p></span></p><p class=\"MsoNormal\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n107%\">9. Deadlock, Starvation, Priority Inversion<o:p></o:p></span></b></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span lang=\"EN-US\">- </span><a href=\"https://hongku.tistory.com/19?category=800115\" target=\"_blank\">https://hongku.tistory.com/19?category=800115</a><span lang=\"EN-US\"><a href=\"https://hongku.tistory.com/19?category=800115\"></a></span></p><p class=\"MsoNormal\">공부자료 <span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\"><a href=\"https://jhnyang.tistory.com/notice/31\">https://jhnyang.tistory.com/notice/31</a><o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\"><a href=\"https://www.youtube.com/watch?v=EdTtGv9w2sA&amp;list=PLBrGAFAIyf5rby7QylRc6JxU5lzQ9c4tN\">https://www.youtube.com/watch?v=EdTtGv9w2sA&amp;list=PLBrGAFAIyf5rby7QylRc6JxU5lzQ9c4tN</a><o:p></o:p></span></p><p class=\"MsoNormal\">동기화<span lang=\"EN-US\">(Synchronization)<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\">-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->프로세스들이 서로 동작을 맞추는 것<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\">-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->프로세스들이 서로 정보를 공유하는 것<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoListParagraphCxSpLast\" style=\"text-indent:-18.0pt;mso-list:l2 level1 lfo2\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\nmso-bidi-font-family:Wingdings\">è<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; </span></span><!--[endif]-->프로세스<span lang=\"EN-US\">(</span>스레드<span lang=\"EN-US\">)</span>들의 순서를 조절하는 것<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\">임계영역<span lang=\"EN-US\">(Critical section)<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\">-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->공유 데이터를 접근하는 코드 영역<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\">-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->한순간 반드시 프로세스 하나만 진입해야 하는데<span lang=\"EN-US\">, </span>프로그램에서\r\n임계 자원을 이용하는 부분으로 공유 자원의 독점을 보장받아야하는 코드 영역<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoListParagraphCxSpLast\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\">-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->스레드가 공유자원의 배타적인 사용을 보장받기 위해서 임계 구역에 들어가거나 나올 때에는\r\n세마포어 같은 동기화 메커니즘이 필요하다<span lang=\"EN-US\">.<o:p></o:p></span></p><p class=\"MsoNormal\">상호배제<span lang=\"EN-US\">(Mutual exclusion)<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\">-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->둘 이상의 프로세스가 동시에 <span lang=\"EN-US\">critical section</span>에\r\n진입하는 것을 막는 것<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\">문제가 발생하는 것을 막기 위해서는 기계어 명령<span lang=\"EN-US\">(machine\r\ninstruction)</span>의 특성인 <span lang=\"EN-US\">atomicity</span>를 이용해야함<span lang=\"EN-US\">.(</span>한 기계여 명령의 실행 도중에는 인터럽트 받지 않음<span lang=\"EN-US\">)<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Race condition : </span>두 개의 프로세스<span lang=\"EN-US\">(</span>스레드<span lang=\"EN-US\">)</span>가 하나의 자원을 놓고 서로 경쟁하는 것<span lang=\"EN-US\">, </span>두 개 이상의 <span lang=\"EN-US\">concurrent</span>한 프로세스<span lang=\"EN-US\">(</span>스레드<span lang=\"EN-US\">)</span>들이 공유된 자원에 접근하려고 할 때 동기화 메커니즘 없이\r\n접근하려는 상황<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Busy-wait : spinlock -&gt; CPU</span>를 사용하면서\r\n기다리고 있는 것<span lang=\"EN-US\">, </span>의미 없는 코드를 반복 수행하면서<span lang=\"EN-US\">(CPU</span>자원을\r\n사용하면서<span lang=\"EN-US\">)</span>기다리는 것<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\">중간에 인터럽트 걸리는 것 때문에 단순한 <span lang=\"EN-US\">spinlock</span>가지고는 <span lang=\"EN-US\">Mutex</span>를 보장하지 못함<span lang=\"EN-US\">.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Lock</span>을 구현하는 방법에는 <span lang=\"EN-US\">3</span>가지\r\n방법이 있음<span lang=\"EN-US\">.<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent:-18.0pt;mso-list:l3 level1 lfo3\"><!--[if !supportLists]--><span lang=\"EN-US\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->소프트웨어 알고리즘<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-18.0pt;mso-list:l3 level1 lfo3\"><!--[if !supportLists]--><span lang=\"EN-US\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->더 이상 쪼개지지 않는 하드웨어 명령어로 구현하는 방법<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoListParagraphCxSpLast\" style=\"text-indent:-18.0pt;mso-list:l3 level1 lfo3\"><!--[if !supportLists]--><span lang=\"EN-US\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->인터럽트를 <span lang=\"EN-US\">disable</span>하고 <span lang=\"EN-US\">enable</span>하는 방법<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\">소프트웨어 알고리즘<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\">피터슨 알고리즘 <span lang=\"EN-US\">(<a href=\"https://jhnyang.tistory.com/37\">https://jhnyang.tistory.com/37</a>)<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\">-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN-US\">Flag</span>와 <span lang=\"EN-US\">turn</span>이라는\r\n두개의 변수를 사용함<span lang=\"EN-US\">.<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\">-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN-US\">Flag : </span>깃발<span lang=\"EN-US\">-&gt;</span>신호<span lang=\"EN-US\">, </span>내가 이 공유자원을 쓰고 싶다 라는 것을 표현하기 위한\r\n변수<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\">-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN-US\">Turn : </span>차례를 의미<span lang=\"EN-US\">, </span>누구 차례인지 명시해주는 변수<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoListParagraphCxSpLast\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\">-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN-US\"><!--[if gte vml 1]><v:shapetype\r\n id=\"_x0000_t75\" coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\"\r\n path=\"m@4@5l@4@11@9@11@9@5xe\" filled=\"f\" stroked=\"f\">\r\n <v:stroke joinstyle=\"miter\"/>\r\n <v:formulas>\r\n  <v:f eqn=\"if lineDrawn pixelLineWidth 0\"/>\r\n  <v:f eqn=\"sum @0 1 0\"/>\r\n  <v:f eqn=\"sum 0 0 @1\"/>\r\n  <v:f eqn=\"prod @2 1 2\"/>\r\n  <v:f eqn=\"prod @3 21600 pixelWidth\"/>\r\n  <v:f eqn=\"prod @3 21600 pixelHeight\"/>\r\n  <v:f eqn=\"sum @0 0 1\"/>\r\n  <v:f eqn=\"prod @6 1 2\"/>\r\n  <v:f eqn=\"prod @7 21600 pixelWidth\"/>\r\n  <v:f eqn=\"sum @8 21600 0\"/>\r\n  <v:f eqn=\"prod @7 21600 pixelHeight\"/>\r\n  <v:f eqn=\"sum @10 21600 0\"/>\r\n </v:formulas>\r\n <v:path o:extrusionok=\"f\" gradientshapeok=\"t\" o:connecttype=\"rect\"/>\r\n <o:lock v:ext=\"edit\" aspectratio=\"t\"/>\r\n</v:shapetype><v:shape id=\"그림_x0020_1\" o:spid=\"_x0000_i1026\" type=\"#_x0000_t75\"\r\n style=\'width:451pt;height:293pt;visibility:visible;mso-wrap-style:square\'>\r\n <v:imagedata src=\"file:///C:/Users/Owner/AppData/Local/Temp/msohtmlclip1/01/clip_image001.png\"\r\n  o:title=\"\"/>\r\n</v:shape><![endif]--><!--[if !vml]--><img border=\"0\" width=\"601\" height=\"391\" src=\"file:///C:/Users/Owner/AppData/Local/Temp/msohtmlclip1/01/clip_image002.jpg\" v:shapes=\"그림_x0020_1\"><!--[endif]--></span><span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\">임계영역과 <span lang=\"EN-US\">lock</span>수행시<span lang=\"EN-US\">, </span>문제\r\n해결의 <span lang=\"EN-US\">3</span>가지 조건<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent:-18.0pt;mso-list:l4 level1 lfo4\"><!--[if !supportLists]--><span lang=\"EN-US\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->상호배제가 보존되어야 한다<span lang=\"EN-US\">. (Mutual\r\nexclusion is preserved)<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-18.0pt;mso-list:l4 level1 lfo4\"><!--[if !supportLists]--><span lang=\"EN-US\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->임계영역에 어떤 스레드의 접근이 없을 대<span lang=\"EN-US\">, </span>항상\r\n접근 가능해야한다<span lang=\"EN-US\">. (The progress requirement is satisfied)<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpLast\" style=\"text-indent:-18.0pt;mso-list:l4 level1 lfo4\"><!--[if !supportLists]--><span lang=\"EN-US\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->무한정 대기가 없어야 한다<span lang=\"EN-US\">.\r\n(Bounded-waiting requirement is met) (</span>프로세스 <span lang=\"EN-US\">starvation </span>현상<span lang=\"EN-US\">x)<o:p></o:p></span></p><p class=\"MsoNormal\">피터슨 알고리즘이 위의 <span lang=\"EN-US\">3</span>가지를 만족하는 하는 이유<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent:-18.0pt;mso-list:l1 level1 lfo5\"><!--[if !supportLists]--><span lang=\"EN-US\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->자신의 차례에만 <span lang=\"EN-US\">CS</span>에 접근할 수 있으므로 상호배제\r\n만족<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-18.0pt;mso-list:l1 level1 lfo5\"><!--[if !supportLists]--><span lang=\"EN-US\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN-US\">While(flag[j] &amp;&amp; turn\r\n== j)</span>로 아무도 사용하고 있지 않는다면 진행이 되므로<span lang=\"EN-US\"> 2</span>번조건 만족<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoListParagraphCxSpLast\" style=\"text-indent:-18.0pt;mso-list:l1 level1 lfo5\"><!--[if !supportLists]--><span lang=\"EN-US\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->피터슨 알고리즘은 다른 프로세스에 의해서 내가 실행되는 그런 알고리즘임<span lang=\"EN-US\">. </span>나 말고 다른 프로세스가 들어온다면 실행을 보장 받을 수 있음<span lang=\"EN-US\">.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">TestAndSet(TAS) : 2~3</span>줄에 걸쳐서 <span lang=\"EN-US\">Lock</span>을 실행하면 중간에 재수없이 발생하는 인터럽트 때문에 <span lang=\"EN-US\">CS</span>가\r\n보호받지 못하는데 이 녀석은<span lang=\"EN-US\"> atomic operation</span>으로써 중간에 인터럽트가 발생할 일이 없는\r\n즉 실행이 보장되는 그런 명령 입니다<span lang=\"EN-US\">. </span>하드웨어 명령어 <span lang=\"EN-US\">API</span>를\r\n이용하여 구현함<span lang=\"EN-US\">.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Ex : while(TestAndSet(lock));<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">TAS</span>의 동작 <span lang=\"EN-US\">: lock</span>이라는\r\n변수의 값을 먼저 <span lang=\"EN-US\">test</span>한다<span lang=\"EN-US\">. Test</span>란 일단 <span lang=\"EN-US\">lock</span>값이 <span lang=\"EN-US\">0</span>인지 <span lang=\"EN-US\">1</span>인지\r\n모르지만 그냥 현재 <span lang=\"EN-US\">lock </span>값을 <span lang=\"EN-US\">return</span>하고 바로 <span lang=\"EN-US\">lock</span>값을 <span lang=\"EN-US\">1</span>로 바꾸어 줌으로써 동시에 여러 스레드가 <span lang=\"EN-US\">CS</span>에 접근하는 것을 예방합니다<span lang=\"EN-US\">.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Compare-and-swap : </span>따지고 보면 <span lang=\"EN-US\">TAS</span>랑 별반 다른게 없는 녀석임<span lang=\"EN-US\">. CAS</span>는 <span lang=\"EN-US\">3</span>개의 매개변수가 있어요<span lang=\"EN-US\">. 1-lock, 2-0, 3-1 </span>이렇게 <span lang=\"EN-US\">3</span>개입니다<span lang=\"EN-US\">. CAS</span>의 리턴 값은 무조건 현재 <span lang=\"EN-US\">lock</span>의 값이 리턴 값이에요<span lang=\"EN-US\">. </span>그리고 자세히 보면 <span lang=\"EN-US\">CAS</span>는 <span lang=\"EN-US\">lock</span>값이 <span lang=\"EN-US\">0</span>일때만\r\n반응을 하는 알고리즘입니다<span lang=\"EN-US\">. Lock</span>이 <span lang=\"EN-US\">0</span>이라는거는 현재\r\n<span lang=\"EN-US\">CS</span>에 있는 스레드가 없다는 소리니까 일단 <span lang=\"EN-US\">lock</span>값을 반환하고\r\n<span lang=\"EN-US\">lock</span>값을 <span lang=\"EN-US\">1</span>로 바꿔줍니다<span lang=\"EN-US\">. lock</span>값이 <span lang=\"EN-US\">1</span>일때는 현재 <span lang=\"EN-US\">CS</span>에\r\n누가 있다는 소리죠<span lang=\"EN-US\">? </span>그니까 리턴 값은 <span lang=\"EN-US\">1</span>입니다<span lang=\"EN-US\">.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Ex : while(compare_and_swap(&amp;lock,0,1)\r\n!=0);<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">[</span>이건 저도 정확히 모르겠음<span lang=\"EN-US\">]<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">TAS</span>나 <span lang=\"EN-US\">CAS</span>만 사용해서\r\n잘 끝나면 좋은데 저 경우에는 <span lang=\"EN-US\">Bounded-Waiting mutual exclusion</span>이 발생한다고\r\n함<span lang=\"EN-US\">. <o:p></o:p></span></p><p class=\"MsoNormal\">교수님 강의<span lang=\"EN-US\">(<a href=\"https://youtu.be/-IM1QTMwIQg?t=3209\">https://youtu.be/-IM1QTMwIQg?t=3209</a>)</span>를\r\n보면 <span lang=\"EN-US\">lock </span>변수를 <span lang=\"EN-US\">volatile</span>로 선언한 이유가 무엇인지\r\n잘 모르겠음<span lang=\"EN-US\">.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Bounded-Waiting mutual exclusion</span>란<span lang=\"EN-US\">? – </span>모든 프로세스가 <span lang=\"EN-US\">cs</span>에 균등하게 들어갈 기회를 받지 못하고<span lang=\"EN-US\"> starvation </span>발생하는 경우를 말함<span lang=\"EN-US\">.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\"><!--[if gte vml 1]><v:shape\r\n id=\"그림_x0020_2\" o:spid=\"_x0000_i1025\" type=\"#_x0000_t75\" style=\'width:451.5pt;\r\n height:396pt;visibility:visible;mso-wrap-style:square\'>\r\n <v:imagedata src=\"file:///C:/Users/Owner/AppData/Local/Temp/msohtmlclip1/01/clip_image003.png\"\r\n  o:title=\"\"/>\r\n</v:shape><![endif]--><!--[if !vml]--><img border=\"0\" width=\"602\" height=\"528\" src=\"file:///C:/Users/Owner/AppData/Local/Temp/msohtmlclip1/01/clip_image004.jpg\" v:shapes=\"그림_x0020_2\"><!--[endif]--></span><span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Semaphore<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p>','2020-05-16 12:46:36.095634','group45',2195,239,'2020-05-16 12:43:22.462319','Synchronization','20:40',9,65),(429,'2020/05/16/orig/0A7B66A1-1B6C-42EA-9B3E-92615C155DCF.png','최소비용 신장트리에 대해서 공부함','2020-05-16 13:13:20.089693','group10',2157,204,'2020-05-16 13:09:31.398346','알고리즘 mst','20:00',5,120),(430,'2020/05/16/orig/20200516.JPG','<p><img src=\"/upload_files/django-summernote/2020-05-16/580a5cf3-437d-49fb-8415-dc5bb3d1a5f0.png\" style=\"width: 1341px;\"></p><p><br></p><p>1. 대부분의 과목들 중간 고사를 끝낸 후 다시 운영체제 과목 스터디를 진행하였습니다.</p><p>2. 지난 시간 4단원 쓰레딩 개념 스터디 이후 하지 못했던 5단원과 6단원 공부를 각자 한명씩 맡아 공부를 해서 진행하는 식으로 모임을 가졌습니다.</p><p>3. Busy waiting 이라는 개념이 모두 헷갈렸는데 이를 따로 찾음으로 제대로 공부할 수 있었습니다.</p><p><br></p><p><img src=\"/upload_files/django-summernote/2020-05-16/2a111c36-e9f6-443c-84b6-c5ad3046a562.png\" style=\"width: 1341px;\"><br></p>','2020-05-16 13:17:10.409167','group34',3689,228,'2020-05-16 13:12:12.774574','#7 OS chapter 5, 6 (CPU Scheduling and Synchronization) review','2100',8,70),(431,'2020/05/17/orig/1589646709708.png','곧 있을 대경권 대학생 프로그래밍 대회 준비를 어떤식으로 진행하고 준비를 해야할지 나누었고 매주 백준에서 어떤문제를 풀지 나눴다','2020-05-16 16:37:09.206564','group17',8602,211,'2020-05-16 16:31:21.638274','20년 대경권 대학생 프로그래밍 대회 경진대회 준비','23:00',5,92),(432,'2020/05/17/orig/20200517.jpg','<p>운영체제 6단원 문제풀이 및 복습</p>','2020-05-17 07:54:23.279342','group63',6075,257,'2020-05-17 07:52:26.417315','운영체제 복습','12:00',4,180),(433,'2020/05/17/orig/KakaoTalk_Image_2020-05-17-21-09-03.png','<p>Nucleo-F441RE모델의 MPU와 보드의 특징과</p><p>DigitalInOut</p><p>InterruptInout</p><p>BusInOut</p><p>PortInOut 등의 입출력 방식을 공부함</p><p>LAB1의 코드들과 문제들을 통해서</p><p>이해함</p><p><br></p>','2020-05-17 12:11:31.820340','group20',NULL,214,NULL,'임베디드 시스템 - N0, N2','20:00',3,60),(434,'2020/05/17/orig/08-20200517-2100-2200.png','<p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">범위: OS - chapter 4.1 ~ chapter 4.4 + chapter 4.6 (교재 범위)</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">1) 무작위로 2명을 선정하여 나머지 인원들에게 강의 형식으로 발표</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\"></p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\"></p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\"></p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">2) 전체 내용을 다시 한 번 되짚으며 복습 및 관련 내용 상호간 QnA</p>','2020-05-17 12:14:50.956899','group58',4251,252,'2020-05-17 12:10:55.148562','OS chapter 4 review','20:00',8,60),(435,'2020/05/17/orig/2020-05-17_7.png','<p>오늘은 sorting 과 graph 에대한 개념 설명을 했습니다.</p><p><br></p><p>서로에게 생소한 개념이라 개념 설명부터 예제풀이까지 하면서,&nbsp; 서로에게 도움이 되고자 했습니다.&nbsp;</p><p><br></p><p>부족한 부분을 서로 채우며, 발전하는 모습들을 보여드리겠습니다.</p>','2020-05-17 12:52:13.751741','group44',4396,238,'2020-05-17 12:49:24.882596','최.강.스.터.디','20:00',6,146),(436,'2020/05/17/orig/KakaoTalk_20200517_225541247.png','<p>Latch 와 Flip-Flop을 리뷰했습니다. 곧 있을 퀴즈를 준비하며 서로 다시 컨셉을 공부하며 교수님께서 올려주신 examples을 같이 풀고 풀이를 공유했습니다.<br>Data을 저장하는 System을 공부하며 어려움을 많이 겪었습니다. 특히, time diagram을 공부하는 데에 많은 어려움이 있었습니다.&nbsp;<br>함께 공부하며 다음 스터디 시간에 time diagram에 대해 더 많이 알아와 정보를 공유하기로 했습니다.</p>','2020-05-17 14:01:04.068308','group48',8904,265,'2020-05-17 13:53:59.312658','Latch & Flip-Flop 리뷰','21:00',7,110),(437,'2020/05/18/orig/1589743050347.png','Tree의 구조와 용어, 기본적인 함수들을 공부함. 또한 그 함수들의 코딩을 분석하며 recursive와 iteration 방식을 익힘','2020-05-17 19:20:07.389958','group21',2370,215,'2020-05-17 19:16:38.000223','Tree','23:20',7,300),(438,'2020/05/18/orig/KakaoTalk_Photo_2020-05-18-17-01-00.png','<p>\r\n		\r\n	\r\n	\r\n		</p><div class=\"page\" title=\"Page 2\">\r\n			<div class=\"section\">\r\n				<div class=\"layoutArea\">\r\n					<div class=\"column\">\r\n						<p><span style=\"font-size: 16.000000pt; font-family: \'OpenSans\'; font-weight: 700; color: rgb(20.000000%, 20.000000%, 20.000000%)\">NVIC_ISER(Interrupt Set-Enable Register),\r\nNVIC_ICER(Interrupt Clear-Enable Register)\r\n</span></p>\r\n						<p><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">주변기기의 각 </span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">IRQ</span><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">신호를 활성화 혹은 비활성화 시키기 위하여 사용된다</span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">. 0</span><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">을 쓰면 기존 상태에 영향을 주지않고 이전\r\n상태 유지</span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">.\r\n</span></p>\r\n						<p><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">82</span><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">개의 </span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">IRQ</span><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">신호를 제어해야하기 때문에 각각 </span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">3</span><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">개의 </span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">NVIC</span><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">들이 존재</span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">.\r\n</span><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">사용 예</span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">)<br>\r\nNVIC-&gt;ISER[0] = 1<br>\r\nNVIC-&gt;ICER[0] = 1\r\n</span></p>\r\n						<p><span style=\"font-size: 16.000000pt; font-family: \'OpenSans\'; font-weight: 700; color: rgb(20.000000%, 20.000000%, 20.000000%)\">NVIC_ISPR(Interrupt Set-Pending Register),\r\nNVIC_ICPR(Interrupt Clear-Pending Register)\r\n</span></p>\r\n						<p><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">소프트웨어를 이용하여 어떤 인터럽트를 요청하거나 혹은 요청된 인터럽트를 해제시키는 데 사용된다</span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">. </span><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">얘를 읽었을\r\n때</span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">, </span><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">어떤 비트가 </span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">\'1\'</span><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">이면 해당 </span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">IRQ</span><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">가 팬딩</span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">(pending)</span><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">된 상태</span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">. (pending : </span><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">인터럽트가 살생하였지만 아직 해당 </span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">ISR</span><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">가\r\n처리되지 못한 상태를 의미</span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">)\r\n</span></p>\r\n						<p><span style=\"font-size: 16.000000pt; font-family: \'OpenSans\'; font-weight: 700; color: rgb(20.000000%, 20.000000%, 20.000000%)\">NVIC_IABR(Interrupt Active-Bit Register)\r\n</span></p>\r\n						<p><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">어떤 비트가 </span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">\'1\'</span><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">이면 해당 인터럽트가 액티브 상태임을 나타낸다</span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">.\r\n</span><span style=\"font-size: 16.000000pt; font-family: \'OpenSans\'; font-weight: 700; color: rgb(20.000000%, 20.000000%, 20.000000%)\">NVIC_IPR(Interrupt Priority Register)\r\n</span></p>\r\n						<p><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">각 인터럽트에 대한 우선순위를 설정하는 레지스터</span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">. Cortex-M</span><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">에서의 우선순위 값은 </span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">0~255</span><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">까지 가능하기 때문에 하\r\n나의 인터럽트에 대한 우선순위를 결정하기 위해서는 </span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">8</span><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">비트가 필요</span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">.\r\n</span></p>\r\n						<p><span style=\"font-size: 10.000000pt; font-family: \'ZapfDingbatsITC\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">✤</span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">STM32F4xx</span><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">에서는 상위 </span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">4</span><span style=\"font-size: 10.000000pt; font-family: \'AppleSDGothicNeo\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">비트만을 우선순위 설정에 사용하도록 설계</span><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\">.&nbsp;</span></p><p><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\"><br></span></p><p><span style=\"font-size: 10.000000pt; font-family: \'OpenSans\'; color: rgb(20.000000%, 20.000000%, 20.000000%)\"><br></span></p>\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</div>','2020-05-18 08:01:34.389380','group20',9857,214,'2020-05-18 07:56:43.531230','NVIC','16:00',4,60),(439,'2020/05/18/orig/2020-05-18.png','<p>mvc 패턴에 대한 정의와 예시를 주제로 스터디를 진행하였습니다.</p><p>다음주에는 프로젝트에 패턴을 적용하는 방법에 대해 알아볼 예정입니다.</p>','2020-05-18 09:44:59.736038','group24',NULL,218,NULL,'2020-05-18','16:00',8,60),(440,'2020/05/18/orig/F09AA83A-F063-40A0-860E-BD65F3E6C8A6.jpeg','가상의 데이터베이스 시스템을 종합적으로 분석해 보고 평가해 보았습니다. 각 테이블 간의 relationships에서 key위 역할이 많은 중요도를 갖는다는 것을 배웠고, ERD와 실제 DB 스키마를 비교하는 것도 연습할 수 있었습니다.','2020-05-18 10:08:14.472702','group61',9564,255,'2020-05-18 10:04:43.762283','6일차','18:00',6,60),(441,'2020/05/19/orig/KakaoTalk_Photo_2020-05-19-20-19-41.png','<p><img src=\"/upload_files/django-summernote/2020-05-19/b48a28d2-57c5-47bf-8049-7a9ec03107e1.jpeg\" style=\"width: 720px;\"><img src=\"/upload_files/django-summernote/2020-05-19/91574f60-d87b-4a0b-a54b-1a6de82b0420.png\" style=\"width: 1260px;\"><img src=\"/upload_files/django-summernote/2020-05-19/eb66e565-6a78-48ff-960e-95a2d23bbe36.png\" style=\"width: 1260px;\"><img src=\"/upload_files/django-summernote/2020-05-19/4c37ae39-00fb-45af-91db-30f8c7f78ef7.png\" style=\"width: 1260px;\"><img src=\"/upload_files/django-summernote/2020-05-19/b8f28d4c-abcb-44ff-9531-541c5c8e98a9.png\" style=\"width: 1260px;\"><br></p>','2020-05-19 11:22:08.501633','group60',4281,254,'2020-05-19 11:17:31.191814','로직디자인 (15,16,17강)','19:00',21,80),(442,'2020/05/19/orig/group55_study6.jpeg','<p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">10주차 목요일 수업내용</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">11주차 목요일 수업내용</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">12주차 월요일 수업내용</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">각자 정리해 온 파트를 설명해주고 질의응답하는 시간을 가졌습니다.</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">보이스톡을 이용했습니다.</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\"><br></p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">다음시간부터는 내용정리와 예상문제 만들어오기를 함께 진행하기로 했습니다.</p>','2020-05-19 11:49:14.239806','group55',7201,249,'2020-05-19 11:45:53.034753','Operating System 10주차 목 - 12주차 월','20:00',6,45),(443,'2020/05/19/orig/KakaoTalk_20200519_202709266.png','<p>1. 6단원에서 LT 혹은 CT를 구할 때 short circuit의 위치 구하는 회로 분석</p><p>2. inductance in the Network에서 Leq 값 구하는 회로 분석</p><p>3. RLC회로 분석 및 이 회로를 표현하는 equation 알아보기.&nbsp;</p>','2020-05-19 12:23:30.901171','group40',2183,234,'2020-05-19 12:23:30.676707','3번째 중간고사 전 6, 7 단원 정리','20:00',7,70),(444,'2020/05/20/orig/2020-05-20.png','<p><img src=\"/upload_files/django-summernote/2020-05-20/92fe17ac-549b-49f9-8988-0760158c4f78.jpeg\" style=\"width: 720px;\"><img src=\"/upload_files/django-summernote/2020-05-20/95552063-a58b-4bb9-baef-a161c43dc264.jpeg\" style=\"width: 960px;\"><img src=\"/upload_files/django-summernote/2020-05-20/99e7c8a9-e5b9-4e96-a808-d71c8815ae67.jpeg\" style=\"width: 720px;\"><br></p>','2020-05-20 02:47:15.851084','group60',2381,254,'2020-05-20 02:44:00.832542','로직디자인 (15,16,17 복습, 18강)','10:00',22,105),(445,'2020/05/20/orig/1589945711172.png','>>>\r\nSorting 관련 예제문제들 함께 풀며 토의.\r\n\r\nBubble sort를 집중적으로 공부.','2020-05-20 03:36:22.013998','group35',8952,229,'2020-05-20 03:34:49.956623','7차 스터디 보고서','11:30',7,60),(446,'2020/05/20/orig/1589946736258.jpg','회로이론 chapter6,7 이론 복습, 연습 문제 풀이\r\nLogic Design 연습 문제 풀이','2020-05-20 03:54:01.766885','group29',NULL,223,NULL,'5/20','11:00',11,90),(447,'2020/05/20/orig/KakaoTalk_20200506_200935304.png','<p>논리설계 시험 전날 하게된 스터디였다.</p><p>시험범위는 1~5단원이었기 때문에 각자 분야를 맡아 그 부분을 설명해주기로 했다.</p><p>1~2단원은 하은이가 3~4단원은 윤서가 그리고 5단원은 예안이가 맡았다.</p><p>우리는 각자의 단원에 대해 주의깊게 보고 넘어가야 할 부분, 교수님이 중요하다고 말해주신&nbsp; 부분, 이건 꼭 나온다는 부분 등을&nbsp;</p><p>공부한 내용에 맡게 설명해주었다,</p><p>그리고 그 친구가 설명한 것 외에도 자신이 생각하기에 중요한 부분들에 대해서 짚고 넘어가주었다,</p><p>특히 예안이는 자신이 직접 정리한 종이를 사진으로 나누어주는 정성도 보여주었다.</p><p>스터디까지 신청하며 열정적으로 공부한 과목인만큼 목표도 정하기로 했는데</p><p>각자 설정한 목표를 이루지 못하면 서로에게 아이스크림을 사주기로 했다.&nbsp;</p><p>다음날 치게 될 시험에 대해 화이팅을 한 후 스터디모임을 끝냈다.</p>','2020-05-20 04:21:29.320032','group2',NULL,196,NULL,'0506 모임7','8:00',9,90),(448,'2020/05/20/orig/1589953763721.png','I2C와 DMA,에 대해서 모르는 내용과 랩 진행 방식에 대해서 의논하였다','2020-05-20 05:50:54.040645','group6',6075,200,'2020-05-20 05:46:09.767234','임베디드 I2C DMA','13:50',5,60),(449,'2020/05/20/orig/06ABA2DF-3E3E-4B22-810D-91F3941EF680.png','논리설계 퀴즈준비\r\n라즈베리파이 세팅','2020-05-20 09:07:52.190181','group3',8760,197,'2020-05-20 09:05:09.401838','8번째 스터디','17:30',9,36),(450,'2020/05/20/orig/978FA345-33BE-4461-B7FC-53F6F8744332.png','브랜치앤바운드 알고리즘에 대한 분석 및 토의\r\n퀴즈공부','2020-05-20 11:42:41.233968','group49',2706,243,'2020-05-20 11:33:09.145998','알고리즘','19:00',8,100),(451,'2020/05/20/orig/978FA345-33BE-4461-B7FC-53F6F8744332_zR202SK.png','브랜치앤바운드 알고리즘에 대한 분석 및 토의\r\n퀴즈공부','2020-05-20 11:42:45.485590','group49',8354,243,'2020-05-20 11:42:45.473119','알고리즘','19:00',9,100),(452,'2020/05/20/orig/2020-05-20_3.png','<p>오늘은 논리설계 module 19, 21 그리고, 데이터구조 quick sorting 에 대하여 개념이 잘 안 잡혀있는 것 같아서</p><p><br></p><p>위 사항들을 중점적으로 스터디를 진행했습니다. 문제와 개념 설명을 병행하여 스터디가 원활하게 진행되었고,&nbsp;</p><p><br></p><p>다른 더 좋은 스터디 방식은 없는지에 대해서도 토론을 해보았습니다. 모두 수고하셨습니다!</p>','2020-05-20 12:51:33.614571','group44',8596,238,'2020-05-20 12:45:01.458152','훈훈한 스터디','20:00',7,105),(453,'2020/05/20/orig/grou3610.jpg','<p>오늘은 오픈소스소프트웨어 강의 영상에서 배웠던 Raspberry Pi Server에 대해서 복습하는 시간을 가졌습니다.<br>정상적으로 server에 들어가고 새로운 html 을 만들며, 웹 브라우저에서 정상적으로 설정한 값이 나오는지 확인도 하였습니다.</p><p>개인 서버를 만들 수 있다는 것에 신기하면서도 재밌는 시간이었습니다.</p>','2020-05-20 13:01:22.689290','group36',7315,230,'2020-05-20 12:57:06.744058','10번째 스터디','21:00 ~ 22:00',10,60),(454,'2020/05/20/orig/B94E6543-F1C0-41FE-9A10-84DC270CBC7C.jpeg','1. 15강 Latches 모르는 개념 문답\r\n2. 16강 FlipFlops 모르는 개념 문답\r\n3. 16강 FlipFlops exercise 돌아가며 문제 풀기\r\n4. 18강 Analysis of Sequential System 문제풀기','2020-05-20 13:03:53.288195','group13',4180,207,'2020-05-20 12:58:52.868929','[Logic Design] 그룹 스터디 6','20:30',7,75),(455,'2020/05/21/orig/2020-05-21.png','<p><img src=\"/upload_files/django-summernote/2020-05-21/4371eaf3-be76-4bfb-99ae-fa17adaa429b.png\" style=\"width: 1275px;\"><br></p>','2020-05-21 11:23:50.604541','group60',2301,254,'2020-05-21 11:20:28.430787','로직디자인 18강','19:00',23,70),(456,'2020/05/21/orig/1590069358526.png','Flip flop , timing trace 에 관하여 예제 문제들을 같이 풀어보았습니다~! 다들 퀴즈 화이팅(๑°o°๑)','2020-05-21 13:57:49.270954','group64',9482,258,'2020-05-21 13:54:16.113595','논리설계 16,17','21:30',6,85),(457,'2020/05/21/orig/Screenshot3.png','<p>내일 있을 퀴즈를 대비해 범위에 포함하고 있는 Latch, Flip Flop, Timing graph &amp; table, State table &amp; diagram을 함께 스터디하는 시간을 가졌습니다.</p><p>그 중 State table &amp; diagram을 설계하는 부분에 있어 많은 어려움을 겪어 8개의 Examples을 함께 풀어보면서 서로 아는 것을 공유하는 시간을 가졌습니다.</p><p>처음 접하는 Sequential System이다 보니 많은 어려움을 겪오 헷갈렸던 부분들이 많았습니다. 어려운 부분은 함께 다시 강의 자료를 리뷰하면서 정답을 찾아가려고 했습니다.</p><p>또한, False output의 경우에는 많은 어려움을 겪어 구글링을 통해 정보를 직접 찾아가며 문제를 풀었습니다.</p><p>퀴즈를 대비하는 좋은 시간을 가졌습니다.</p>','2020-05-21 14:46:23.143542','group48',7586,265,'2020-05-21 14:39:49.924564','Analysis of Sequential Systems 및 퀴즈 리뷰','22:00',8,100),(458,'2020/05/22/orig/KakaoTalk_20200514_211650111.jpg','<p>선형대수학 중간고사를 대비하여 요즘 배우고 있는 직교와 대각화, 미분방정식을 선대로 푸는 것 등에 대해 모르는 것을 서로 질의응답하는 시간을 가져보았습니다.</p><p>알고리즘 퀴즈를 대비하여 여러 그래프 개념 중에 이해 안가는 부분을 서로 질문하는 시간을 가졌습니다.</p>','2020-05-21 23:59:01.914354','group62',8796,256,'2020-05-21 23:57:05.504727','알고리즘 퀴즈와 선형대수학 중간고사 대비','16:00',9,55),(459,'2020/05/22/orig/1590156964315.png','Pthread에서 stack을 제외한 모든 데이터를 process내에서 공유한다.\r\n\r\nPthread_create\r\nPthread_mutex_lock()\r\nPthread_mutex_unlock()\r\n\r\n등과 같이 pthread의 기본적인 api를 배웠다.','2020-05-22 14:22:01.091703','group17',2574,211,'2020-05-22 14:14:08.317854','OS thread 관련 질문','2200',6,60),(460,'2020/05/23/orig/KakaoTalk_20200523_152059213.png','<p>이번 주 OS 수업과 관련해서 정리해보았습니다.</p><p>Synchronization Classical Problem + Deadlock에 대해서 다루었습니다.</p>','2020-05-23 06:23:18.286265','group16',4218,210,'2020-05-23 06:17:48.973348','OS 12주차 강의 정리','2:30',10,51),(461,'2020/05/23/orig/KakaoTalk_20200523_205319322.png','<p>Deadlock</p><p>- 락을 걸어야 하는 조건이 없으면 문제를 해결할 수 있음.&nbsp;</p><p>- 하나를 가지고 있을 때에 다른 것을 요구하지 않는 경우.&nbsp;</p><p>- 남의 것을 빼앗음.&nbsp;</p><p>- 순환 대기가 일어나지 않도록</p><p>예방법, 회피, 탈지, 복구의 방법이 있다.</p>','2020-05-23 11:55:07.432715','group45',4597,239,'2020-05-23 11:51:23.775092','Deadlock','20:00',10,70),(462,'2020/05/23/orig/1.png','<p>다음주 퀴즈와 IC Amplifier에 대해서 공부하는 시간을 가졌다. integrated 회로는 생각보다 복잡해보이지만 원리를 알면 쉬웠다. 다만 원리를 이해하기가 어려웠지만</p><p>여러 강의 노트와 인터넷 자료들을&nbsp; 같이 공부해가면서 도움이 되었다.</p>','2020-05-23 13:39:13.594117','group57',7214,251,'2020-05-23 13:37:24.574287','다음주 퀴즈 대비 및 새로 배운 내용 복습','20:00',7,120),(463,'2020/05/24/orig/KakaoTalk_20200524_000837037.png','<p>IC design인 ch7에서 CS와 CE 증폭기에 대한 공부를 같이 하였습니다.</p>','2020-05-23 15:10:17.972244','group11',8249,205,'2020-05-23 15:05:30.344128','전자회로1','22:00',6,120),(464,'2020/05/24/orig/1590255340137.png','이번주는 시험이 끝난 후 처음으로 하는 스터디였기 때문에 중간고사 범위에 안 들어갔던 6단원의 문제들을 풀어오는 것이었다. 각자 풀어올 문제를 정해서 풀어오는 방식이었다. 하은, 예안, 윤서의 순서로 돌아가면서 1번부터 풀어오는 것으로 결정했었고 본인이 맡은 문제가 아니더라도 문제를 읽어오기로 했다. 모두가 문제를 풀어왔고 또 읽어왔다. 각자 돌아가면서 본인 푼 문제를 설명해주었고 스스로 이상했던 점들은 다 같이 머리를 맞대어 고민한 후 해결하였다. 모두가 철저하게 준비해온 덕분에 금방 끝낼 수 있었다.','2020-05-23 17:36:13.437029','group2',NULL,196,NULL,'0520 모임8','20:00',10,40),(465,'2020/05/24/orig/KakaoTalk_20200524_165040889.jpg','<p>운영체제 6단원 복습 및 7단원 복습&nbsp;</p>','2020-05-24 07:53:00.928722','group63',5213,257,'2020-05-24 07:52:06.665286','운영체제 토론','2020-05-24',5,180),(466,'2020/05/24/orig/2020-05-24_7.png','<p>오늘은 avl, 그리고 sort에 대한 전반적인 부분을 다뤘습니다.</p><p>avl 에 대해서 이해가 되지 않는 부분이 많아서 다음에 다시 다루기로 하였습니다.</p><p><br></p>','2020-05-24 12:23:56.761911','group44',5389,238,'2020-05-24 12:22:20.848706','멋진 스터디','20:00',8,82),(467,'2020/05/24/orig/sa.png','<p>알고리듬 수업 11주차 강의에 대한 리뷰를 하였습니다.&nbsp;</p>','2020-05-24 14:51:00.502842','group32',6325,226,'2020-05-24 14:49:24.617025','9번째 스터디','21:00',9,60),(468,'2020/05/25/orig/KakaoTalk_Photo_2020-05-25-00-23-01.png','<p>줌을 키고 각자 스터디 하는 시간을 가졌습니다.&nbsp;</p><p><br></p><p>조완서 -시험 공부</p><p>정수산나- 과제</p><p>김수현 - 수업 영상 시청</p><p><br></p><p>그리고 각자 하다가 궁금한 점을 질문하면서 스터디를 진행했습니다.</p>','2020-05-24 15:23:36.604205','group5',2867,199,'2020-05-24 15:18:25.402526','DAY6','11:15~ 12:30',6,75),(469,'2020/05/25/orig/KakaoTalk_20200525_015338313.png','<p>다가오는 금요일 전자회로 1 quiz 준비를 위해서 함께 공부하였습니다.</