05_27.jpg','<p>오늘은 오픈소스소프트웨어실습 수업과 관련된 공부를 했다.</p><p>라즈베리파이를 이용해 서버를 만드는 것과 레이아웃을 변경하는 등 예제를 해보았다.</p><p>생각보다 복잡했지만 많은 도움이 되었다.</p>','2020-05-27 13:03:10.801993','group36',8154,230,'2020-05-27 12:58:41.450984','11번째 스터디','21:00',11,60),(489,'2020/05/27/orig/B05313F0-E021-4F43-8789-A7DC0178B4AE.png','강의 PPT를 보며, 개념을 하나씩 복습하였음.\r\n\r\nArrayList, HashSet, HashMap, Iterators, Generics 등의 새로운 개념들 이 각각이 무엇인지 어떻게 활용하는 것인지 전반적으로 살펴봄.','2020-05-27 13:34:03.386799','group46',NULL,240,NULL,'Dynamic data structures and generics','21:00',8,60),(490,'2020/05/28/orig/0EFFC626-66AD-4F5D-91D2-089DA1C0CB37.png','>>> 동차미분방정식에 대해 복습하였고, First - and Second - order Transisent Circuits의 예제 문제들에 대해 풀어봄','2020-05-27 15:04:57.199241','group35',5098,229,'2020-05-27 15:01:21.951104','회로이론 스터디 1차','22:30',9,95),(491,'2020/05/28/orig/596D759D-DD14-4CC1-8FC1-6402F22B2BF8.png','주어진 state table을 가지고 회로를 만드는 팁을 공유했다','2020-05-28 14:06:50.764711','group25',5837,219,'2020-05-28 13:59:35.239347','논설','22:00',10,60),(492,'2020/05/29/orig/KakaoTalk_20200514_211650372.jpg','<p>이번에 배우고 있는 주제들이 어려워서 서로 개념을 설명해주며 공부하는 시간을 가졌습니다.</p>','2020-05-29 03:21:27.014153','group62',4351,256,'2020-05-29 03:20:23.791035','OS deadlock, DB buffer management 공부','16:00',10,59),(493,'2020/05/29/orig/DC1AFACE-0B92-484E-A240-DA84EDAF85B2.png','Design Process of Sequential Systems-Part II 개념 복습 및 예제','2020-05-29 06:42:50.902839','group13',8346,207,'2020-05-29 06:39:46.364751','[Logic Design] 그룹스터디7','3:20',9,20),(494,'2020/05/29/orig/5783.png','<p><img src=\"/upload_files/django-summernote/2020-05-29/dba367e3-53c1-4b6c-b54e-efb930b62055.png\" style=\"width: 1275px;\"><img src=\"/upload_files/django-summernote/2020-05-29/25b46231-3ca8-43d7-a5d7-c79058f77bf3.png\" style=\"width: 1275px;\"><img src=\"/upload_files/django-summernote/2020-05-29/c97c94bc-b519-4355-a72f-b9c6de4e6d51.png\" style=\"width: 1275px;\"><br></p>','2020-05-29 10:24:57.647494','group60',5783,254,'2020-05-29 10:24:17.691249','자바 복습','22:00',25,300),(495,'2020/05/29/orig/1590758266746.png','DB 수업에서 질문에 대해 서로 응답하고 이해하는 시간을 가졌다','2020-05-29 13:34:36.485161','group17',NULL,211,NULL,'DB에 대해 공부를 했다','9:00-10:00',7,60),(496,'2020/05/29/orig/KakaoTalk_20200529_232127002.png','<p>중간고사와 퀴즈 리뷰를 했습니다. Sequential Systems 문제에 많은 어려움이 있어 그 부분은 집중적으로 공부했습니다.<br>Flip-Flops은 다양한 종류에 대해 리뷰를 하며 교수님께서 제공해주신 examples 문제들을 다시 함께 풀었습니다.<br>단계가 나누어져있어서 복잡하지만 천천히 한 단계씩 해나가다 보면 문제를 풀 수 있었습니다.<br>이번 시간에서 배운 sequential systems implementation 방법에 대해 다시 리뷰를 하며 examples 문제들을 풀어봤습니다.</p><p><br></p>','2020-05-29 14:27:55.510877','group48',8470,265,'2020-05-29 14:20:00.097175','중간고사 및 퀴즈 리뷰','22:00',9,60),(497,'2020/05/29/orig/KakaoTalk_Photo_2020-05-29-23-39-12.png','<p>이번에 보았던 알고리즘 퀴즈 리뷰를 다같이 진행한 후, 그래프 강의 내용을 복습했습니다.<br></p>','2020-05-29 14:39:40.698167','group51',2681,245,'2020-05-29 14:33:24.176502','알고리즘 퀴즈 리뷰 및 그래프 강의 내용 스터디','22:30',5,60),(498,'2020/05/30/orig/7905.png','<p><img src=\"/upload_files/django-summernote/2020-05-30/f85bd87c-d6c6-480d-b25b-b1ac91f7f083.jpeg\" style=\"width: 720px;\"></p><p><br></p>','2020-05-30 02:10:05.558346','group60',7905,254,'2020-05-30 02:06:48.311511','로직디자인 19강 복습, 20강 진도','9:58',26,69),(499,'2020/05/30/orig/20200530-1600-1700.PNG','<p>8강(Deadlock) 복습</p><p>- Deadlock prevention, Deadlock avoidance, Deadlock detection 등의 내용을 복습하였습니다.</p>','2020-05-30 05:06:53.536177','group19',2680,213,'2020-05-30 05:05:15.361784','열번째 스터디 그룹 모임(5월 29일)','16:00',12,57),(500,'2020/05/30/orig/F5A413A2-B81C-400C-82B0-EA56567626CC.png','>>논리 설계\r\n1. K-map 예제 문제 풀이 \r\n2. conversion of form 예제 문제 풀이\r\n3. Analysis of combination systems의 타이밍 그래프 그리는 법 공부와 예제 문제 풀이를 통한 점검 \r\n4. 다음 스터디 일정과 진도 체크','2020-05-30 05:38:15.838612','group35',2817,229,'2020-05-30 05:37:01.585941','논리설계 스터디 1차','13:00',10,90),(501,'2020/05/30/orig/KakaoTalk_Photo_2020-05-30-19-12-06.png','<p>13주차 내용 복습</p><p>교수님의 소스코드 분석 + Data Race and Build 에 대한 개념 정리</p>','2020-05-30 10:12:17.668712','group16',NULL,210,NULL,'OS 11주차','14:30-15:37',11,65),(502,'2020/05/31/orig/06-20200530-2100-2220.PNG','<p>Java Programming 수업의 HW4를 대비하여</p><p>ArrayList와 HashMap 개념에 대해서 공부하였음.</p>','2020-05-30 15:19:25.359471','group27',5182,221,'2020-05-30 15:18:11.874946','20200530-21:00-22:20','21:00',6,80),(503,'2020/05/31/orig/study.jpg','<p>운영체제 7장 및 8장 복습 후 서로 토론하기.</p><p>그리고 나올만한 문제 정리하기.</p>','2020-05-31 05:09:23.063819','group63',8456,257,'2020-05-31 05:03:58.338685','운영체제 7장 및 8장 복습','11:00',6,180),(504,'2020/05/31/orig/07-20200531-2100-2200.PNG','<p>데이터 구조 heap 개념과 complete binary tree, 그리고 heap sort에 대해서 공부했음.</p>','2020-05-31 13:03:20.432792','group27',1573,221,'2020-05-31 13:02:09.711068','20200531-21:00-22:00','21:00',7,60),(505,'2020/06/01/orig/20200601.png','<p>1. 요즘 3명 다 바빴기 때문에 9시에 모여서 서로 근황을 나누고 곧바로 OS 이야기를 시작했습니다.</p><p>2. OS 시험을 어떻게 준비해야 할지에 대해 이야기를 나누고, 이번 시험의 범위가 과제 중심으로 나오기 때문에 각자 과제에서 어떤 부분이 막혔는지, 어떤 부분을 보완하면 좋을지에 대해 논의해보았습니다.</p><p>3. 이번 homework 4와 관련하여 memory management 개념이 어떻게 사용되고 있는지 요구사항이 뭔지 체크하고 함께 강의를 시청했습니다.&nbsp;</p>','2020-06-01 13:29:34.005463','group34',1465,228,'2020-06-01 13:24:26.777377','#8 OS study : memory management and build: preprocessor, compilation','2100',9,65),(506,'2020/06/01/orig/KakaoTalk_Photo_2020-06-01-22-53-58.png','<p>1 Critical Path(ch 22 119pg)</p><p>2 Articulation Point(ch 22, 139pg)</p><p>3 SCC(ch 22 101pg)</p><p>4 Topological sort(ch 22 95pg)</p><p>5 MST Kruskal (ch 23 14pg)</p><p>6 MST Prims (ch 23 26pg)</p><p>7 DAG (ch 24 24pg)</p><p>8 Bellman-Ford(ch 24 14pg)</p><p>9 Dijkstra (ch 24 27pg)</p><p>10 Floyd (ch 25 52pg)</p>','2020-06-01 13:55:31.860642','group51',7081,245,'2020-06-01 13:51:41.772504','퀴즈 복습 및 다음 차시 예습','21:50',6,60),(507,'2020/06/02/orig/Study8.JPG','<p>백만개 이상의 노드를 quicksort를 사용했을 때 stack overflow error가 생기는 이유에 대해서 이야기 해보고&nbsp;<br>서로의 생각과 의견을 나누어 왜 그런지에 대한 이유를 코드에 적용하여 해결하는 작업을 하였습니다.<br></p>','2020-06-02 08:24:02.402504','group56',7014,250,'2020-06-02 08:18:36.618642','Stack overflow','19:00',8,80),(508,'2020/06/02/orig/study9.JPG','<p>오늘 강의에 나온 Data Structure tree에 대해서 이야기를 나누었다.</p><p>강의내용 중에 tree의 size, height, node의 위치 등에 대해서 질문이 나왔는데 그 질문들에 대해서 이야기하고&nbsp;<br>tree의 구조와 기본 개념에 대해서 이해하는 시간이었다.</p>','2020-06-02 08:27:28.003148','group56',2176,250,'2020-06-02 08:24:04.934235','tree 입문','20:00',9,60),(509,'2020/06/02/orig/group55_study8.jpeg','<p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">13주차 목요일 수업내용</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">14주차 월요일 수업내용</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">각자 정리해 온 파트를 설명해주고 질의응답하는 시간을 가졌습니다.</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">예상문제를 미리 만들어와서 서로와 공유했습니다.</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &q