49',NULL,243,NULL,'알고리즘','19:00',11,80),(517,'2020/06/03/orig/06C3EC00-AFFF-4176-9360-899AFEE83A05.png','각자 개발한 게임의 알고리즘을 설명하고 구현\r\n서로 리뷰해주며 보완할 부분 제안','2020-06-03 12:44:44.317219','group46',5309,240,'2020-06-03 12:39:50.326758','게임 리뷰','21:00',9,40),(518,'2020/06/03/orig/1591196027409.png','메모리에 대한 공부를 하였다 유익한 시간이었다.','2020-06-03 14:55:29.813866','group17',3125,211,'2020-06-03 14:53:15.700977','오에스 공부를 하였다','22:00',8,120),(520,'2020/06/04/orig/20200604k.png','<p><br></p><pre style=\"color: rgb(0, 0, 0); font-size: medium; margin-bottom: 0px;\"><span style=\"color: rgb(128, 128, 0);\">public</span><span style=\"color: rgb(192, 192, 192);\"> </span><span style=\"color: rgb(128, 128, 0);\">class</span><span style=\"color: rgb(192, 192, 192);\"> </span>practice<span style=\"color: rgb(192, 192, 192);\"> </span>{</pre><pre style=\"color: rgb(0, 0, 0); font-size: medium; margin-bottom: 0px;\"><br></pre><pre style=\"color: rgb(0, 0, 0); font-size: medium; margin-bottom: 0px;\"><span style=\"color: rgb(192, 192, 192);\">    </span><span style=\"color: rgb(128, 128, 0);\">private</span><span style=\"color: rgb(192, 192, 192);\"> </span><span style=\"color: rgb(128, 0, 128);\">int</span><span style=\"color: rgb(192, 192, 192);\"> </span>a;</pre><pre style=\"color: rgb(0, 0, 0); font-size: medium; margin-bottom: 0px;\"><span style=\"color: rgb(192, 192, 192);\">    </span><span style=\"color: rgb(128, 128, 0);\">private</span><span style=\"color: rgb(192, 192, 192);\"> </span><span style=\"color: rgb(128, 0, 128);\">static</span><span style=\"color: rgb(192, 192, 192);\"> </span><span style=\"color: rgb(128, 0, 128);\">int</span><span style=\"color: rgb(192, 192, 192);\"> </span>b;</pre><pre style=\"color: rgb(0, 0, 0); font-size: medium; margin-bottom: 0px;\"><span style=\"color: rgb(192, 192, 192);\">    </span><span style=\"color: rgb(128, 128, 0);\">private</span><span style=\"color: rgb(192, 192, 192);\"> </span><span style=\"color: rgb(128, 0, 128);\">static</span><spa