00512-2200-2300.png','<p>운영체제</p><p>Monitor 개념 복습 및 정리</p><p>condition variable에 관해서 어떻게 실행이 되는지 큐에 어떻게 들어가서 기다리는 지에 대해 코드를 보고 이해하는 시간을 가짐.</p><p>semaphore에서 next가 필요한 이유에 대해 알아보고, 코드 이해하기</p><p><br></p><p>알고리즘&nbsp;</p><p>MST에 대해 복습하는 시간을 가졌습니다.</p><p>mst에서 safe edge라는 것이 무엇인가 정확하게 짚어보는 시간을 가졌습니다.</p><p>하나의 끝점은 s에 있고 다른 하나의 포인트는 v-s에 있어서 cut하는 부분을 cross하는 edge라는 것에 대해 설명을 듣고 그래프를 보면서 이해하는 시간을 가짐.</p><p>Prim algorithm의 코드를 다시 한번 보고 가장 작은 값을 어디서 찾는지 큐가 어떻게 작용하는지에 대해 논의 해보았습니다.</p><p>Tree 부분과 Fringe&nbsp; 부분으로 나누어서 완성된 트리를 만드는 방법도 다른 예시들을 통해 같이 풀어보았습니다.</p>','2020-06-04 13:54:35.544149','group38',3958,232,'2020-06-04 13:54:35.103378','여덟','22:00',8,60),(525,'2020/06/04/orig/09-20200519-2200-2300_H7qVbGJ.png','<p>알고리즘</p><p><br></p><p>ch24에서 shortest path 를 구하는 방법을 복습함.</p><p>Single-source shortest path 는 세가지 방법이 있고<br></p><p>– Bellman-Ford algorithm</p><p>– In DAG</p><p>– Dijkstra’s algorithm&nbsp;</p><p>All-pairs shortest-paths 에는&nbsp;Floyd-Warshall algorithm 가 있다는 것을 다시 한번 봄.</p><p>Single-source shortest path 에서 셋의 차이점을 복습함.</p><p><br></p><p>OS</p><p><br></p><p>Synchronization Example에서 커널안에서 일어나는 Synchronization within the kernel</p><p>수업에서 들었던 것을 다같이 요약하는 시간을 가지고&nbsp;</p><p>POSIX synchronization에서 예시를 보며 락과 언락이 쓰이는 방법을 복습함.</p><p><br></p>','2020-06-04 14:07:57.203547','group38',4620,232,'2020-06-04 14:07:37.658956','아홉','22:00',9,60),(526,'2020/06/04/orig/2.png','<p>이번 주에는 p mos 와 n mos 가 합쳐진 회로에서 block으로 회로를 이해하는 시간을 가졌다. 생각보다 이해가 안되서 어려웠고 mask과정 또한 쉽게 이해하는 법을 찾지 못해서 어려웠다.</p>','2020-06-04 14:56:44.339715','group57',5432,251,'2020-06-04 14:54:17.878681','Mask 의 단계에 대해서 공부 , Block 에 따른 회로 구성 공부','22:20',9,95),(527,'2020/06/05/orig/90469633-612E-4827-BFFB-54B2641CB1E1.png','챕터 22, 23, 24을 복습하고 문제를 만들어 풀이해보았습니다.\r\n\r\n준비 과정\r\n\r\n1 Critical Path(ch 22 119pg)\r\n\r\n2 Articulation Point(ch 22, 139pg)\r\n\r\n3 SCC(ch 22 101pg)\r\n\r\n4 Topological sort(ch 22 95pg)\r\n\r\n5 MST Kruskal (ch 23 14pg)\r\n\r\n6 MST Prims (ch 23 26pg)\r\n\r\n7 DAG (ch 24 24pg)\r\n\r\n8 Bellman-Ford(ch 24 14pg)\r\n\r\n9 Dijkstra (ch 24 27pg)\r\n\r\n10 Floyd (ch 25 52pg)\r\n\r\n\r\n\r\nA - 7,10 -> 정유신\r\n\r\nB - 1,9 -> 장민영\r\n\r\nC - 3,5 -> 이지훈\r\n\r\nD - 4,6 -> 홍순규\r\n\r\nE - 2,8 -> 박병윤','2020-06-04 15:26:06.505732','group51',7364,245,'2020-06-04 15:17:55.041664','문제풀이 및 복습','23:00',7,80),(534,'2020/06/05/orig/AEB76820-5408-47CD-82BC-628A30E9880E.jpeg','PHP를 통해 데이터베이스 서버 연동, 적절한 쿼리문 사용하여 원하는 데이터를 받아오는 방법 공부. 데이터를 받아오는 것 뿐만 아니라 테이블을 수정하고 데이터를 추가, 삭제하는 것까지 시도해보고 공부한 내용을 나누었습니다.','2020-06-05 05:17:49.862635','group61',2639,255,'2020-06-05 05:14:35.472823','7일차','13:00',7,70),(535,'2020/06/05/orig/5F83AC5F-FA33-4A30-B033-B13CCD756419.png','1. ch 21 counter 개념 정리\r\n1. ch 21 counter 질의 문답\r\n2. ch 22 registers 개념 정리\r\n4. ch 22 registers 질의 문답','2020-06-05 07:54:40.685389','group13',7096,207,'2020-06-05 07:50:14.006672','[Logic Design] 그룹 스터디 10','16:10',10,80),(536,'2020/06/05/orig/20200605-1600-1700.PNG','<p>9강(Main Memory) 복습</p><p>- Swapping, Memory allocation, Paging 등의 내용을 복습하였습니다.</p>','2020-06-05 12:27:12.016732','group19',9684,213,'2020-06-05 12:25:49.773369','열한번째 스터디 그룹 모임(6월 5일)','16:00',13,60),(537,'2020/06/05/orig/1591362139739.png','논리설계 19,20 강에 해당하는 example 문제들을 같이 풀어보았습니당~!','2020-06-05 13:03:20.958931','group64',1387,258,'2020-06-05 13:00:20.998008','논리설계 19,20 -2','21:00',8,60),(538,'2020/06/06/orig/KakaoTalk_Photo_20200606_1548_22721.jpg','<p>memory management<br></p><p>Contiguous allocation</p><p>relocation memory</p><p>fragmentation</p><p>external fragmentation</p><p>internal fragmentation</p><p>compaction</p><p>paging</p><p>effective access time</p>','2020-06-06 06:50:50.280631','group16',6358,210,'2020-06-06 06:42:48.476042','OS 스터디 12주차','14:30~15:50',12,90),(539,'2020/06/06/orig/6408.png','<p><img src=\"/upload_files/django-summernote/2020-06-06/6c8cc18d-a9a4-431c-90ad-35f66a1e5c3d.jpeg\" style=\"width: 720px;\"><br></p>','2020-06-06 11:01:18.699896','group60',6408,254,'2020-06-06 10:58:39.080874','로직디자인 20강복습, 21강, 22강','18:00',29,120),(540,'2020/06/06/orig/Screen_Shot_2020-06-06_at_8.27.00_PM.png','<p>중간고사를 친 이후에 중간고사에서 사용했던 파이프와 세마포어, 뮤텍스 등에 대해서 리뷰하는 시간을 가졌습니다.</p><p>또한 다음학기에 준비하는 공프기팀의 주제에 대해서 나누며 서로 어떻게 진행할지에 대해 검토하는 시간을 가졌습니다.&nbsp;</p>','2020-06-06 11:46:30.927350','group45',NULL,239,NULL,'중간고사 리뷰','20:00',11,40),(541,'2020/06/07/orig/1591532173205.jpg','범위: OS - Programming Assignment 4 관련  스터디\r\n\r\n1) PA4를 진행하면서 생겼던 피드백 서로 나누기\r\n\r\n2) PA4 관련 개념 정리','2020-06-07 12:18:52.399760','group58',7523,252,'2020-06-07 12:09:00.728462','OS pa4','20:00',9,60),(542,'2020/06/07/orig/2020-06-07.png','<p>모두 마지막 스터디를 끝마쳤습니다. one hot encoding과 중간고사를 복습하며 서로의 문제를 해결하였고, 마지막이기에 더욱 열심히 할 수 있던 것 같습니다. 모두 수고하셨습니다!</p>','2020-06-07 12:29:56.139294','group44',7913,238,'2020-06-07 12:28:31.548956','마지막 스터디','20:00',11,90),(543,'2020/06/07/orig/KakaoTalk_20200607_222216283.png','<p><span style=\"font-size: 14px;\">오늘은 6/8일에 있을 AA퀴즈 공부를 하였다.</span></p><p><span style=\"font-size: 14px;\"><br></span></p><p><span style=\"font-size: 14px;\">75분 동안 줌을 켜놓고 공부한 후, 모르는 것이 생길때마다 마이크를 켜서 질문을 나누었다.</span></p><p><span style=\"font-size: 14px;\"><br></span></p><p><span style=\"font-size: 14px;\">스터디를 하니, 모르는 문제를 혼자 끙끙 앓으면서 푸는것보다 서로 공유 하면서 하다 보니 더 빨리 배울 수 있고 유익한 시간이였다.</span></p>','2020-06-07 13:24:12.723606','group5',NULL,199,NULL,'DAY7','21:00',7,60),(544,'2020/06/08/orig/KakaoTalk_Photo_2020-06-08-20-28-57.jpeg','<p>소프트웨어 공학에서 software testing 부분이 많이 헷갈렸기 때문에 각자 여러 testing 부분들에 대해서 알아오고 각자 얼마나 효율적일지에 대해서 논의하는 시간을 가졌다. 너무 생소한 부분이라서 함께 이야기하고 찾아보는 시간을 가졌다.&nbsp;</p>','2020-06-08 11:37:09.407149','group12',NULL,206,NULL,'Software Testing','17:00-19:00',7,120),(548,'2020/06/08/orig/9F7093A5-EDAC-45DB-ADF6-69D65B94AB26.png','알고리즘 수업에서 지금까지 배운 내용 복습하고\r\n기말고사 준비하는 스터디 진행','2020-06-08 12:57:46.126100','group51',1894,245,'2020-06-08 12:56:13.894847','기말고사 준비','20:50',8,60),(549,'2020/06/08/orig/KakaoTalk_20200608_222402585.png','<p>오늘 실습 수업에서 했던 내용을 다시 공부해보고, 전자회로 기말고사대비 공부를 했다.</p>','2020-06-08 13:24:34.242243','group11',3815,205,'2020-06-08 13:22:31.167368','스마트시스템 실습 복습 및 전자회로 예습','20:30',9,120),(550,'2020/06/09/orig/08-20200607-2100-2200.PNG','<p>데이터 구조의 heap 에 대해서 공부했음.</p>','2020-06-08 17:21:35.963928','group27',8079,221,'2020-06-08 17:20:31.302829','20200607-21:00-22:00','21:00',8,58),(551,'2020/06/09/orig/KakaoTalk_20200527_201059183.png','<p>이번주 스터디는 6단원의 풀이 대신, 퀴즈를 대비해 회로를 만들어보는 시간을 가졌다.</p><p>이번주에 교수님께서 counter로 시계를 만드는 것을 해보면 도움이 될 것이다 라고 하신 말씀에 이를 진행을 하게 되었다.</p><p>윤서와 예안이는 각자 미리 만들어보았던 시계가 어떻게 작동하는지에 대해 자세히 소개해주었다.</p><p>이 소개를 바탕으로 이 시계들이 어떻게 작동하는 지를 이해하는 시간을 가졌다.&nbsp;</p><p>그 후 각자 개인의 시계를 만들어보며 스터디를 마쳤다.</p><p>다음 스터디는 이번주에 하기로 했던 6단원 풀이를 진행하기로 했다.</p><p>&nbsp;</p>','2020-06-09 05:11:50.427332','group2',4398,196,'2020-06-09 05:11:10.672034','0527 모임9','20:00',11,80),(552,'2020/06/09/orig/10-20200531-2200-2315.png','<p>알고리듬 </p><p>chapter#7 강의를 들으며,&nbsp; partition을 통해 피봇을 구하는 exercise를 함께 풀어보며 </p><p>quick sort의 개념을 정확히 이해하려 노력했다. </p><p>또한 9:1로 partition이 unbalance하게 된 경우의 propotional split of quicksort의 tree를 통해 </p><p>nlgn으로 time complexity가 정해지는 과정을 함께 공부했다.</p><p><br></p><p> </p><p>운영체제</p><p>또한, deadlock을 공부하며, safe sequence가 존재하는 상태인 safe state의 개념이 헷갈려서 정리해보는 시간을 가졌다.<br></p>','2020-06-09 07:25:44.942351','group38',4352,232,'2020-06-09 07:19:14.100673','열번째 스터디','22:00',10,75),(553,'2020/06/09/orig/7E76AFB4-EEFC-447E-890B-5CAA0C7E42EA.jpeg','데이터베이스에 접속해서 쿼리문을 통해 필요한 데이터를 받아오거나 입력, 수정, 삭제하는 등의 기능등을 프론트엔드에서 어떻게 적절하게 구현해야 할 지에 대해 공부해 보았습니다.','2020-06-09 09:36:20.514532','group61',2716,255,'2020-06-09 09:33:15.273296','8일차','17:00',8,75),(554,'2020/06/09/orig/group55_study9.jpeg','<p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">14주차 목요일 수업내용</p><p style=\"margin-bottom: 1rem; color: rgb