bkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\">보이스톡을 이용했습니다.</p>','2020-06-09 11:54:47.582053','group55',8473,249,'2020-06-09 11:52:34.669682','Operating System 14주차 목 - 15주차 월','20:20',9,30),(555,'2020/06/09/orig/C795AEC3-5755-400E-A8A1-32241BEA2323.png','dma를 이용한 adc control과 ws2812 제어','2020-06-09 12:03:02.426646','group6',5092,200,'2020-06-09 12:00:33.954894','임베디드 DMA, WS2812','20:00',8,60),(556,'2020/06/09/orig/KakaoTalk_20200609_205430947.png','<p>1. Element 마다의 Phasor Eq와 Impedence 값 정리</p><p>2. Average Power의 값을 구하는 회로분석 및 Phase상태에서 V와 I의&nbsp;<span style=\"font-family: 굴림, gulim, helvetica, &quot;나눔바른고딕 옛한글&quot;, &quot;NanumBarunGothic YetHangul&quot;, 새굴림, sans-serif; font-size: 14px;\">θ값 구하기</span></p><p>3. Maximize PL의 값을 구하는 회로분석 및 이때 사용되는 공식 및 이론 정리</p>','2020-06-09 12:21:20.447366','group40',6073,234,'2020-06-09 12:16:34.434804','8단원, 9단원 정리','20:00',9,60),(557,'2020/06/09/orig/KakaoTalk_20200609_222738739.png','<p>전자회로 flipflop 부분에 대해서 논리설계 부분 복습및 기말고사 시험 준비를 했다.</p>','2020-06-09 13:29:25.460656','group11',5713,205,'2020-06-09 13:24:37.930989','전자회로 기말 공부','20:30',10,1030),(558,'2020/06/09/orig/1591712094213.png','논리설계 21강에 해당하는 counter 에 관하여 예제문제들을 풀어보았습니다 ! 학기 마무리까지 얼마 안남았는데 다들 화이팅해용ʕッ•ᴥ•ʔッ','2020-06-09 14:16:30.350141','group64',2386,258,'2020-06-09 14:13:01.138122','논리설계 21강','22:00',9,75),(559,'2020/06/09/orig/20200609_235218.jpg','<p>OS 시험 정보 공유</p><p>OS 시험 전 강의 리뷰</p><p>알고리듬 분석 시험 정보 공유</p><p>알고리듬 분석 시험 전 강의 리뷰</p>','2020-06-09 14:54:53.020324','group51',2384,245,'2020-06-09 14:48:27.011884','기말고사 준비 2','22:50',9,60),(560,'2020/06/10/orig/1591714540534.png','15주차를 맞아 알고리즘 과제가 미뤄짐에 감사함을 나눴다.\r\n\r\n또한, 그리고 공부를 안한 우리를 되돌아 보는 시간을 가졌다 .\r\n그리고 15주차인 만큼 정신 차려서 DB index와 DB 과제3을 같이 풀이했다.','2020-06-09 15:00:45.015384','group17',8913,211,'2020-06-09 14:54:45.804604','어? 15주차라고?','2120',9,100),(561,'2020/06/10/orig/2407.png','<p><img src=\"/upload_files/django-summernote/2020-06-10/bd8062ba-957d-4ce6-a2a6-f0473059df75.png\" style=\"width: 652px;\"><br></p>','2020-06-10 01:49:07.888137','group60',2407,254,'2020-06-10 01:45:45.745561','로직디자인 10~16, 21,22 복습','10:00',30,46),(563,'2020/06/10/orig/KakaoTalk_Photo_2020-06-10-16-00-05.jpeg','<p>이번주 소프트웨어공학에 대한 정리, software process quality에 대한 공부</p><p><br></p><p>그리고 데이터베이스 사용법 토론 - NoSQL, RDBMS 차이 정리</p>','2020-06-10 07:00:58.826709','group12',7086,206,'2020-06-10 06:55:09.200899','소공 기말고사 준비','15:00',8,70),(564,'2020/06/10/orig/KakaoTalk_20200610_154113255.jpg','<p>이번주도 zoom을 통해 스터디를 진행했다.</p><p>이번주의 내용은 저번주에 미뤘던 7과의 문제 해설과 풀이를 진행하기로 했다.</p><p>7과의 문제 대부분은 회로를 설계하는 내용이었는데 교수님이 수업에서 강조하시던 부분이어서 다들 열심히 준비를 해왔다.</p><p>다양한 ff들을 이용해 state table을 구하는 문제부터 시작해&nbsp;</p><p>&nbsp;synchronous counters들을 구현하는 문제들이 많았다.</p><p>지금까지 배웠던 내용들을 적용시켜 풀어야 되는 문제들이 많았기 때문에 그 만큼 시간도 오래 걸리는 부분이었지만&nbsp;</p><p>꾸준히 스터디를 해와서인지 어려운 문제들은 토론을 통해 그 해결방안에 대해 생각해낼 수 있었다.</p><p><br></p>','2020-06-10 07:57:55.269250','group2',NULL,196,NULL,'0603 모임10','8:00',12,50),(565,'2020/06/10/orig/KakaoTalk_20200610_182247560.jpg','감사합니다.','2020-06-10 09:23:56.172292','group63',NULL,257,NULL,'운영체제 6 7 장 복습 및 서로 퀴즈내주기','1200',7,180),(566,'2020/06/10/orig/Ds10.JPG','<p>Heap에 대한 개념에 대해서 이야기를 나누었다.</p><p>그리고 heap에서 사용되는 기능들에 대해서도 이야기를 나누었다.</p><p>주요기능들의 알고리즘과 실제로 코딩을 해보면서 이해도를 높이고 이론을 눈으로 확인하는 시간이었다.</p>','2020-06-10 10:36:49.896905','group56',NULL,250,NULL,'Heap Data Structure','11:00',10,60),(567,'2020/06/10/orig/6128AE56-C8C5-450B-A582-8D93E0169DDA.png','알고리즘 기말고사에 나올 만한 문제를 각자 만들어보고 쉐워하는 시간을 가졌습니다.\r\nDfs, rabin karp알고리즘, quick sort에 대한 문제를 가지고 풀고 풀이하며 진행하였습니다.\r\n마지막 스터디라 팀원들과 수업 이야기와 공프기 주제에 대한 이야기도 나눴습니다!\r\n49조 알고리즘 파이팅!!','2020-06-10 11:42:27.351000','group49',7591,243,'2020-06-10 11:34:06.665522','알고리즘','19:00',12,90),(568,'2020/06/10/orig/0306D7EF-EE13-40EB-824E-674753BB5362.png','알고리즘 기말고사 범위를 공부했다.','2020-06-10 11:44:33.563069','group10',4627,204,'2020-06-10 11:42:46.737198','알고리즘 기말 공부','20:00',9,120),(569,'2020/06/10/orig/307A5B3C-37FA-4248-8D11-0042FC375252.png','지난주 코드에서 업그레이드한 점을 리뷰하는 시간을 가짐.\r\n마지막 모임이라 서로 피드백을 주고받음.','2020-06-10 13:01:02.607431','group46',NULL,240,NULL,'게임 리뷰 & 마지막 피드백','21:00',10,50),(570,'2020/06/11/orig/B612_20200611_131758_192.jpg','소공과 알고리즘 공부','2020-06-11 04:19:02.859681','group12',4258,206,'2020-06-11 04:16:11.608179','소프트워어 공학','12:00',9,70),(571,'2020/06/11/orig/1591856570196.jpg','회로이론 9단원 12단원 내용 복습\r\n로직디자인 기말고사 대비 q&a','2020-06-11 06:24:12.703615','group29',NULL,223,NULL,'6/10','11:00',13,60),(572,'2020/06/11/orig/1591878185085.png','AM(Amplitude Modulation) 복습\r\n예제 풀이','2020-06-11 12:25:00.883311','group39',7254,233,'2020-06-11 12:22:28.937881','통신이론','20:00',7,80),(573,'2020/06/11/orig/1591881865748.png','마지막으로 전체 Logic Design을 리뷰하는 시간을 가졌습니다. 그 중에서도 counter, register, 그리고 sequential system을 설계하는 방법에 대해 함께 리뷰하면 교수님께서 제공해주신 examples 문제들을 풀어봤습니다. 단계들이 많고 복잡하기에 실수에 유의해야 한다는 것을 깨달았습니다.','2020-06-11 13:28:18.759167','group48',1293,265,'2020-06-11 13:20:46.840406','마지막 기말고사 리뷰','21:00',10,80),(574,'2020/06/11/orig/KakaoTalk_20200611_231612266.png','<p><span style=\"font-size: 14px;\">오늘은 공모전에 대한 이야기를 나누고, 앞으로 있을 기말고사 공부를 하였다.</span></p><p><span style=\"font-size: 14px;\"><br></span></p><p><span style=\"font-size: 14px;\">35분 동안은 공모전에 대한 이야기를 하였고,</span></p><p><span style=\"font-size: 14px;\">45분 동안은 줌을 켜놓고 공부한 후, 모르는 것이 생길때마다 마이크를 켜서 질문을 나누었다.</span></p><p><br></p><p>공모전 신청이 시험기간에 마감이 되어서 공부를 하기 전에 이야기를 나눌 수 있는 시간을 보낼 수 있어서 좋았고, 서로 물어보면서 공부하니 이해하기 수월했고 유익한 시간이였다.</p>','2020-06-11 14:20:29.883379','group5',7302,199,'2020-06-11 14:14:38.697034','DAY8','22:00',8,80),(575,'2020/06/12/orig/study.jpg','<p>2020 - 06 - 11 일 사진입니다.</p>','2020-06-11 20:54:42.421276','group63',4093,257,'2020-06-11 20:52:38.167313','운영체제 6장 7장 8장 복습 및 서로 퀴즈내주기','1830',8,180),(576,'2020/06/12/orig/study2.jpg','<p>감사합니다.</p>','2020-06-12 06:12:07.892068','group63',NULL,257,NULL,'운영체제 6 7 8 장 총 복습 및 시험범위 정리','1200',9,180),(577,'2020/06/12/orig/KakaoTalk_Photo_2020-06-12-15-50-30.jpeg','<p>- 서비스 품질을 확인하기 위해서 거치는 방식들에 대해서 함께 논의해 보고 예시를 찾아보고 했다.&nbsp;</p><p>- 본래 서비스를 개발할 때, 품질 관리를 해야하는지 몰랐었기 때문에 굉장히 생소한 주제라서 많은 정보를 찾아보고 할 수 있었다.&nbsp;</p><p>- 실제로 서비스를 개발하였을 때 어떻게 품질관리를 할지 예상하고 이야기해보는 시간을 갖기도 하였다.&nbsp;</p>','2020-06-12 06:57:47.476053','group12',2619,206,'2020-06-12 06:49:20.480655','Quality Management','14:30',10,90),(578,'2020/06/12/orig/19-20200612-1600-1730.PNG','<p>10강(Virtual Memory)을 복습하였습니다.</p><p>- Demand Paging, Copy-On-Write, Thrashing 등의 내용을 복습하였습니다.</p>','2020-06-12 09:25:24.747039','group19',1739,213,'2020-06-12 09:23:15.052763','열두번째 스터디 그룹 모임(6월 12일)','16:00',14,90),(579,'2020/06/12/orig/KakaoTalk_20200612_205551130.png','<p>1. Poles 와 Zeros에 대한 개념 이해 및 문제풀이</p><p>2. Sinusoidal Frequency Analysis에 대한 이해</p><p>3. RLC circuit 분석 및 그 회로에서 L, Wo, C 등 구하는 방법 토론</p>','2020-06-12 11:03:21.733301','group40',3941,234,'2020-06-12 10:58:15.319796','기말고사 대비 & 마지막 점검','18:00',10,60),(580,'2020/06/12/orig/1.png','<p>시험 범위가 전 범위이기 때문에 중간고사 내용을 복습하는 시간을 가졌다. Cascode 에 따른 voltage 계산 하는 식이 복잡하여 다시 공부하는 시간으 ㄹ가졌다.</p><p><br></p>','2020-06-12 13:15:17.767227','group57',NULL,251,NULL,'다음주 화요일에 있을 기말고사 시험 대비 및 질문정리 & 토의','20:00',10,120),(581,'2020/06/12/orig/1591971305446.png','그래프의 본질을 서로 이야기하며 이해함','2020-06-12 14:17:10.160342','group21',3598,215,'2020-06-12 14:14:21.785318','그래프','22:00',8,60),(582,'2020/06/12/orig/1591972348173.png','22강에 해당하는 register 에 관하여 레지스터가 어떤 개념인지 알아보고 그에 해당하는 문제들을 풀어보았습니당~!','2020-06-12 14:33:39.062529','group64',5173,258,'2020-06-12 14:26:36.461978','논리설계 22강','22:00',10,90),(583,'2020/06/13/orig/KakaoTalk_20200613_152805083.png','<p>Paging의 Protection 방법, Memory sharing 방법에 대해서 배워보았고</p><p>Page table의 효율성을 위해서 구조화 시키는 방법으로 Hierarchical Paging, Hashed Page Tables, Inverted Page Tables에 대해서 배워보았습니다.</p>','2020-06-13 06:45:37.808134','group16',NULL,210,NULL,'Memory Management Strategies (8.5.3 ~ 8.6.3)','2:50',13,40),(584,'2020/06/13/orig/4F8C2D08-9661-4A48-8256-054F672B46F5.png','알고리즘 기말고사 준비','2020-06-13 07:35:50.120049','group51',1732,245,'2020-06-13 07:32:56.640430','마지막 스터디','3시30',10,60),(585,'2020/06/13/orig/studyfinal.jpg','<p>이상입니다.</p><p>수고하셨습니다.</p>','2020-06-13 13:12:49.814245','group63',1702,257,'2020-06-13 13:11:59.806936','시험전 6 7 8  총 복습 및 서로 문제 내주기','1730',10,180),(586,'2020/06/13/orig/KakaoTalk_20200613_223614176.png','<p><span style=\"font-size: 14px;\">돌아오는 주가 시험기간이기 때문에&nbsp;</span>줌을 켜놓고 각자 개인공부를 하면서 스터디를 하였다.</p>','2020-06-13 13:37:36.947324','group5',1473,199,'2020-06-13 13:29:58.047199','DAY9','21:00',9,100),(587,'2020/06/14/orig/09-20200613-2100-2200.PNG','<p>데이터 구조의 Graph 파트의 DFS, CC, BFS, Processing에 대해서 공부했습니다.</p>','2020-06-13 21:00:57.071038','group27',2706,221,'2020-06-13 20:59:29.050704','20200613-21:00-22:00','21:00',9,60),(588,'2020/06/14/orig/downloadfile-1.jpg','기말고사대비하여 exercise 문제 해결방안 논의\r\nInverted page table, internal fragment논의\r\nPage table과 process관의 내용 논의','2020-06-14 12:18:17.816521','group58',5137,252,'2020-06-14 12:12:40.192638','기말고사 대비','21',10,120),(589,'2020/06/14/orig/4DF67591-E21A-40C9-84C7-032533AB0E2D.png','전범위 리뷰문제 복습','2020-06-14 12:30:32.101498','group13',9137,207,'2020-06-14 12:24:54.621583','[Logic design]그룹스터디10','20:30',11,60),(590,'2020/06/14/orig/10-20200614-2110-2230.PNG','<p>데이터 구조에서 그래프 파트의 2-coloring 부분에 대해서 공부했습니다.</p>','2020-06-14 13:40:31.419243','group27',2948,221,'2020-06-14 13:39:13.814193','20200614-21:10-22:30','21:10',10,80),(591,'2020/06/14/orig/KakaoTalk_20200614_232834035.png','<p>오늘도 다가오는 시험을 위해 각자 필요한 공부를 하였다.</p>','2020-06-14 14:30:26.588421','group5',3042,199,'2020-06-14 14:26:15.309292','DAY10','22:30',10,60),(592,'2020/06/15/orig/6783.png','<p><img src=\"/upload_files/django-summernote/2020-06-15/20481bb7-0dcf-477e-be9c-f06f7ea400e9.png\" style=\"width: 1275px;\"><br></p>','2020-06-14 15:45:47.342346','group60',6783,254,'2020-06-14 15:43:12.438068','로직디자인 시험 준비 (24강)','20:50',31,235),(593,'2020/06/15/orig/1592152359213.png','하루종일 디비를 잡고 공부하며\r\nChained hasing이니 뭐니 와닿지 않은 이론을 example problem solving했다...\r\n\r\n재이수만은 피하고 싶다','2020-06-14 16:34:57.284025','group17',4806,211,'2020-06-14 16:32:07.281612','DB, 함께해서 더러웠고 다시는 보지 말자','22:00',10,217),(594,'2020/06/15/orig/2020_06_04.png','<p>6월 4일에는 모두 모여서 퀴즈와 기말시험준비를 했다.</p><p>공통으로 배우는 개념들을 정리하고, 배분하였다. 서로 정리해온 개념들을 설명하고 자료를 만들었다.</p><p><img src=\"/upload_files/django-summernote/2020-06-15/85c97572-cb84-4643-88c3-6b2795b4b83d.png\" style=\"width: 1104px;\"><br></p><p><br></p>','2020-06-15 03:01:51.452923','group24',3492,218,'2020-06-15 02:57:29.338243','2020-06-04','16:00',10,60),(595,'2020/06/15/orig/11-20200602-2200-2300.png','<p>알고리즘</p><p>counting sort, radix sort, bucket sort의 각각의 특징과 어떤식으로 sort가 진행되는지,timecomplexity가 어떻게 되는지 복습했다.</p><p>그리고 세가지를 비교하면서 각각의 sort의 장단점을 살펴보면서 어떤 상황에서 쓰이는 것이 적절한지에 대해 불분명하게 알고 있어서&nbsp; 확실하게 정리해보았다.</p><p><br></p><p>운영체제</p><p>메인메모리를 management하는 배경부터 현재 management하기위해 사용하는 방법과 과정을 이어서 복습했고 장단점 또한 살펴보았다.</p><p>예시를 들어가면서 logical address를 physical address로 바꾸는 다양한 방법들을 같이 해보았고 장단점과 과정 차이를 비교하면서 각 방법들을 명확하게 정리했다.</p>','2020-06-15 12:19:16.783377','group38',2081,232,'2020-06-15 12:10:40.778530','알고리즘 chapter 8 && os chapter 9','22:00',11,60),(596,'2020/06/15/orig/KakaoTalk_20200615_215407237.png','<p>오늘 이번학기 마지막 스터디를 진행하였다.</p><p>시험기간이라 짧게 아쉬움을 이야기하고, 각자 공부하는 시간을 가졌다.</p><p>스터디를 통해 좋은 인연을 만날 수 있었다.</p><p><br></p><p>한학기동안 모두 수고 많았고, 끝까지 마무리 잘 하자! 아자아자:)</p>','2020-06-15 13:01:21.068316','group5',4321,199,'2020-06-15 12:51:33.532234','DAY11','21:00',11,60),(598,'2020/06/15/orig/0615_s.png','<p>다들 힘든 한 주를 보내고 있습니다</p><p>이번 시간에는 다같이 집중 학습 시간을 가졌습니다!</p>','2020-06-15 13:14:40.020716','group8',4196,202,'2020-06-15 13:10:31.646690','여섯 번째 모임','19:50',6,70),(599,'2020/06/16/orig/09-202003.jpg','<p>&gt;&gt;Java programming</p><p>- 자바 기말 고사 범위의 개념을 정리</p><p>- 서로 절반씩 나누어 개념에 대해 설명하고 모르는 부분을 함께 찾아 공부하였다.</p><p>- oop concept, file io, concurrency 등</p>','2020-06-15 18:10:10.616377','group35',NULL,229,NULL,'자바 스터디 1차','23:30',11,215),(600,'2020/06/16/orig/DA6C52AD-ABA9-4FB9-B673-87AAC37923DF.jpeg',