 마무리 잘하시고 고생 많으셨어용!!!٩(◕ᗜ◕)و','2020-06-16 13:03:15.600028','group64',3146,258,'2020-06-16 12:59:37.006252','논리설계 마무리','21:00',11,60),(606,'2020/06/17/orig/20200617.png','<p>1. 바쁜 와중에 다들 시간 내어 줌 미팅으로 마지막 스터디 시간을 가졌습니다.</p><p>2. 팀원 3명 다 전공 주요과목들이 겹치기 때문에, 이 과목들을 어떻게 준비하고 무엇을 준비해야 할지 논의해보았습니다.</p><p>3. 비록 운영체제가 팀원들의 마음을 많이 힘들게 할 만큼 답이 제대로 안 서지만, 마지막까지 최선을 다한다는 마음으로 다시금 시험 범위인 9단원 가상 메모리까지 공부를 해볼 것을 결의하였습니다.</p><p>4. 알고리즘 시험이 어려울 것으로 예상을 하고 준비를 철저히 하자는 전략을 세웠습니다.</p><p>5. 한학기동안 다들 고생했다는 의미에서 웃으면서 박수 치고 마무리 하였습니다.</p><p><br></p><p>스터디를 주최해주셔서 감사드립니다. 한학기동안 그래도 나름 도움이 되었습니다.&nbsp;</p>','2020-06-16 15:23:31.094959','group34',4825,228,'2020-06-16 15:19:22.846155','#Last. OS, 알고리즘, DB 시험 전략 논의 및 마지막 스터디 소회','0000',11,20),(607,'2020/06/17/orig/11-20200617-1600-1700.PNG','<p>논리설계 기말고사 범위 공부</p>','2020-06-17 08:02:29.467971','group27',4739,221,'2020-06-17 08:01:14.102221','20200617-16:00-17:00','16:00',11,60),(608,'2020/06/17/orig/0617.png','<p>내일은 시험입니다</p><p>모두 비슷한 수업을 듣고 있는지라 다들 발등에 불이 떨어진 것이 느껴졌습니다</p><p><br></p><p>1. 알고리즘 모르는 문제 풀이</p><p>2. 운영체제 주요 개념 정리</p><p><br></p>','2020-06-17 11:22:08.781091','group8',6017,202,'2020-06-17 11:12:28.470810','내일은 시험','19:10',8,70),(609,'2020/06/17/orig/8353FFE4-5114-4930-80B4-0A02052ACE9F.png','시험에 나올것 같은 예상문제를 각자 뽑아와 함께 풀어보면서 공부하였습니다!','2020-06-17 13:24:42.214480','group10',8210,204,'2020-06-17 13:19:58.931373','알고리듬 기말고사 공부','8:20-10:20',10,120),(610,'2020/06/18/orig/CAB0B3F8-53C9-4E1F-B4D7-D56F07D58DC2.png','기말고사 시험 범위 review 하였습니다.','2020-06-18 07:34:22.271582','group61',8035,255,'2020-06-18 07:28:11.352086','10일차','15:30',10,60),(611,'2020/06/18/orig/0618.png','<p><br class=\"Apple-interchange-newline\">지금 저희에게 필요한 소양은 무엇인가에 대해서도 토론하였습니다<br></p><p><br></p><p>이런 저런 대화를 통해 저희는 \'하루 10시간씩 앉아서 코딩 하다보면 뭔가를 깨닫겠지\' 라는 결론에 도달했습니다</p><p>그냥 하면 실력이 좋아지겠지... 라는 막연한 생각이 아직 자리 잡고 있는 지금</p><p>모두 자신의 방향성을 잊지 않고 살아 갔으면 좋겠습니다</p><p><br></p><p>토론 내용</p><p>1. 프로그래머의 소양</p><p>2. 우리는 어떤 것을 공부해야 하는가?</p><p>3. 우리는 어떤 것을 준비해야 하는가?</p><p>4. 우리가 하고자 하는 프로그래머는 어떤 직업인가?</p>','2020-06-18 12:15:28.637078','group8',6134,202,'2020-06-18 12:14:20.064742','프로그래머에게 꼭 필요한 소양은 무엇인가','19:50',9,70),(612,'2020/06/21/orig/10-20200621-2100-2230.JPG','<p>한 학기 study 마무리.</p><p>OS 시험 , 알고리즘 시험 후기 및 피드백.</p><p>다음학기 목표 설정.</p><p>서로 부족한 점과 잘했던 점 나누기.</p>','2020-06-21 13:52:18.268307','group4',1427,198,'2020-06-21 13:49:03.127651','study 마무리 및 후기','21:00',10,90);
